var book = {
	"name": "စ့ၩရၫ့",
	"numChapters": 21,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭဆၧမၩအၥၭ လၧစယီရှုၫအ့ၫၥံၫဝ့ၫအလးခဲၫ့ နီၪ,ၦအံၫစရ့လၭဖိၪအၪ့စၪ့ယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, မွဲပလၫမိဘၪလ့ၩထၪ့ထၫ့ဒၩဆိၫ ၦကၫနအၫ့ဖိၪလၧပ",
			"2": "<sup>2</sup> ဂးဘဲၫၥိၭအမိဒုၭၥုၭထၫ့ဒၩအဝ့ၫၥံၪလဂၩလဲၪ.- တၭ ယဟိဝၩစံၭဝ့ၫဒၪ, စယုဒၫမိဘၪလ့ၩထၪ့လီၫ. ယိခွါ, ယဖ့ၪလၫ့ယူၭ ထံၫၥံၪခးၥံၪ လၧအဝ့ၫဒၪ အစူၪဖၧၩ့ ယူၭ.",
			"3": "<sup>3</sup> တၭစယုဒၫစံၭအထၧၫ့ဖုဝဲစစံမအၧၫ့နီၪ, ဂဲၫထၪ့ လၧယၥိၭလၧယဆၧဖၭန့အဖၧၩ့, ဘဲၫၥိၭပမိဒုၭၥုၭထၫ့ ဒၩၦကၫနအၫ့ဖိၪနီၪဆံၭ. တၭယဝ့ၫဒၪယီၩ ယမိလ့ၩ ဆၧလၧနၥိၭဆ့လၧနဆၧဖၭန့ဒၪနဝ့ၫအဖၧၩ့လီၫ. တၭ",
			"4": "<sup>4</sup> စစံမအၧၫ့လ့ၩထၪ့လၧအၥိၭလီၫ.- စယုဒၫလ့ၩထၪ့ တၭ,ယဟိဝၩဖ့ၪလၫ့ၦကၫနအၫ့ဖိၪ, ၦပံရ့ၭဖိၪလဖၪ နီၪလၧအစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪဖ့ၬခွံၬဝ့ၫလၧဘံဇ့ၭအ",
			"5": "<sup>5</sup> ဖၧၩ့ၦၡၩလလၬလီၫ.- အဝ့ၫၥံၪဒၪန့စအဒိၫနဲၫဘံဇ့ၭ, လၧဘံဇ့ၭအဖၧၩ့တၭ, ဒုၭၥုၭထၫ့ဒၩဝ့ၫတၭ, ဖ့ၬခွံၬၦ",
			"6": "<sup>6</sup> ကၫနအၫ့ဖိၪ, ဒဲၦပံရ့ၭဖိၪလဖၪလီၫ.- အ့ၪမွဲစအဒိၫနဲၫ ဘံဇ့ၭနီၪစဲၪ့ဖျိၭဝ့ၫတၭ, အဝ့ၫၥံၪလီၩ့ဆီးဝ့ၫတၭ,ချႃၭ",
			"7": "<sup>7</sup> န့ဝ့ၫတၭ,ဒၪ့ထ့ၬခွံၬအစူၪမုဒဲအခၪ့မုနီၪလီၫ.- တၭစအ ဒိၫနဲၫဘံဇ့ၭနီၪစံၭဝ့ၫဒၪ, စဎွၩနွ့ၫဆံၫလၧအစူၪမု ဒဲ အခၪ့မုဘၪဆၧဖ့ၬထၪ့ဝ့ၫနီၪ အၪ့ထုၫ့န့ဆၧလၧယစပွဲ အဖၫ့လၬလီၫ. ဘဲၫယမၩယူၭအၥိၭနီၪ, ယွၩဖ့ၪထဲၩ့ ယၧၩဘဲၫနီၪအၥိၭဆ့လီၫ. တၭအဝ့ၫၥံၪဂဲၫဆိၬအဝ့ၫ လၧယရုစလံၫ့တၭ, ၥံၫဝ့ၫထီးနီၪလီၫ.",
			"8": "<sup>8</sup> ၦယုဒၫဖိၪဒုၭဆၧထၫ့ဒၩ ယရုစလံၫ့ယူၭတၭ, မၩ န့ယူၭဝ့ၫဒဲဖ့ၬခွံၬဝ့ၫလၧနၭအနါတၭ, ဆူၭထၪ့ဒိၩ့နီၪလၧ",
			"9": "<sup>9</sup> မ့ၪလီၫ.- လၧခဲၫ့ထဲၩ့တၭ ၦယုဒၫဖိၪလ့ၩလၩ့ဒုၭဆၧ ထၫ့ဒၩၦကၫနအၫ့ဖိၪလၧ အအီၪလၧခိၪလီၩ့ထိၩ့ချိၬ,ဒဲ",
			"10": "<sup>10</sup> လၧမုခံၫ့လခီၫ, ဒဲလၧဆၧဒၩဖၧၩ့လီၫ.- တၭစယုဒၫလ့ၩ ထၪ့ထၫ့ဒၩၦကၫနအၫ့ဖိၪ လၧအအီၪလၧဟံဘြၧၫ့အ ဖၧၩ့ (လၧအၥၫ့နီၪဟံဘြၧၫ့အမံၩ့မွဲကၧၫယၭအၫဘၫ) တၭအဝ့ၫၥံၪဖ့ၬၥံၫခွံၬ စၡံၡဲၫ, ဒဲစအယဲမၫ့, ဒဲစတၫလ",
			"11": "<sup>11</sup> မ့ၫလီၫ.- အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬထီးနီၪ ထၫ့ဒၩၦဒံဘၧၫ ဖိၪတၭ, (လၧအၥၫ့နီၪဒံဘၧၫအမံၩ့မွဲကၧၫယၭစံဖၧၫ လီၫ.)",
			"12": "<sup>12</sup> စကၫလ့ၭစံၭဝ့ၫဒၪ, ၦလၧအဖ့ၬကၧၫယၭစံဖၧၫဒဲ မၩန့ဝ့ၫလဂၩဂၩနီၪတၭ, ယမိဖ့ၪလၫ့အဝ့ၫလၧယဖိၪ",
			"13": "<sup>13</sup> မုၪနးအၭစၫလၧအမၫအဂးလီၫ.- တၭစကၫလ့ၭအဖု စကံနၭအဖိၪခွၫစအီၭၥနံၫအ့လၭနီၪ မၩန့ဝ့ၫတၭ,အ ဝ့ၫဒၪဖ့ၪလၫ့အဖိၪမုၪနးအၭစၫ လၧအမၫအဂးလီၫ.",
			"14": "<sup>14</sup> ထီးၦမုၪနီၪဂဲၫလၧအအီၪတၭ ဆၧမၩအၥၭလၧအထိၪ ဂဲၩဝ့ၫ,ဘဲၫၥိၭအမိအၪ့ကံၩ့ အဖါဖ့ၪလၫ့ဂၪ့ခိၪအဝၩ့နး စီၪ့တၭး မွဲအစဲၪ့လၩ့ခွံၬဝ့ၫ လၧအကၥ့ၪယီၩ့အလီၩ့ တၭ,စကၫလ့ၭစံၭဝ့ၫ, ဘၪနၥၭလၧဆၧနီၪလမံၩ့လဲၪ.",
			"15": "<sup>15</sup> တၭအဝ့ၫနီၪစံၭဝ့ၫ, ဖ့ၪလၫ့ယၧၩ လၧဆၧဆိၪဂ့ၩဆံၭ. အဂဲးဘဲၫယီၩ နဖ့ၪလၫ့ယူၭယၧၩ လၧဂၪ့ခိၪလၧမုခံၫ့ လခီၫယူၭ. ဖ့ၪလၫ့ယၧၩဆ့လၧထံၫထၪ့ဖျိၭလဖၪဆံၭ တၭစကၫလ့ၭဖ့ၪလၫ့ဝ့ၫ လၧထံၫထၪ့ဖျိၭ လၧထၭလ ခီၫ,ဒဲလၧထံၫထၪ့ဖျိၭလၧ လၬလခီၫလဖၪနီၪလီၫ.",
			"16": "<sup>16</sup> တၭၦကံၫ့နဲၭဖိၪ, စမိစ့ၭအမံၩ့ၡါလဂၩအဖိၪလ ဖၪ,စဲၪ့ထၪ့ခွံၬလၧၥံၪ့စီၩ့မလီၫ့အဒိၩ့ လၧၦယုဒၫဖိၪလ ဖၪအၥိၭ, လ့ၩဝ့ၫလၧယုဒၫအၡါမုနၧၫ့ဖၫလၧအအီၪ လၧအၫရၭအမုခံၫ့လခီၫတၭ, အဝ့ၫၥံၪလ့ၩအီၪဝ့ၫလၧ ၦခမျၧးအကျၩလီၫ.",
			"17": "<sup>17</sup> စယုဒၫလ့ၩဝ့ၫလၧအထၧၫ့ဖုဝဲ စစံမအၧၫ့အၥိၭ တၭ,အဝ့ၫၥံၪနီၪ ဖ့ၬခွံၬၦကၫနအၫ့ဖိၪ လၧအအီၪဝ့ၫလၧ ဇံဖၭအဖၧၩ့တၭ, မၩဂၭဂီၩ့ဝ့ၫလူၬလီၫ. တၭဒိၩ့အမံၩ့မွဲ",
			"18": "<sup>18</sup> ဟီမၫလီၫ.- စယုဒၫမၩန့ဂၫဇၫဆ့ဒဲအနဲၩ့ထံၭ, ဒဲအၭ စလၧၫ့ဒဲအနဲၩ့ထံၭ, ဒဲအ့ကြၧၫ့ဒဲအနဲၩ့ထံၭနီၪလီၫ.",
			"19": "<sup>19</sup> ယဟိဝၩအီၪက့ၪဝ့ၫလၧ စယုဒၫအၥိၭတၭ, နၫ့ထၪ့ခွံၬ ၦခိၪလီၩ့ဖိၪလီၫ. အ့ၪမွဲလၧဆၧဒၩဖၧၩ့နီၪ နၫ့ထၪ့ခွံၬဝ့ၫ ၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအီၪလၧအလဲၪ့ၥုၭထၭ",
			"20": "<sup>20</sup> လီၫ.- တၭအဝ့ၫၥံၪ ဖ့ၪလၫ့ဟံဘြၧၫ့ လၧစကၫလ့ၭ, ဘဲၫစမိစ့ၭစံၭဝ့ၫအၥိၭနီၪလီၫ. တၭအဝ့ၫဒၪနၫ့ထၪ့ခွံၬ စအၫနၭအဖိၪခွၫၥၧၫ့ဂၩလီၫ.",
			"21": "<sup>21</sup> တၭၦဘံၪ့ယမံၫ့ဖိၪနၫ့ထၪ့ခွံၬ ၦယ့ဘုၫဖိၪလၧအ အီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့အ့ၬ. အ့ၪမွဲၦယ့ဘုၫဖိၪ အီၪဝ့ၫလၧၦဘံၪ့ယမံၫ့ဖိၪၥံၪအကျၩ လၧယရုစလံၫ့အ ဖၧၩ့ခီးမုဆၫလနံၩယီၩလီၫ.",
			"22": "<sup>22</sup> တၭစယိၥၭအၡၩဂံၪ့ဖိၪလ့ၩထၪ့ ထၫ့ဒၩဆ့ဘ့ၥလၭ",
			"23": "<sup>23</sup> တၭ,ယဟိဝၩအီၪလၧအဝ့ၫၥံၪအၥိၭလီၫ.- တၭစယိ ၥၭအၡၩဂံၪ့ဖိၪအၪ့မၧၫ့လၩ့ ၦလ့ၩယိၥူၪဘ့ၥလၭလီၫ. တၭလၧအၥၫ့ဒိၩ့နီၪအမံၩ့မွဲလုဇၭလီၫ.",
			"24": "<sup>24</sup> ၦလ့ၩယိၥူၪဆၧလဖၪနီၪ ဒၪဘၪၦလဂၩဂဲၫထၪ့ လၧဒိၩ့ဖၧၩ့တၭ, အဝ့ၫၥံၪစံၭၦလဂၩနီၪ, ဒုၭနဲၪလါပၧၩ လၧဆၧလ့ၩနုၬလၧဒိၩ့ဖၧၩ့အလးနီၪဆံၭး တၭပမိမၩ",
			"25": "<sup>25</sup> နၧၩလၧဆၧယၫ့ၥၭလီၫ.- အဝ့ၫလဂၩဒုၭနဲၪအဝ့ၫၥံၪ လၧဆၧလ့ၩနုၬလၧဒိၩ့ဖၧၩ့အလးတၭ, အဝ့ၫၥံၪဖ့ၬခွံၬ ဒိၩ့နီၪလၧနၭအနါလီၫ. အ့ၪမွဲၦလဂၩနီၪ, ဒဲအဂံၪ့ဒီၪ့",
			"26": "<sup>26</sup> ဖိၪထီးအလူၬနီၪဖျါခွံၬဝ့ၫလီၫ.- တၭၦလဂၩနီၪလ့ၩ ဝ့ၫလၧၦဟံၥၭဖိၪအခးဖၧၩ့တၭ မၩကဲၪထၪ့ဒိၩ့လဒိၩ့ တၭကိၭဝ့ၫအမံၩ့လၧလုဇၭလီၫ. အနီၪမွဲအမံၩ့ခီးမု ဆၫလနံၩယီၩလီၫ.",
			"27": "<sup>27</sup> တၭၦအီၪဝ့ၫလၧဘ့ၭၥၡံအၫ့ဒဲအတဝၫ့လဖၪ, တၫ အၫနၭဒဲအတဝၫ့လဖၪ, ဒဲၦအီၪလၧ ဒီၫဒဲအတဝၫ့လ ဖၪ,ဒဲၦအီၪလၧအံဘျံၫ့ ဒဲအတဝၫ့လဖၪ,ဒဲၦအီၪလၧမ ဂံၭဒိၫဒဲအတဝၫ့လဖၪ စမနၭစ့ၫနၫ့ထၪ့ခွံၬဝ့ၫဆ့အ့ၬ. တၭၦကၫနအၫ့ဖိၪအီၪဒၪဆၧလၧ ထံၫၥံၪခးၥံၪအဖၧၩ့",
			"28": "<sup>28</sup> နီၪလီၫ.- ထီးအံၫစရ့လၭဆီၪ့ထၪ့တၭ, ဆၧမၩအၥၭ လၧအအၪ့မၧၫ့ ၦကၫနအၫ့ဖိၪၥံၪဖ့ၪ လၫ့အခီၫ့တၭ, နၫ့ထၪ့ခွံၬအဝ့ၫၥံၪတၡါအ့ၬ.",
			"29": "<sup>29</sup> တၭစအံဖြံၫ့နၫ့ထၪ့ခွံၬ ၦကၫနအၫ့ဖိၪအီၪဝ့ၫလၧ ဂံဇၧၫအဖၧၩ့နီၪဆ့အ့ၬ. အ့ၪမွဲၦကၫနအၫ့ဖိၪအီၪဝ့ၫလၧ ဂံဇၧၫအဖၧၩ့ လၧအဝ့ၫၥံၪအကျၩလီၫ.",
			"30": "<sup>30</sup> တၭစဇ့ၭဘလၧၫ့နၫ့ထၪ့ခွံၬ ၦအီၪဝ့ၫလၧကံတြၧၫ့ အဖၧၩ့,ဒဲၦအီၪဝ့ၫလၧနဟၫလလၭအဖၧၩ့ဆ့အ့ၬ. အ့ၪ မွဲၦကၫနအၫ့ဖိၪအီၪဝ့ၫလၧအကျၩတၭ ကဲၪထၪ့ၦဘၪ ဖ့ၪလၫ့အခီၫ့လီၫ.",
			"31": "<sup>31</sup> ၦအီၪဝ့ၫလၧအၭကိၫအဖၧၩ့, ဒဲလၧဇဲဒၧၫ့အဖၧၩ့, ဒဲလၧအၫလၭအဖၧၩ့, ဒဲလၧအၭဇံၭအဖၧၩ့, ဒဲလၧဟ့ၫ လဘၫအဖၧၩ့, ဒဲလၧအၫဖၭအဖၧၩ့, ဒဲလၧရံဟီၭအ",
			"32": "<sup>32</sup> ဖၧၩ့နီၪ,စအၭၡၧၫနၫ့ထၪ့ခွံၬဝ့ၫဆ့အ့ၬ.- အ့ၪမွဲၦအၭ ၡၧၫဖိၪအီၪဝ့ၫလၧၦကၫနအၫ့ဖိၪ, ၦခးဖိၪအကျၩနီၪ လီၫ. အဂဲးဘဲၫယီၩ မွဲအနၫ့ထၪ့ခွံၬဝ့ၫအ့ၬ.",
			"33": "<sup>33</sup> ၦအီၪဝ့ၫလၧဘ့ၭၥၡံမ့ၭအဖၧၩ့, ဒဲၦအီၪဝ့ၫလၧဘ့ၭ ၥနၭအဖၧၩ့နီၪး စနၭၥလဲၫနၫ့ထၪ့ခွံၬဆ့အ့ၬ. မွဲအအီၪ ဝ့ၫလၧၦကၫနအၫ့ဖိၪ, ၦခးဖိၪအကျၩနီၪလီၫ. မွဲလါနၫ့ ၦအီၪဝ့ၫလၧဘ့ၭၥၡံမ့ၭအဖၧၩ့, ဒဲၦအီၪဝ့ၫလၧဘ့ၭၥနၭ အဖၧၩ့လဖၪနီၪ ကဲၪထၪ့ၦဖ့ၪလၫ့အခီၫ့ လၧအဝ့ၫၥံၪ အစူၪဖၧၩ့လီၫ.",
			"34": "<sup>34</sup> တၭၦအၫမိၫဖိၪအၪ့မၧၫ့ဆီၪ့ ၦဒၫ့ဖိၪလ့ၩထၪ့လၧခိၪ လီၩ့ထိၩ့ချိၬအကျၩလီၫ. အဂဲးဘဲၫယီၩမွဲအဖ့ၪလၫ့အ ဝ့ၫၥံၪဂဲၫလၩ့လၧဆၧဒၩဖၧၩ့အ့ၬ.",
			"35": "<sup>35</sup> အ့ၪမွဲၦအၫမိၫဖိၪ အီၪဒၪဆၧလၧခိၪလီၩ့ဟံရ့ၭလၧ အၭဇလၧၫ့အဖၧၩ့, ဒဲလၧၡအၫလဘံၫ့အဖၧၩ့လီၫ. မွဲ လါနၫ့စယိၥၭအၡၩဂံၪ့ဖိၪအစူၪ မၩနၧၩ့မၩစၪဝ့ၫတၭ, အဝ့ၫၥံၪကဲၪထၪ့ၦဖ့ၪလၫ့အခီၫ့လီၫ.",
			"36": "<sup>36</sup> တၭၦအၫမိၫဖိၪအခးနဲၩ့ထံၭနီၪ အီၪဝ့ၫလၧဆၧဂဲၫ ထၪ့လၧအၭရဘံၫ့ လၧဒိၩ့စ့လၫ, ထၪ့ဝ့ၫလၧထၭလ ခီၫနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ယဟိဝၩအၥီၫ့လဂၩနီၪ ဂဲၫထၪ့လၧဂံလဂၫလၭဖိး လၧဘိခံၫ့တၭ, စံၭဝ့ၫဒၪ, ယဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪလၧအံ ဇံၭအဖၧၩ့တၭ, ယဒုၭဂဲၫနုၬနၥံၪလၧထံၫၥံၪခးၥံၪအ ဖၧၩ့လၧယဆိၪလၩ့ယၥၭ လၧနၥံၪအဖါလဖၪ လၧအ ဂဲးအကၠီၪ့တၭ, ယစံၭယမိမၩဂၭဂီၩ့ ယဆၧအုၩ့လၩ့",
			"2": "<sup>2</sup> လၧနၥံၪနးဆိၭအ့ၬ.- တၭနၥံၪမၩဘၪဆၧအုၩ့လၩ့လၧ ၦအီၪဝ့ၫလၧခးဖၧၩ့ယီၩလၩလါဆ့အ့ၬ. နၥံၪဘၪမၩ လၩ့ဎီးခွံၬအဝ့ၫၥံၪအဆၧလုလးလီၫ. မွဲလါနၫ့နၥံၪခိၭ နၪယလူအ့ၬ.",
			"3": "<sup>3</sup> မွဲဘၪနီၫနၥံၪမၩဆၧယီၩလဲၪ. မၩအၥၭဘဲၫနီၪတၭ ယစံၭဆ့ယနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧနၥံၪအမ့ၬယၫအ့ၬ. အဝ့ၫၥံၪမိကဲၪထၪ့ဆၧဆူၪ လၧနၥံၪအဂုၬဖၩအဖၧၩ့, ဒဲအဝ့ၫၥံၪအယွၩလဖၪနီၪ မိကဲၪထၪ့ဆၧဖျံၩခွၩ့လၧန ၥံၪအဂးလီၫ.",
			"4": "<sup>4</sup> ထီးယဟိဝၩအၥီၫ့ချဲၩ့ဆၧချဲၩ့နီၪ လၧၦအံၫစရ့လၭ ဖိၪထီးအလူၬတၭ, ဆၧမၩအၥၭလၧၦခမျၧးကိၭၡၭ",
			"5": "<sup>5</sup> ထၪ့လၧအလူတၭဂၪ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪကိၭဆၧအလး နီၪအမံၩ့ဘိခံၫ့တၭ, အဝ့ၫၥံၪလုထၪ့ဆၧလၧယဟိဝၩ ထီးနီၪလီၫ.",
			"6": "<sup>6</sup> လၧစယီရှုၫအ့ၫကွဲၪဖျါခွံၬၦခမျၧးနီၪဂီၩ့တၭ, အံၫ စရ့လၭဖိၪလ့ၩလဂၩလၧအဆၧန့ၥၫ, လဂၩလၧအ",
			"7": "<sup>7</sup> ဆၧန့ၥၫ,ဘဲၫၥိၭအမိန့ဘၪထံၫၥံၪခးၥံၪနီၪလီၫ.- တၭၦ ခမျၧးမၩယဟိဝၩအဆၧ လၧစယီရှုၫအ့ၫအမုနံၩလဖၪ ထီးအလူၬအဖၧၩ့, ဒဲလၧၦၥုၪ့က့ၭၥၭၡါ လၧအမၧၫ့ဒံၭ လၧစယီရှုၫအ့ၫအလးခဲၫ့ အမုနံၩထီးအလူၬအဖၧၩ့ နီၪ,လၧအဒၪဘၪယဟိဝၩအဆၧမၩ ဖၭဒိၪလဖၪလၧ အမၩဝ့ၫလၧအံၫစရ့လၭအဂး ထီးအလူၬအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩအခ့ၫအၡၩစနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫအၥၭ",
			"9": "<sup>9</sup> ၡါအနံၪ့လယၩလဆံၫတၭ,ၥံၫဝ့ၫလီၫ.- တၭအဝ့ၫၥံၪ ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအဆၧန့ၥၫအခးနဲၩ့ လၧတံၫမ နၭဟံရ့ၭလၧအအီၪလၧခိၪလီၩ့အံဖြံၫ့အလီၩ့ လၧခိၪ",
			"10": "<sup>10</sup> လီၩ့ဂၫအၭအမုဖၩလခီၫနီၪလီၫ.- တၭၦလဆိၩထီး အလူၬနီၪ ဘၪဆၧအီၪက့ၪကီၪ့ဝ့ၫလၧအဖါ လဖၪဆ့ လီၫ.တၭၦအဂူၫဂၩလဆိၩ အီၪထၪ့လၧအလးခဲၫ့လၧ အလၥ့ၪယၫဘၪယဟိဝၩ ဒဲအဆၧမၩလၧအမၩဝ့ၫလၧ အံၫစရ့လၭအဂးနီၪလီၫ.",
			"11": "<sup>11</sup> ၦအံၫစရ့လၭဖိၪ မၩဆၧအၧၩ့ လၧယဟိၩအမ့ၬ",
			"12": "<sup>12</sup> ယၫတၭ,မၩဘၫအလၭၥံၪအဆၧလီၫ.- အဝ့ၫၥံၪစဲၪ့ဒၪ ယဟိဝၩအဝ့ၫၥံၪအဖါလဖၪအယွၩ လၧအဒုၭစဲၪ့ထၪ့ ခွံၬဝ့ၫလၧအံဇံၭအဖၧၩ့တၭ, ဖိၬယွၩအဂူၫဂၩလဖၪအ ခဲၫ့ၦခမျၧးလၧအအီၪဝၬဖီၩ့ဝ့ၫအယွၩလဖၪ, ဒဲဘိၪ့ထၪ့",
			"13": "<sup>13</sup> ဘၩထၪ့ဝ့ၫ, ဒဲမၩၥၭထၪ့ယဟိဝၩလီၫ.- အဝ့ၫၥံၪစဲၪ့ဒၪ ယဟိဝၩတၭ, မၩဘၫအလၭဒဲအၭၡတြီၭအဆၧလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪ အံၫစရ့လၭတၭဖ့ၪ လၫ့ခွံၬဝ့ၫလၧၦအၪ့ဂူၬန့ဆၧအစူၪဖၧၩ့ လၧအအၪ့ဂူၬ န့ဆၧတၭ အၪ့ဆၫခွံၬအဝ့ၫၥံၪ လၧအဒုၪအဒၩအီၪဝၬ ဖီၩ့ဝ့ၫလဖၪအစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪဆၧၫ့ထုၪ့လၧအ",
			"15": "<sup>15</sup> ဒုၪအဒၩအမ့ၬယၫၥ့ၪလၧၩ့အ့ၬ.- တၭထီးဒၪအဝ့ၫၥံၪ လ့ၩဆၧလစီၪ့လါလါနီၪ, ယဟိဝၩအစူၪထၫ့ဒုၪဒၩဝ့ၫ လၧဆၧအၧၩ့အဂး ဘဲၫယဟိဝၩ စံၭယူၭဝ့ၫအၥိၭနီၪ, ဒဲဘဲၫယဟိဝၩဆိၪလၩ့ယူၭအၥၭ လၧအဝ့ၫၥံၪအဂဲး အၥိၭနီၪတၭ, အဝ့ၫၥံၪအၥုၪ့ခိအၥၭဝီၩဒိၪမၬလီၫ.",
			"16": "<sup>16</sup> မွဲလါနၫ့ယဟိဝၩဒုၭအီၪထၪ့ ၦစ့ၩရၫ့ဆၧလဖၪလၧ အမၩဖီၩ့ဖျ့ၭဝ့ၫ လၧၦလၧအအၪ့ဂူၬန့ အဆၧလဖၪအ",
			"17": "<sup>17</sup> စူၪဖၧၩ့လီၫ.- မွဲလါနၫ့တၭ အဝ့ၫၥံၪခိၭနၪၦစ့ၩရၫ့ဆၧ အလူဆ့အ့ၬ. အ့ၪမွဲလ့ၩမၩမၪထွ့ၫယွၩအဂူၫဂၩလ ဖၪအခဲၫ့လၧအၥၭလဲးၥၭဘျၪတၭ, ဘိၪ့ထၪ့ဘၩထၪ့အ ဝ့ၫၥံၪတၭ, ကၠၪပဲၩခွံၬအၥၭချဲၫ့ချဲၫ့ လၧဖၧၩ့ၥၭလၧအ ဖါလဖၪဖိၬဝ့ၫဒဲခိၭနၪယဟိဝၩ အဆၧမၪလူၬလီၫ.တၭ အဝ့ၫၥံၪမၩဆၧဘဲၫနီၪအ့ၬ.",
			"18": "<sup>18</sup> ထီးယဟိဝၩဒုၭအီၪထၪ့န့ ၦစ့ၩရၫ့ဆၧလဖၪလၧ အဝ့ၫၥံၪအဂးတၭ, ယဟိဝၩအီၪလၧၦစ့ၩရၫ့ဆၧနီၪအ ၥိၭတၭ, မၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪ လၧအဒုၪအဒၩအစူၪ ဖၧၩ့လၧၦစ့ၩရၫ့ဆၧအမုနံၩ ထီးအလူၬ အထးဖၧၩ့နီၪ လီၫ.အဂဲးဘဲၫယီၩ ယဟိဝၩနီၫ့ယါလၩ့ထဲၩ့ အၥၭ လၧအဝ့ၫၥံၪ အဆၧဂၪ့အုၩဂၪ့ထိၬအကၠီၩ့ လၧအအီၪ လၧၦမၩအၧၩ့မၩၥၫ့ ဒဲမၩခိမၩဝီၩဝ့ၫအကၠီၩ့လီၫ.",
			"19": "<sup>19</sup> ထီးၦစ့ၩရၫ့ဆၧလဂၩနီၪ ၥံၫဝ့ၫအလးခဲၫ့တၭ, ဆၧ မၩအၥၭလၧအဝ့ၫၥံၪထဲၩ့ထဲၩ့တၭ, မၩၥၭလိၪလၩ့အ ၥၭနၭနဲၪ့အဖါလဖၪ, လၧအလ့ၩဖိၬယွၩအဂူၫဂၩလဖၪ အခဲၫ့ဘဲၫၥိၭအမိမၩအဆၧ, ဒဲဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫတၭ, လၧအမၩအဆၧဒၪဝ့ၫမွဲဂ့ၩ, ဒဲလၧအမၩနၧၫ့ထၧၫ့အ ၥၭနီၪမွဲဂ့ၩ, အီၪထီခွံၬဝ့ၫအ့ၬ.",
			"20": "<sup>20</sup> ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪ အံၫစရ့လၭတၭ,စံၭ ဝ့ၫဒၪ, မွဲၦခမျၧးယီၩ လၨၪခၫ့ဖၬယဆၧအုၩ့လၩ့လၧ ယမၪလူၬအဖါလဖၪ, ဒဲလခိၭနၪဘၪ ယလူအကၠီၩ့",
			"21": "<sup>21</sup> တၭ,- စူၩယၫလခီၫနီၪၦဆၨၩလဖၪ လၧစယီရှုၫအ့ၫလၧ အၥံၫအထီ အီၪက့ၪလၩ့ထးဝ့ၫလဖၪနီၪ ယမိနၫ့ထၪ့",
			"22": "<sup>22</sup> ခွံၬလၧၩ့လၧအဝ့ၫၥံၪအမ့ၬယၫဆ့အ့ၬ.- ဘဲၫၥိၭလၧ အဝ့ၫၥံၪအကၠီၩ့နီၪ, ယမိမၩခွါအံၫစရ့လၭး လၧအမိ ထီးန့ယဟိဝၩအဖၧၩ့ၥၭလၧအမိဖိၬဝ့ၫ ဘဲၫအဝ့ၫၥံၪအ ဖါလဖၪမၩဝ့ၫအၥိၭနီၪဧၪ, လထီးန့ဘၪဧၪ, နီၪလီၫ.",
			"23": "<sup>23</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩအီၪက့ၪလၩ့ထးၦအ ဆၨၩလဖၪနၫ့ထၪ့ခွံၬဝ့ၫ ချဲၫ့ချံၭအ့ၬ, တၭမွဲအဖ့ၪလၫ့ ခွံၬအဝ့ၫၥံၪ လၧစယီရှုၫအ့ၫအစူၪဖၧၩ့ဆ့အ့ၬ."
		},
		"3": {
			"1": "<sup>1</sup> တၭၦဆၨၩလဖၪလၧယဟိဝၩ အီၪက့ၪလၩ့ထး ဘဲၫၥိၭအမိမၩခွါအံၫစရ့လၭ လၧအဝ့ၫၥံၪအကၠီၩ့မွဲ အယီၩ,ကယဲၦလၧအလၥ့ၪယၫဘၪ ကၫနအၫ့အဆၧ",
			"2": "<sup>2</sup> ဒုၭၥုၭထီးအလူၬး- ဘဲၫၥိၭၦအံၫစရ့လၭဖိၪအဆိၩလ ဖၪမိၥ့ၪယၫ,ဒုၭမၩလိၪအဝ့ၫၥံၪ လၧဆၧဒုၭၥုၭ,န့ၫၦလၧ",
			"3": "<sup>3</sup> အလၥ့ၪယၫဝဲၩဘၪဝ့ၫလၧအၥၫ့နီၪလီၫ.- ၦဖလံၡၫဖိၪ အၦဒိၪယဲဂၩ,ဒဲၦကၫနအၫ့ဖိၪထီးအလူၬ, ဒဲၦစဲဒၧၫ့ဖိၪ ၥံၪ,ဒဲၦဟံဝဲၫဖိၪၥံၪလၧအအီၪဝ့ၫ လၧခိၪလီၩ့လ့ၭဘ နၧၫ့အလီၩ့, လၧခိၪလီၩ့ဘၫအလၭဟၧမၧၫ့ဖိးလၧဆၧ",
			"4": "<sup>4</sup> လ့ၩနုၬလၧဟၫမၭလီၫ.- အဝ့ၫၥံၪအီၪဝ့ၫဘဲၫၥိၭအမိ မၩခွါအံၫစရ့လၭ လၧအမိခိၭနၪ ယဟိဝၩအဆၧမၪ လူၬလၧအမၪလူၬအဖါလဖၪ လၧစမိစ့ၭအစူၪဖၧၩ့ဧၪ, လခိၭနၪဘၪဧၪနီၪ, ဘဲၫၥိၭအမိၥ့ၪယၫလီၫ.",
			"5": "<sup>5</sup> ၦအံၫစရ့လၭဖိၪအီၪဝ့ၫလၧၦကၫနအၫ့ဖိၪ, ၦဟံၥၭ ဖိၪ,ဒဲၦအၫမိၫဖိၪ,ဒဲၦဂၧရ့ၭဖိၪ, ဒဲၦဟံဝဲၫဖိၪ,ဒဲၦယ့",
			"6": "<sup>6</sup> ဘုၫဖိၪအကျၩနီၪလီၫ.- တၭအဝ့ၫၥံၪမၩန့ၦၡၩၥံၪနီၪ အဖိၪမုၪလဖၪလၧအမၫ, ဒဲဖ့ၪလၫ့အဖိၪမုၪဒၪဝ့ၫလဖၪ လၧအဝ့ၫၥံၪအဖိၪခွၫလဖၪနီၪတၭ, မၩအဝ့ၫၥံၪအယွၩ လဖၪအဆၧမၩလီၫ.",
			"7": "<sup>7</sup> တၭၦအံၫစရ့လၭဖိၪ မၩဆၧအၧၩ့ လၧယဟိဝၩ အမ့ၬယၫ, ဒဲၥၭနၪ့ခွံၬယဟိဝၩ အဝ့ၫၥံၪအယွၩတၭ,",
			"8": "<sup>8</sup> မၩဘၫအလၭၥံၪ ဒဲအၭၡတြီၭအဆၧမၩလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪ အံၫစရ့ လၭတၭ, အၪ့ဆၫခွံၬအဝ့ၫၥံၪလၧမ့စိၫပတ့မၠၫအစဎွၩ ခုၡၫ့ရံၭၡၥ့အံၫ့အစူၪဖၧၩ့တၭ, ၦအံၫစရ့လၭဖိၪ မၩစခု ၡၫ့ရံၭၡၥ့အံၫ့အဆၧမၩနီၪ ဎိၭနံၪ့လီၫ.",
			"9": "<sup>9</sup> ထီးၦအံၫစရ့လၭဖိၪကိၭထၪ့ယဟိဝၩတၭ, ယဟိ ဝၩဒုၭအီၪထၪ့ၦမၩဖီၩ့ဖျ့ၭဆၧလဂၩ လၧၦအံၫစရ့လၭ ဖိၪအဂး, လၧအမၩဖီၩ့ဖျ့ၭအဝ့ၫၥံၪ, စကၫလ့ၭအဖု",
			"10": "<sup>10</sup> စကၫနၭအဖိၪခွၫ စအီၭၥနံၫအ့လၭနီၪလီၫ.- ယဟိဝၩ အၥၭအီၪထၪ့လၧအဝ့ၫဒၪအလီၩ့တၭ, အဝ့ၫနီၪစ့ၩရၫ့ အံၫစရ့လၭတၭ, လ့ၩထၪ့ဒုၭၥုၭတၭ, ယဟိဝၩဖ့ၪလၫ့ ခွံၬမ့စိၫပတ့မၠၫအစဎွၩ ခုၡၫ့ရံၭၡၥ့အံၫ့လၧအစူၪဖၧၩ့",
			"11": "<sup>11</sup> တၭ,အဝ့ၫဒၪအစူၪမၩစၪစခုၡၫ့ရံၭၡၥ့အံၫ့လီၫ.- တၭ ထံၫၥံၪခးၥံၪနီၪအီၪပွံၭအနံၪ့လံဆံၫ, တၭစကၫနၭအ ဖိၪခွၫစအီၭၥနံၫအ့လၭနီၪၥံၫဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ၦအံၫစရ့လၭဖိၪမၩဒီၭဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬ ယၫတၭ, ယဟိဝၩဒုၭဆီၪ့ထၪ့ မိအၭအစဎွၩအ့ၭဂ လၧၫ့ထၫ့ဒၩအံၫစရ့လၭလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪ",
			"13": "<sup>13</sup> မၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫအကၠီၩ့လီၫ.- အ ဝ့ၫဒၪဒုၭအီၪကီၪ့ၦအၫမၧၫ့ဖိၪ, ဒဲၦအၫမလ့ၭဖိၪတၭ, လ့ၩကျီၪ့ခွံၬအံၫစရ့လၭဖိၪတၭ, မၩန့ၥံၪ့စီၩ့မလီၫ့အ",
			"14": "<sup>14</sup> ဒိၩ့နီၪလီၫ.- တၭၦအံၫစရ့လၭဖိၪ မၩမိအၭအစဎွၩ အ့ၭဂလၧၫ့အဆၧမၩလဆံၫဎိၭနံၪ့လီၫ.",
			"15": "<sup>15</sup> ထီးၦအံၫစရ့လၭဖိၪကိၭထၪ့ လၧယဟိဝၩတၭ,ယ ဟိဝၩဒုၭအီၪထၪ့ ၦလၧအမၩဖီၩ့ဖျ့ၭဆၧလဂၩလၧအ ဝ့ၫၥံၪအဂး, ၦဘံၪ့ယမံၫ့ဖိၪ, ၦမၩဆၧလၧစူၪစ့ၪၥ့ၪ, စဂ့ရၫအဖိၪခွၫစအ့ဟၧၭလီၫ. တၭၦအံၫစရ့လၭဖိၪ ဖ့ၪယူလၬဆီၪ့လၧအဝ့ၫဒၪအစူၪဖၧၩ့ လၧမိအၭအစဎွၩ",
			"16": "<sup>16</sup> အ့ၭဂလၧၫ့နီၪလီၫ.- တၭစအ့ဟၧၭမၩကဲၪထၪ့နၭလၧ အနါအဲၪ့နံၫခီၫလူၬလဘံၪ့ လၧအနၫ့ဆါအဂး,အထီၫ လဖျါတၭ, စၧၩ့ထၬဝ့ၫလၧအကံၪဒူၪအထွ့ၪလခီၫအ",
			"17": "<sup>17</sup> လီၩ့လၧအကီၩ့အၥိၭအဖၫ့လၬလီၫ.- တၭအဝ့ၫလ့ၩ ဆိၬလၬဆီၪ့နီၪ လၧမိအၭအစဎွၩ အ့ၭဂလၧၫ့အအီၪ လီၫ.တၭစအ့ၭဂလၧၫ့နီၪ မွဲၦအဘီၪ့ဒိၪမၬလီၫ.",
			"18": "<sup>18</sup> တၭထီးအဖ့ၪလၫ့လၬဆီၪ့ဂီၩ့တၭ, ဖျါခွံၬၦလၧအ",
			"19": "<sup>19</sup> ဆိၬလၬဆီၪ့လဖၪနီၪလီၫ.- အ့ၪမွဲအနၫ့ဆါဒၪဝ့ၫနီၪကၠၪ ခွံၬအၥၭလၧဆၧဂၩ့ဆၧဖၪ့ လၧဂံလဂၫလၭအနဲၩ့တၭ, စံၭဝ့ၫဒၪ, ယအီၪလၧဆၧချဲၩ့ၥူၪလထံၪလၧနဂး, စဎွၩ ဧ့,တၭအဝ့ၫဒၪစံၭ, အီၪလၩ့မါပံၭဆံၭး တၭၦလၧအ ဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭနီၪ စဲၪ့ထၪ့ခွံၬဝ့ၫလၧအအီၪထီး",
			"20": "<sup>20</sup> အလူၬလီၫ.- စအ့ဟၧၭဂဲၫလၧအအီၪတၭ, အဝ့ၫဒၪ ဆၧၫ့နၩ့လၧဒူၭရှူၪလၩ့အလးဖၧၩ့ လၧအအီၪလၧအ နၫ့ဆါလဂၩဎးအဂးလီၫ. တၭစအ့ဟၧၭ စံၭဝ့ၫဒၪ, ယအီၪလၧယွၩအဆၧချဲၩ့လၧနဂးလီၫ. တၭအဝ့ၫဒၪ",
			"21": "<sup>21</sup> ဂဲထုၪ့လၧအလးဆၧၫ့နၩ့လီၫ.- စအ့ဟၧၭယူၬထၪ့အ စူၪစ့ၪတၭ, မၩန့နၭနီၪလၧအကံၪဒူၪအလီၩ့တၭ, ဆ့ၭ",
			"22": "<sup>22</sup> ဝ့ၫလၧအဝ့ၫဒၪအဂူၭဖိၫ့ဖၧၩ့လီၫ.- အထိလ့ၩနုၬဖိၬအ နါအခဲၫ့တၭ, အယၪဒဲအၥိၪဘုၭထၬ လၧအနါနီၪ,ထီး အထုၭထၪ့ခွံၬနၭ လၧအဂူၭဖိၫ့ဖၧၩ့ၥ့ၪအ့ၬ. တၭဖိး",
			"23": "<sup>23</sup> ထၪ့ဝ့ၫလၧအချိၫ့ခိၪလီၫ.- စအ့ဟၧၭစဲၪ့ထၪ့ဝ့ၫလၧထိၬ ချိၫ့တၭ, ကၭဘံၭထၬဒူၭအတရၫ့တၭ, ဝံၬထၬဝ့ၫလၧ",
			"24": "<sup>24</sup> ၥီၭလီၫ.- အဝ့ၫဒၪစဲၪ့ထၪ့တၭ, ဆၧအခ့ၫအၡၩဂဲၫဒၪ ဘၪဝ့ၫတၭ, ယိခွါ,ဒူၭအတရၫ့ ဝံၬထၬအၥၭလၧၥီၭ တၭ,အဝ့ၫၥံၪစံၭဝ့ၫဒၪ, မွဲမၬအလုၬဘံၭအခၪ့လၧဒူၭ",
			"25": "<sup>25</sup> ရှူၪလၩ့အလးအဖၧၩ့နီၪလီၫ.- အဝ့ၫၥံၪအီၪခိၭထီးအ မ့ၬမဲတၭ,ယိခွါ, အဝ့ၫဒၪဝဲထၪ့ဒူၭအတရၫ့အ့ၬ, အခိး မွဲအဝ့ၫၥံၪမၩန့ၥီၭဝဲထၪ့ဝ့ၫတၭ, ယိခွါ,အကဆါလၩ့",
			"26": "<sup>26</sup> ထံၩဖါၥံၫယူၭ လၧဂၪ့ခိၪအဖၫ့ခိၪယူၭ.- လၧအဝ့ၫၥံၪ အီၪခိၭဆၧအဘိၩ့ဘၭနီၪ, စအ့ဟၧၭဖီၩ့ဖျ့ၭဝ့ၫတၭ, လ့ၩဖီၩ့ခွံၬဆၧဂၩ့ဆၧဖၪ့အလးတၭ, ဖီၩ့ဖျ့ၭဝ့ၫဖိးလၧ",
			"27": "<sup>27</sup> စံအရၭအဖၧၩ့လီၫ.- ထီးအထီၩ့ဝ့ၫတၭ, ဆၧမၩအၥၭ လၧအအူၪထၪ့ခွ့ၩလၧခိၪလီၩ့အံဖြံၫ့အလီၩ့တၭ, ၦအံၫ စရ့လၭဖိၪဂဲၫလၩ့လၧအၥိၭ လၧခိၪလီၩ့တၭ,အဝ့ၫဒၪ",
			"28": "<sup>28</sup> အီၪလၧအမ့ၬယၫလီၫ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ဖိၬ ယခဲၫ့ဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩ ဖ့ၪလၫ့ယူၭနၥံၪ အဒုၪအဒၩ ၦမိအၭဖိၪလၧနၥံၪအစူၪဖၧၩ့ယူၭ. အဝ့ၫ ၥံၪဂဲၫလၩ့ဖိၬအခဲၫ့တၭ, မၩန့ယီၫဒၫ့အဆၧခၫ့ဂၬအ လးလၧမိအၭလခီၫတၭ, ဖ့ၪၦခၫ့ဂၬနးဂၩအ့ၬ.",
			"29": "<sup>29</sup> တၭအထီထီးနီၪ အဝ့ၫၥံၪကျီၪ့ခွံၬၦမိအၭဖိၪလ လၬကၪယူၭ. ၦအဘီၪ့,ဒဲၦအၥၭဒူၩထီးအလူၬတၭ,",
			"30": "<sup>30</sup> ဖီၩ့ဖျ့ၭဝ့ၫနးဂၩအ့ၬ.- တၭဆၧလၧမုလနံၩနီၪ မိအၭ စၪဝ့ၫလၧအံၫစရ့လၭအစူၪအဖၫ့လၬလီၫ. တၭထံၫၥံၪ ခးၥံၪနီၪ အီၪပွံၭဝ့ၫအနံၪ့ဎိၭဆံၫလီၫ.",
			"31": "<sup>31</sup> တၭအဝ့ၫဒၪအလးခဲၫ့နီၪ စအၫနၭအဖိၪခွၫ စၡၫ မဂၫဖိးထၪ့, လၧအမၩၥံၫခွံၬ ၦဖလံၡၫဖိၪဎူၫယၩ လၧ နိၪဆ့ၭလၧၦနၫ့ချီဖၫတၭ, အဝ့ၫဒၪမၩဖီၩ့ဖျ့ၭအံၫစရ့ လၭဆ့လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ထီးစအ့ဟၧၭၥံၫဝ့ၫတၭ, ၦအံၫစရ့လၭဖိၪ မၩဒီၭ",
			"2": "<sup>2</sup> ဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫလီၫ.- တၭယဟိဝၩ အၪ့ဆၫခွံၬဝ့ၫ လၧကၫနအၫ့အစဎွၩ ယၫဘံၫ့လၧအ ပၧၩ့ဆၧလၧဟၫဇၫအဖၧၩ့တၭ, အၥုၭမုအခိၪ မွဲစံစ ရၫလၧအအီၪဝ့ၫလၧဟၫရိၡ့ၭ ဘၪဆဲၫ့လၧၦဆၨၩလ",
			"3": "<sup>3</sup> ဖၪလီၫ.- တၭၦအံၫစရ့လၭဖိၪကိၭထၪ့ယဟိဝၩလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪအီၪလၧ လဲၪ့ၥုၭထၭခွံၫယၩ တၭ, မၩအၧၩ့မၩၥၫ့ ၦအံၫစရ့လၭဖိၪ အနံၪ့နံၫဆံၫ",
			"4": "<sup>4</sup> နၭမၬလီၫ.- တၭအထီထီးနီၪ စလၭပဒီၭ အမၫ, မီၪ",
			"5": "<sup>5</sup> မုၪ,နးဒ့ၭဘိၫရၫစ့ၩရၫ့ ၦအံၫစရ့လၭလီၫ.- တၭအီၪ ဝ့ၫလၧဒ့ၭဘိၫရၫအၥံၪ့စီၩ့မလီၫ့အဖၫ့လၬ လၧရၫမၫ, ဒဲဘ့ၥလၭအဘိၩ့ဆၧၩ့, လၧခိၪလီၩ့ အံဖြံၫ့အလီၩ့ တၭ,ၦအံၫစရ့လၭဖိၪ လ့ၩထၪ့လၧအအီၪ ဘဲၫၥိၭအ",
			"6": "<sup>6</sup> မိဒိၭဆၧစ့ၩရၫ့လီၫ.- ၦမုၪနီၪ အၪ့မၧၫ့လၩ့ ဆၧလၧ ကၫဒ့ၭနၭၥလဲၫအဖၧၩ့တၭ, ကိၭန့စအဘံၫ့နိၫအၫ့အ ဖိၪခွၫစဘၫရၭတၭ, စံၭဝ့ၫ, ယဟိဝၩအံၫစရ့လၭအ ယွၩမၪလူၬဝ့ၫ, လ့ၩဆၧ, ၥုၭဘူၭနၥၭလၧခိၪလီၩ့တၫ ဘီၫတၭ,မၩန့ၦနၭၥလဲၫဖိၪ, ဒဲၦဇ့ၭဘလၧၫ့ဖိၪလလၬ",
			"7": "<sup>7</sup> ၥံၪလၧနၥိၭဆံၭ.- တၭယမိဒုၭဂဲၫစယၫဘံၫ့အၥုၭမု အခိၪစံစရၫလၧနအီၪ, လၧထံၫချိၬကံၡၧၫ့, အီၪလၧအ လဲၪ့ၥုၭလဖၪ, ဒဲအၡၩခမျၧးတၭ, ယမိဖ့ၪလၫ့ခွံၬအ",
			"8": "<sup>8</sup> ဝ့ၫဒၪလၧနစူၪဖၧၩ့နီၪလီၫ.- စဘၫရၭ စံၭအဝ့ၫ, နအ့ၪ လ့ၩလၧယၥိၭတၭ, ယမိလ့ၩလီၫ. အ့ၪမွဲနအ့ၪလလ့ၩ",
			"9": "<sup>9</sup> ဘၪလၧယၥိၭတၭ, ယလ့ၩအ့ၬ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ ယမိလ့ၩတၡါလၧနၥိၭလီၫ. မွဲလါနၫ့နဖၧၩ့ၥၭလၧန လ့ၩဆၧကဲၪထၪ့ဘၪ လၧနလၩနဖၩ့အဂးအ့ၬ. အဂဲး ဘဲၫယီၩယဟိဝၩမိအၪ့ဆၫခွံၬ စံစရၫ လၧၦမုၪလဂၩ အစူၪဖၧၩ့လီၫ. တၭနးဒ့ၭဘိၫရၫဂဲထုၪ့တၭ, လ့ၩဆၧ",
			"10": "<sup>10</sup> လၧစဘၫရၭအၥိၭ ဖိးလၧကၫဒ့ၭနီၪလီၫ.- တၭစဘၫ ရၭကိၭန့ စဇ့ၭဘလၧၫ့, ဒဲစနၭၥလဲၫ ဂဲၫလၧကၫဒ့ၭ တၭ,အနၫ့ဆါဒၪဝ့ၫ လ့ၩထၪ့လၧၦၡၩၥံၪလလၬဖိၬအ ခဲၫ့နီၪတၭ, နးဒ့ၭဘိၫရၫ လ့ၩဝ့ၫလၧအၥိၭဆ့လီၫ.",
			"11": "<sup>11</sup> တၭစမိစ့ၭအမံၩ့ၡါစဟိဘၭအဖိၪ, စဟံဘၧၫၦကံၫ့နဲၭ ဖိၪလဂၩနီၪ မၩလၩ့ဖၭအၥၭ လၧၦကံၫ့နဲၭဖိၪလဖၪ တၭၥုၪ့အတဲၩလၧဆၧပျၩ့ဖၧၩ့ ဇၫအန့အံၫ့လၧအအီၪ",
			"12": "<sup>12</sup> လၧကၫဒ့ၭအနဲၩ့နီၪလီၫ.- တၭလၧၦလဖၪဒုၭနဲၪစံစ ရၫလၧစအဘံၫ့နိၫအၫ့အဖိၪခွၫ စဘၫရၭလ့ၩထၪ့ယူၭ လၧခိၪလီၩ့တၫဘီၫလီၫ. တၭစံစရၫဒုၭအီၪကီၪ့အလဲၪ့",
			"13": "<sup>13</sup> ၥုၭထီးအလူၬ,- လဲၪ့ၥုၭထၭခွံၫယၩ, ဒဲၦခမျၧးထီးအ လူၬလၧအအီၪလၧအစူၪဖၧၩ့ လၧဟၫရိၫၡ့ၭဘၪဆဲၫ့ လၧၦဆၨၩလဖၪ ဖိးလၧထံၫချိၬကံၡၧၫ့လီၫ.",
			"14": "<sup>14</sup> တၭနးဒ့ၭဘိၫရၫစံၭစဘၫရၭ, ဂဲထုၪ့ဘီၪ,အဂဲးဘဲၫ ယီၩအယီၩမွဲမုလနံၩ လၧယဟိဝၩဖ့ၪလၫ့ယူၭစံစရၫ လၧနစူၪဖၧၩ့ယူၭ, ယဟိဝၩလ့ၩထၪ့ယူၭလၧနမ့ၬယၫ မွဲအ့ၬဧၪ. တၭစဘၫရၭထဲၩ့လၩ့ထဲၩ့ လၧခိၪလီၩ့တၫ",
			"15": "<sup>15</sup> ဘီၫတၭ, ၦၡၩလလၬဖိၬအခဲၫ့လီၫ.- တၭယဟိဝၩ မၩစၪစံစရၫ,ဒဲအလဲၪ့ၥုၭၥံၪထီးအလူၬ, ဒဲအၥုၭမုထီး အလူၬလၧနၭအနါလၧစဘၫရၭ အမ့ၬယၫလီၫ. တၭ စံစရၫစဲၪ့လၩ့ခွံၬဝ့ၫ လၧအလဲၪ့ၥုၭတၭ, စဲၪ့ဖျိၭဝ့ၫလၧ",
			"16": "<sup>16</sup> အခၪ့လီၫ.- တၭစဘၫရၭလီၩ့ဆီးလဲၪ့ၥုၭလဖၪ, ဒဲၥုၭ မုခမျၧးလဖၪဖိးလၧဟၫရိၫၡ့ၭ ဘၪဆဲၫ့လၧၦဆၨၩလ ဖၪနီၪလီၫ. တၭစံစရၫအၥုၭမု ထီးအလူၬလၩ့ထံၩဖါ ဝ့ၫလၧနၭအနါအဖၫ့ခိၪလီၫ. ၦအီၪလၩ့ထးဘၪနးဂၩ အ့ၬ.",
			"17": "<sup>17</sup> တၭစံစရၫစဲၪ့ဖျိၭဝ့ၫလၧအခၪ့ ဖိးလၧၦကံၫ့နဲၭဖိၪ စဟံဘၧၫအမၫ နးယၫအ့လၭ အတဲၩအအီၪလီၫ. အ ဂဲးဘဲၫယီၩ ဟၫဇၧၫအစဎွၩယၫဘံၫ့ ဘၪလိၬအိၭလိၬ ဝ့ၫလၧၦကံၫ့နဲၭဖိၪ စဟံဘၧၫအၡၩဂံၪ့ဖိၪလီၫ.",
			"18": "<sup>18</sup> တၭနးယၫအ့လၭ လ့ၩထၪ့အၪ့ဂၬစံစရၫတၭစံၭဝ့ၫ, ကၠၪနၥၭ,ယကဆါဧ့, ကၠၪနၥၭလၧယအီၪဆံၭ. ထီး အၪ့ယိၪဆၧလဂ့ၩ. တၭထီးအဝ့ၫဒၪကၠၪအၥၭလၧအ အီၪ,လၧအတဲၩဖၧၩ့တၭၦမုၪနီၪ ဒုၭလုၬထၪ့ဝ့ၫလၧဖၬ ဘဲၩ့(ၡၫ့)လဘံၪ့လီၫ.",
			"19": "<sup>19</sup> တၭအဝ့ၫဒၪစံၭ ဖ့ၪလၫ့ယၧၩ လၧထံၫနးဆံၭဘီၪ. အဂဲးဘဲၫယီၩ ဆၧၥူၫယၥၭလီၫ. တၭအဝ့ၫနီၪဝဲထၪ့ ဆၧနူထံၫထိၪ့ဆၧဖံၭတၭဒုၭအီၩဝ့ၫတၭ, ဒုၭလုၬထၪ့",
			"20": "<sup>20</sup> ထဲၩ့ဝ့ၫလီၫ.- တၭအဝ့ၫဒၪစံၭဒီၭဝ့ၫဆၧၫ့ထုၪ့လၧတဲၩ အတရၫ့နီၪဘီၪ. ထီးၦလဂၩဂၩ အ့ၪဂဲၫအၪ့စၪ့နၧၩ တၭ,စံၭ, ၦၡၩအီၪထီးယီၩဧၪတၭ, ဆၧမိမၩအၥၭ",
			"21": "<sup>21</sup> လၧနမိဘၪစံၭ, အီၪအ့ၬ.- တၭစဟံဘၧၫအမၫနးယၫ အ့လၭမၩန့တဲၩအနိၪဖျၭလဘီၩ့တၭ, မၩန့စၭခုၫလၧ အစူၪဖၧၩ့တၭ လ့ၩစီၩစီၩလၧအအီၪတၭ ဖျၩနုၬနိၪ ဖျၭလၧအနါကံၭထံၭတၭ မၩနုၬလၩ့ဝ့ၫလၧဂၪ့ခိၪဖၧၩ့ လီၫ.အဂဲးဘဲၫယီၩ မွဲအမံၫမၪဝ့ၫတၭ ဆၧပွံၭအၥၭ",
			"22": "<sup>22</sup> တၭ,ၥံၫဝ့ၫဘဲၫနီၪလီၫ.- တၭယိခွါ, စဘၫရၭလီၩ့ဆီး စံစရၫတၭ,နးယၫအ့လၭ ဂဲၫအၪ့ဂၬဝ့ၫတၭ, စံၭဝ့ၫး ဂဲၫ ဘီၪ, ယမိဒုၭနဲၪနၧၩ လၧၦလၧနအၪ့ဎၬဝ့ၫ လဂၩနီၪ လီၫ.အဝ့ၫလ့ၩနုၬဝ့ၫလၧအတဲၩဖၧၩ့တၭ, ယိခွါ, စံစ ရၫမံၫနၩ့ၥံၫယူၭတၭ နိၪဖျၭအီၪဝ့ၫ လၧအနါကံၭထံၭ",
			"23": "<sup>23</sup> အဖၧၩ့လီၫ.- တၭလၧမုလနံၩနီၪ ယဟိဝၩမၩစၪကၫ နအၫ့အစဎွၩယၫဘံၫ့ လၧၦအံၫစရ့လၭဖိၪအမ့ၬယၫ",
			"24": "<sup>24</sup> လီၫ.- တၭၦအံၫစရ့လၭဖိၪအစူၪ ဘီၪထၪ့ယီၫထၪ့တၭ မၩနၧၩ့မၩစၪကၫနအၫ့အစဎွၩယၫဘံၫ့ ထီးအမၩဂၭ ဂီၩ့ကၫနအၫ့အစဎွၩယၫဘံၫ့နီၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ လၧမုလနံၩနီၪ နးဒ့ၭဘိၫရၫ,ဒဲစအ ဘံၫ့နိၫအၫ့အဖိၪခွၫ စဘၫရၭၥံၫကျံၩဆၧတၭစံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> မွဲအံၫစရ့လၭဂၭဖျ့ၭဝ့ၫတၭ, ၦခမျၧးဖ့ၪလၫ့ခွံၬဒၪအနၫ့ဆါၥံၪတၭ, စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ.",
			"3": "<sup>3</sup> ခိၭနၪ, စဎွၩၥံၪဧ့, ဒိၭနၥံၪအနါ, ၦဒိၪၥံၪဧ့, ယဝ့ၫဒၪယီၩယမိစံၭထၪ့အၪ့အူၭယဟိဝၩ, ယမိၥံၫကျံၩထၪ့ယဟိဝၩ အံၫစရ့လၭအယွၩလီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩဧ့, လၧနစဲၪ့ထၪ့ခွံၬလၧစံအၫ, လၧနလ့ၩထၪ့ခွံၬလၧအံဒၧၫ့ အဆၧပျၩ့ဖၧၩ့နီၪ, ဂၪ့ခိၪဝၭၡီၩ့ၡိၬဝ့ၫ, ဒဲမူၭခိၪဒုၭလၩ့ဆၩ့ဆၧ, ဒဲဆၧအုၪ့ဒုၭလၩ့ဆၩ့ထံၫဆ့လီၫ.",
			"5": "<sup>5</sup> ခိၪလီၩ့ထိၩ့ချိၬဖံၪထၪ့ခွံၬ လၧယဟိဝၩအမ့ၬယၫ, စဲနၫနီၪဒၪလ့ၬ လၧယဟိဝၩ အံၫစရ့လၭအယွၩအမ့ၬ ယၫလီၫ.",
			"6": "<sup>6</sup> လၧစအၫနၭအဖိၪခွၫစၡၫမဂၫအမုနံၩ, လၧနးယၫ အ့လၭအမုနံၩလဖၪအဘိၩ့ဆၧၩ့နီၪ, ဖၧၩ့မုလဖၪအီၪ ယူဝ့ၫ,တၭၦလ့ၩဆၧဖိၬဖၧၩ့ၥၭကဲၪ့ကီၪ့လဖၪနီၪလီၫ.",
			"7": "<sup>7</sup> တဝၫ့လဖၪအီၪယူ, အီၪယူဝ့ၫလၧအံၫစရ့လၭအ ဖၧၩ့,ထီးယၧၩ, နးဒ့ၭဘိၫရၫဂဲထုၪ့, ထီးယဂဲထုၪ့, မိလဂၩလၧအံၫစရ့လၭအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> အဝ့ၫၥံၪရွံန့အယွၩအၥၫ့လဖၪလီၫ. ထီးနီၪလဖၧၫ့ဆၧဒုၭၥုၭအီၪဝ့ၫလၧတရၫ့အထံၭး ထၩ့ဖံၭလဘံၪ့မွဲဂ့ၩ, ဖၩ့လဘံၪ့မွဲဂ့ၩအီၪဖျီၪ လၧအံၫစရ့လၭအၡၩလံလၬလဖၪအကျၩဆ့ဧၪ.",
			"9": "<sup>9</sup> ယၥၭအီၪၦပၧၩ့ဆၧလၧအံၫစရ့လၭအကျၩ, ၦဖ့ၪလၫ့ခွံၬဒၪအနၫ့ဆါလဖၪ လၧၦခမျၧးအကျၩ, စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ.",
			"10": "<sup>10</sup> ၦလၧအထူၬကၥ့ၪယီၩ့ဘွၩၥံၪဧ့, ၦလၧအဆၧၫ့နၩ့စ့ၩရၫ့ဆၧၥံၪဧ့, ဒဲၦဖိၬဖၧၩ့မုၥံၪဧ့, ၥံၫကျံၩဆၧဆံၭ.",
			"11": "<sup>11</sup> ဖီၩ့ဖျ့ၭလၧၦခၭဆၧဖိၪအၥီၫလၧၦဒုၪ့ထံၫအလးၥံၪ အဖၧၩ့း ထီးပမိလီၩလၩ့ယဟိဝၩအမၩဆၧတီၩဆၧလီၩ့, အမၩဆၧတီၩဆၧလီၩ့ဘၪဆဲၫ့လၧတဝၫ့လဖၪလၧအံၫ စရ့လၭအကျၩ, ထီးနီၪလဖၧၫ့ ယဟိဝၩအၡၩခမျၧး မိလ့ၩလၩ့လၧတ ရၫ့လဖၪနီၪလီၫ.",
			"12": "<sup>12</sup> နၪ့ထၪ့, နၪ့ထၪ့, ဒ့ၭဘိၫရၫဧ့, နၪ့ထၪ့, နၪ့ထၪ့, ၥံၫကျံၩဆၧဆံၭ. ဂဲထုၪ့, စဘၫရၭဧ့. တၭၥိၫ့အၪ့မၧၫ့ဎီးဆၧလၧအအၪ့မၧၫ့ဎီးနၧၩ, စအဘံၫ့နိၫအၫ့အဖိၪခွၫဧ့,",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ဒုၭပၧၩ့ ၦလၧအအီၪ လၩ့ထးလဖၪ, လၧၦဒိၪဖၭဒိၪလၧၦခမျၧးလဖၪအကျၩအဖၫ့ခိၪ, ယဟိဝၩဒုၭပၧၩ့ယၧၩ လၧၦၡၩအဆီၪ့လဖၪအဖၫ့ခိၪ လီၫ.",
			"14": "<sup>14</sup> လၧစအံဖြံၫ့နီၪ အဝံအီၪအၪထၪ့ထၫ့ဒၩ အၫမလ့ၭ လီၫ. လၧနလးခဲၫ့စဘံၪ့ယမံၫ့ဧ့, အီၪလၧၦခမျၧးအကျၩ, လၧမၫခၧၫအဖၧၩ့နီၪၦပၧၩ့ဆၧလဖၪဂဲၫလၩ့, လၧဇ့ၭဘလၧၫ့နီၪ ၦမၩန့ၦအဝံထၪ့နၬထၪ့ဆၧအနိၪ ထိၭလီၫ.",
			"15": "<sup>15</sup> တၭၦဒိၪလၧအံစခၫအဖၧၩ့အီၪဝ့ၫလၧနးဒ့ၭဘိၫရၫ အၥိၭ, အံစခၫဒၪလ့ၬ, ဒဲစဘၫရၭနီၪဆ့လီၫ. ဆၧအၪ့မၧၫ့အလ့ၩလၧအခၪ့ လၧဆၧဒၩဖၧၩ့နီၪလီၫ. လၧစရုဘံၫ့အဆၧအၪ့နၩ့ဖၭလဖၪနီၪ, အီၪကၩ့ကၩ ဆၧယိၬလၧအၥၭနီၪလီၫ.",
			"16": "<sup>16</sup> နအီၪလၧၥိၪဖီၩ့အကျၩ, ဘဲၫၥိၭနမိခိၭနၪၥိၪဂၪ့ကိၭဝ့ၫနီၪ, မွဲဘၪလဲၪ. လၧစရုဘံၫ့အဆၧအၪ့နၩ့ဖၭလဖၪနီၪ, ကိၪ့ဆၧဖၭဆၧ လၧအၥၭလဖၪဖၭဒိၪအီၪ,",
			"17": "<sup>17</sup> ဂံလအၭအီၪဝ့ၫလၧယီၫဒၫ့ဝါလခီၫ, တၭစဒၫ့နီၪအီၪဝ့ၫလၧကဘၩ့ဖၧၩ့မွဲဘၪလဲၪ. စအၭၡၧၫအီၪဝ့ၫလၧမၫဆမံၭနဲၩ့, တၭအီၪဝ့ၫလၧအဆၧအိၩဖၧၩ့လဖၪလီၫ.",
			"18": "<sup>18</sup> စဇ့ၭဘလၧၫ့မွဲၦခမျၧးလၧအလထီးလၩ့ဘၪအၥၭ ဖိးလၧဆၧၥံၫ, ဒဲစနၭၥလဲၫနီၪ လၧဆၧပျၩ့ဖၧၩ့ အလးထၪ့ထီၫအဖၫ့ ခိၪ.",
			"19": "<sup>19</sup> စဎွၩလဖၪဂဲၫဒုၭၥုၭ, ထီးနီၪလဖၧၫ့ကၫနအၫ့အစဎွၩလဖၪဒုၭဆၧ, လၧတအၫနၭလၧထံၫမဂံၭဒိၫအနဲၩ့တၭ, အဝ့ၫၥံၪမၩန့စ့ၩနးဆံၭအ့ၬ.",
			"20": "<sup>20</sup> ဆၧဒုၭဆၧလၧမူၭခိၪ, ၡၪၥံၪဖီၫၥံၪလၧဖၧၩ့မုဖၧၩ့နီၪဒုၭၥုၭထၫ့ဒၩစံစရၫ,",
			"21": "<sup>21</sup> ထံၫချိၬကံၡၧၫ့အထံၫမၩလၩ့ဘံၭခွံၬဝ့ၫ, ထံၫချိၬလၧဖျိၩ့, ထံၫချိၬကံၡၧၫဧ့, နယဲးလၩ့ယူၭဆၧအဂဲးအဘၭ, ယၥၭဧ့,",
			"22": "<sup>22</sup> တၭကၥ့ၪအခၪ့မံၪထ့ဖၭလၧ အစဲၪ့ဆၧအကၠီၩ့တၭ, အကၥ့ၪအဆီၪ့လဖၪလၧအစဲၪ့ဆၧအကၠီၩ့လီၫ.",
			"23": "<sup>23</sup> မွဲနၥံၪဘၪဆိၪအၧၩ့မံရီၭနီၪဆံၭ, ယဟိဝၩအၥီၫ့စံၭ ဝ့ၫဒၪ, ဆိၪအၧၩ့ၦၡၩဒိၩ့ဖိၪလဖၪနီၪလၧဆၧဆိၪအၧၩ့အဆီၪ့ နီၪဆံၭ. အဂဲးဘဲၫယီၩမွဲအဂဲၫမၩဆၧၩ့ယဟိဝၩအ့ၬ, မၩဆၧၩ့ယဟိဝၩထၫ့ဒၩၦအဆီၪ့နီၪအ့ၬ.",
			"24": "<sup>24</sup> ၦကံၫ့နဲၭဖိၪစဟံဘၧၫအမၫနးယၫအ့လၭနီၪ, မွဲအဘၪဆၧဆိၪဂ့ၩလၧၦမုၪလဖၪအဖၫ့ခိၪဆံၭ. မွဲအဘၪဆၧဆိၪဂ့ၩ အၪနဲၪ့ၦမုၪလၧတဲၩဖၧၩ့လဖၪ ဆံၭ.",
			"25": "<sup>25</sup> အဝ့ၫဒၪအၪ့ကံၩ့ထံၫတၭ, ဖ့ၪလၫ့ဝ့ၫလၧဆၧနူထံၫး ဂဲၫဆိၬဆၧနူထံၫလၩ့ဒၭလၧၦဒိၪအထွ့ၫအဖၧၩ့,",
			"26": "<sup>26</sup> အီၪက့ၪလၩ့အစူၪလၧနိၪဖျၭနီၪ, တၭအစူၪထွ့ၪလၧၦမၩဆၧၥ့ၪအစၭခုၫအလီၩ့, တၭဒိၪစံစရၫလၧစၭခုၫ, ဒိၪအခိၪ, တၭဆ့ၭဖျီၫ့အနါကံၭထံၭလီၫ.",
			"27": "<sup>27</sup> အဝ့ၫဒၪၡီၫ့လၩ့လၧၦမုၪအခၪ့ထံၭ, လၩ့ထံၩဖါဝ့ၫ, မံၫနၩ့ဝ့ၫ, ထီးၦမုၪအခၪ့ထံၭနီၪၡီၫ့လၩ့ဝ့ၫ, လၩ့ထံၩဖါဝ့ၫလီၫ. ထီးအၡီၫ့လၩ့ အလးနီၪလၩ့ထံၩဖါၥံၫဝ့ၫဒၪ ထီးနီၪ လီၫ.",
			"28": "<sup>28</sup> စံစရၫအမိယိဆၧလၧဆၧဖိး, ဒဲကိၭထၪ့လၧဆၧဖိး အလဲၪ့ၥုၭလဂဲၫထီၩ့ဘၪနီၪအီၪယံၬယံၬမွဲဘၪလဲၪ. အလဲၪ့ၥုၭဂဲၫၡီၫၡီမွဲဘၪလဲၪ.",
			"29": "<sup>29</sup> အၦမုၪလၧအကိၪ့ဆၧၥ့ၪလဖၪစံၭဆၧၫ့ဝ့ၫ, မွဲမၬ, စံၭဆၧၫ့လၩ့ဒၪအနၫ့ဆါဒၪဝ့ၫ,",
			"30": "<sup>30</sup> လဒၪန့ဘၪဆၧဧၪ, အၪ့နၩ့ဖၭယူၭဆၧအၪ့ဂူၬန့, မွဲဒံၭအ့ၬဧၪ. ၦလဂၩဂၩအဂးနီၪ, ၦမုၪနၩ့လဂၩနံၫဂၩဆုၬဆုၬ, လၧစံစရၫအဂးနီၪ, ဆၧအၪ့ဂူၬန့အကံၪကဲၩ့, ဆၧအၪ့ဂူၬန့ လၧၦဆၭကံၪဝ့ၫ, လၧၦဆၭကံၪဝ့ၫလါ ခီၫလူၬ, လၧၦအၪ့ဂူၬန့ဆၧလၧအခိၬၥံၪအလီၩ့နီၪလီၫ.",
			"31": "<sup>31</sup> မွဲနဒုၪနဒၩထီးအလူၬဂၭဂီၩ့ဘဲၫနီၪဆံၭ, ယဟိဝၩ ဧ့, အ့ၪမွဲၦလၧအအဲၪဝ့ၫလဖၪနီၪ, မွဲအအီၪဘဲၫမုမ့ၬလၧအလ့ၩထၪ့လၧအဂဲးဆီၪ့အဘၭ ဆီၪ့အၥိၭနီၪဆံၭ. တၭထံၫၥံၪခးၥံၪအီၪပွံၭဝ့ၫအနံၪ့လံဆံၫလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭဖိၪ မၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬ ယၫတၭ,ယဟိဝၩ ဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ လၧမံဒအၫ့အ စူၪဖၧၩ့နွ့ၫနံၪ့လီၫ. တၭမံဒအၫ့အစူၪမၩစၪအံၫစရ့လၭ",
			"2": "<sup>2</sup> လီၫ.- တၭလၧၦမံဒအၫ့ဖိၪအကၠီၩ့နီၪၦအံၫစရ့လၭဖိၪ မၩန့အီၪဝ့ၫလၧဆၧဖၧၩ့လၧအအီၪလၧခိၪလီၩ့ထိၩ့ချိၬ",
			"3": "<sup>3</sup> အကျၩ,ဒဲဆၧအိၩဖၧၩ့ဒဲထိၬလဖၪလီၫ.- ထီးအံၫစရ့ လၭဎွံၪဆၧဂီၩ့တၭ, ဆၧမၩအၥၭလၧၦမံဒအၫ့ဖိၪၥံၪ ဂဲၫဝ့ၫ,ဒဲၦအၫမလ့ၭဖိၪဆ့, ဒဲၦမုထၪ့ဖိၪနီၪဂဲၫထၪ့ထၫ့",
			"4": "<sup>4</sup> ဒၩအဝ့ၫၥံၪဆ့လီၫ.- အဝ့ၫၥံၪၥုၪ့အတဲၩထၫ့ဒၩၦလဖၪ နီၪတၭ, မၩဂၭဂီၩ့ကယဲဂၪ့ခိၪအဆၧအၪထၪ့ဖိးလၧ နလ့ၩနုၬလၧဂၫဇၫတၭ, ၥိၪ, ဒဲဘ့ၪမွဲဂ့ၩ, ချီမွဲဂ့ၩ, က ၥ့ၪယီၩ့မွဲဂ့ၩ, အီၪက့ၪလၩ့ထးဝ့ၫလၧဆၧအၪ့လၧအံၫ စရ့လၭအဂးအ့ၬ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဂဲၫထၪ့လၧအဆၧဖိၪဆၧဎါ အဒိၩ့,ဒဲအတဲၩလဖၪတၭ, ဂဲၫဝ့ၫအၪဘဲၫထွ့ၥံၪခၩ့ၥံၪ အၥိၭနီၪလီၫ. အဝ့ၫၥံၪမွဲဂ့ၩ, အကလအူၭလဖၪနီၪမွဲ ဂ့ၩၦဝံၦနၬၥ့ၪအ့ၬ. ဂဲၫနုၬလၧထံၫၥံၪခးၥံၪအဖၧၩ့ဘဲၫ",
			"6": "<sup>6</sup> ၥိၭအမိမၩဂၭဂီၩ့ဝ့ၫလီၫ.- တၭၦအံၫစရ့လၭဖိၪဘၪ ၡၪ့နၭနၭလ့ၬ လၧၦမံဒအၫ့ဖိၪအကၠီၩ့တၭ, ၦအံၫစရ့ လၭဖိၪကိၭထၪ့ယဟိဝၩလီၫ.",
			"7": "<sup>7</sup> တၭထီးၦအံၫစရ့လၭဖိၪကိၭထၪ့ယဟိဝၩ လၧမံဒ",
			"8": "<sup>8</sup> အၫ့ဖိၪအကၠီၩ့နီၪ,- ဆၧမၩအၥၭလၧယဟိဝၩအၪ့မၧၫ့ လၩ့မီၪလဂၩလၧၦအံၫစရ့လၭဖိၪအအီၪ လၧအစံၭ ဝ့ၫ,ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ယဒုၭဂဲၫ ထၪ့ခွံၬနၥံၪလၧအံဇံၭ, ဒဲယဒုၭဂဲၫထၪ့ခွံၬနၥံၪလၧၦဎီး",
			"9": "<sup>9</sup> ဖိၪအဂံၪ့ဖၧၩ့တၭ,- ယမၩဖီၩ့မၩဖျ့ၭနၥံၪလၧၦအံဇံၭ ဖိၪအစူၪဖၧၩ့, ဒဲလၧကယဲၦလၧအမၩနၭမၩၡၪ့နၥံၪထီး အလူၬအစူၪဖၧၩ့, ယနၫ့ထၪ့ခွံၬ လၧနၥံၪအမ့ၬယၫ,ဒဲ",
			"10": "<sup>10</sup> ဖ့ၪလၫ့နၥံၪလၧအဝ့ၫၥံၪအထံၫအခးလီၫ.- တၭယစံၭ နၥံၪ,ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ နၥံၪအယွၩလီၫ. ၦ အၫမိၫဖိၪလၧနၥံၪအီၪလၧအခးဖၧၩ့ အယွၩလဖၪနီၪ, ထီးၥၭမဲၪလဂ့ၩး မွဲလါနၫ့နၥံၪခိၭနၪယလူအ့ၬ.",
			"11": "<sup>11</sup> တၭယဟိဝၩအၥီၫ့နီၪဂဲၫဆၧၫ့နၩ့လၧၥံၪ့ထိၭဖၫလ ထံၭအဖၫ့လၬ လၧအအီၪဝ့ၫလၧအီၭဖၫဘၪဆဲၫ့လၧၦ အၫဘံရ့ၭဖိၪ စယိအၭတၭး အဖိၪခွၫ စဂံဒအၧၫ့ဖူၬ ဘုၪကၠိၩ့လၧၦယဲးစဘံၭၥၪအဖၧၩ့အနဲၩ့, ဘဲၫၥိၭအမိ",
			"12": "<sup>12</sup> ဖီၩ့ဖျ့ၭလၧၦမံဒအၫ့ဖိၪနီၪလီၫ.- ယဟိဝၩအၥီၫ့နီၪနဲၪ ဖျီၪထၪ့အၥၭ လၧအမ့ၬယၫတၭ, စံၭအဝ့ၫဒၪ, ယဟိ",
			"13": "<sup>13</sup> ဝၩအီၪလၧနၥိၭ, ၦၡၩအဆီၪ့အၥၭဒူၩလဂၩဧ့.- တၭ စဂံဒအၧၫ့စံၭအဝ့ၫ, ယကဆါဧ့, ယဟိဝၩအ့ၪအီၪလၧ ပၥိၭတၭ, မွဲဘၪနီၫ လၧဆၧဘၪပၧၩ ထီးအလူၬဘဲၫ ယီၩလဲၪ. တၭအဆၧလၩ့လၭၥံၪထီးအလူၬ လၧပဖါ လဖၪလီၩဘၪပၧၩတၭ, စံၭဝ့ၫ,ယဟိဝၩဒုၭဂဲၫထၪ့ပၧၩ လၧအံဇံၭအဖၧၩ့ လမွဲဘၪဧၪ, မွဲအအီၪခီၫခီၫလဲၪ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ယဟိဝၩစဲၪ့ဒၪယူၭပၧၩယူၭတၭ, ဖ့ၪလၫ့ခွံၬယူၭပၧၩ လၧၦမံဒအၫ့ဖိၪ အစူၪဖၧၩ့ယူၭ.",
			"14": "<sup>14</sup> ယဟိဝၩယိအဝ့ၫတၭ, စံၭဝ့ၫဒၪ, လ့ၩဆၧလၧနဂဲးဆီၪ့ နဘၭဆီၪ့ယီၩဘီၪ, တၭနမိမၩဖီၩ့မၩဖျ့ၭအံၫစရ့လၭ လၧၦမံဒအၫ့ အစူၪဖၧၩ့လီၫ. ယအၪ့မၧၫ့လၩ့နၧၩ, မွဲ",
			"15": "<sup>15</sup> အ့ၬဧၪ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယကဆါဧ့, ယမိမၩဖီၩ့ မၩဖျ့ၭအံၫစရ့လၭ လၧဆၧနီၪလမံၩ့လဲၪး ယိခွါ, ယ မွဲၦၡၪ့ဖိၪယၬဖိၪ လၧမနၭစ့ၫအဖၧၩ့တၭ, ယဝ့ၫဒၪ ယီၩယမွဲၦအဆံၭထုၬ လၧယဖါအၡၩဂံၪ့ဖိၪအကျၩ",
			"16": "<sup>16</sup> လီၫ.- တၭယဟိဝၩစံၭအဝ့ၫဒၪ, မွဲမၬယမိအီၪလၧန ဂးတၭ, နမိဖ့ၬခွံၬၦမံဒအၫ့ဖိၪ ဘဲၫၦလဂၩဎးအၥိၭနီၪ",
			"17": "<sup>17</sup> လီၫ.- အဝ့ၫဒၪစံၭဝ့ၫ ယအ့ၪဘၪခိးဘၪတၩလၧနမ့ၬ ယၫတၭ, ဒုၭနဲၪလါယၧၩလၧဆၧမၩနဲၪ့လၩ့လၭလ",
			"18": "<sup>18</sup> မံၩ့လၧနချဲၩ့ဆၧလၧယၧၩဆံၭ.- ယအ့ၪလဂဲၫထဲၩ့ဒံၭ ဘၪလၧနအီၪယီၩ, ဒဲဂဲၫဆိၬဆၧမၩဘိၪ့ဒဲအီၪက့ၪလၩ့ လၧနမ့ၬယၫတၭ, ထီးစဲၪ့ထၪ့ခွံၬဒံၭလဂ့ၩဧီၪ. တၭအ ဝ့ၫဒၪစံၭ, ယမိအီၪထီးနဂဲၫထဲၩ့လီၫ.",
			"19": "<sup>19</sup> စဂံဒအၧၫ့ထဲၩ့နုၬတၭ, တဲၩ့ဝဲၩဘ့ၪဖိၪလဒုၩ,ဒဲကိၪ ပၪပဲၪလအီၪဘၪလၧမံၪလၧကိၪမုၬလအ့ဖၭလီၫ. ဆၧ ယၪနီၪမွဲအအီၪက့ၪဝ့ၫလၧဒၩ့လဖျိၪ့အဖၧၩ့တၭ, ဆၧ ယၪအထံၫနီၪ အီၪက့ၪဝ့ၫ လၧဖၧၩ့ဖၧၩ့တၭ, ဂဲၫဆိၬ ဝ့ၫလၧအအီၪ လၧၥံၪ့ထိၭဖၫအဖၫ့လၬတၭ, အီၪက့ၪ လၩ့ဝ့ၫလၧအမ့ၬယၫလီၫ.",
			"20": "<sup>20</sup> တၭယွၩအၥီၫ့နီၪ စံၭအဝ့ၫဒၪ, မၩန့ဆၧယၪဒဲကိၪ ပၪပဲၪလအီၪဘၪလၧမံၪတၭ, အီၪက့ၪဝ့ၫ လၧလိးလ ဖျိၪ့ယီၩအဖၫ့ခိၪ, ဒဲဂါလၩ့ဆၧယၪ အထံၫနီၪဘီၪ.",
			"21": "<sup>21</sup> တၭအဝ့ၫဒၪမၩဝ့ၫဘဲၫနီၪလီၫ.- ထီးနီၪလဖၧၫ့ ယဟိ ဝၩအၥီၫ့နီၪယူၬစိၩနိၪထိၭဘီၩ့ လၧအအီၪလၧအစူၪ ဖၧၩ့နီၪအခံၫထိၭတၭ, ထိၭဆၧယၪ, ဒဲကိၪပၪပဲၪလ အီၪဘၪလၧမံၪလဖၪနီၪတၭ, မ့ၪဂဲၫထၪ့ လၧလိးဖၧၩ့ တၭ,အၪ့ခွံၬဆၧယၪဒဲ ကိၪပၪပဲၪလအီၪဘၪလၧမံၪလ ဖၪနီၪလီၫ. ထီးနီၪလဖၧၫ့ယဟိဝၩအၥီၫ့နီၪ စဲၪ့ထၪ့ခွံၬ လၧအမ့ၬယၫလီၫ.",
			"22": "<sup>22</sup> ထီးစဂံဒအၧၫ့ဒၪဘၪဝ့ၫ လၧအမွဲယဟိဝၩအၥီၫ့နီၪ တၭစဂံဒအၧၫ့စံၭဝ့ၫဒၪ, အၩလါ, ကဆါယွၩဧ့, မွဲယ",
			"23": "<sup>23</sup> ယိဆၧၫ့ယၫလၧယဟိဝၩ အၥီၫ့နီၪအဂဲးလီၫ.- တၭ ယဟိဝၩစံၭအဝ့ၫ, မွဲနဘၪဆၧအမုၬဘီၪ, အၪ့ယိၪဆၧ လဂ့ၩ, နၥံၫဘၪအ့ၬ.",
			"24": "<sup>24</sup> ထီးနီၪလဖၧၫ့ စဂံဒအၧၫ့မၩဆၧလုလး ထီးနီၪလၧ ယဟိဝၩအဂးတၭ, ကိၭဝ့ၫအမံၩ့ လၧယဟိဝၩၡၫ လၧၫ့လီၫ. မွဲအအီၪဒံၭ ထီးမုဆၫလနံၩယီၩ လၧအီၭ",
			"25": "<sup>25</sup> ဖၫလၧၦအၫဘံရ့ၭဖိၪ အကျၩနီၪလီၫ.- တၭဆၧမၩ အၥၭလၧမုလနၩဎးနီၪ ယဟိဝၩစံၭအဝ့ၫ, မၩန့နဖါအ ချီလၧအၥၭဘၪ့နံၫဒုၩလဒုၩ, လၧအၥၭၡါနွ့ၫနံၪ့တၭ, မၩလၩ့ဎီးခွံၬဘၫအလၭအဆၧလုလး လၧအအီၪလၧ နဖါအဂးတၭ, ခူၬလၩ့ခွံၬၥံၪ့လဝၩ့အီၪလၧအနဲၩ့ထံၭ",
			"26": "<sup>26</sup> တၭ,- မၩထၪ့ဆၧလုလးလၧယဟိဝၩနယွၩအဂးလၧ လိးလဖျိၪ့ယီၩအဖၫ့ခိၪ, မၩဎၩ့ဝ့ၫတၭ မၩန့ချီနံၫဒုၩ လဒုၩတၭ, လုထၪ့ဆၧလုမ့ၪ လၧၥံၪ့လဝၩ့လၧနမိခူၬ",
			"27": "<sup>27</sup> လၩ့ခွံၬနီၪဆံၭ.- ထီးနီၪလဖၧၫ့ စဂံဒအၧၫ့မၩန့ၦၡၩ ဆံၫဂၩလၧအခ့ၫအၡၩ အကျၩတၭ, မၩဝ့ၫဘဲၫယဟိ ဝၩစံၭအၥိၭနီၪလီၫ. တၭဆၧမၩအၥၭ လၧအၥၭမဲၪ အဖါ အၡၩဂံၪ့ဖိၪ, ဒဲၦၡၩဒိၩ့ဖိၪ အကၠီၩ့တၭ, မၩ ဝ့ၫလၧမုဆၫလခီၫၥ့ၪအ့ၬ, တၭမၩဝ့ၫလၧမုနၩလခီၫ လီၫ.",
			"28": "<sup>28</sup> ထီးဆၧဖၩ့ထၪ့နီၪၦဒိၩ့ဖိၪဂဲထုၪ့ဂီၩဂီၩတၭ, ယိခွါ, ဘၫအလၭအဆၧလုလးနီၪ, ဆၧမၩလၩ့ဎီးခွံၬယူၭ တၭ,ၥံၪ့လဝၩ့အီၪလၧအနဲၩ့ထံၭနီၪ ဘၪဆၧခူၬလၩ့ ခွံၬယူၭးတၭချီနံၫဒုၩလဒုၩဘၪဆၧလုထၪ့ဝ့ၫလၧဆၧ",
			"29": "<sup>29</sup> လုလးလၧဆၧမၩထၪ့ဝ့ၫအဖၫ့ခိၪယူၭ.- တၭအဝ့ၫၥံၪ စံၭလိၬအၥၭလဂၩဒဲလဂၩ, မွဲပလၫမၩဆၧယီၩလဂၩ လဲၪ.ထီးအဝ့ၫၥံၪအၪ့ဎၬ ဆၧဒဲအၪ့စၪ့ဆၧတၭ,အဝ့ၫ ၥံၪစံၭ,စယိအၭအဖိၪခွၫ စဂံဒအၧၫ့မၩဆၧယီၩလီၫ.",
			"30": "<sup>30</sup> ထီးနီၪလဖၧၫ့ၦဒိၩ့ဖိၪစံၭစယိအၭနီၪ, ဂဲၫဆိၬထၪ့န့နဖိၪ ခွၫဘဲၫၥိၭအမိဘၪဆၧမၩၥံၫဝ့ၫဘီၪး အဂဲးဘဲၫယီၩမွဲ အမၩလၩ့ဎီးခွံၬယူၭ ဘၫအလၭအဆၧလုလးယူၭ,ဒဲ ခူၬလၩ့ယူၭၥံၪ့လဝၩ့လၧအအီၪလၧအနဲၩ့ထံၭအဂဲး",
			"31": "<sup>31</sup> လီၫ.- တၭစယိအၭစံၭကယဲၦလၧအဆၧၫ့ထုၪ့လၧအ နဲၩ့ထံၭထီးအလူၬနီၪ, နၥံၪမိချဲၩ့ခွးလၧဘၫအလၭအ ဂးဆ့ဧၪ. နၥံၪမိမၩဖီၩ့မၩဖျ့ၭဆ့ဧၪ. ၦလၧအမိချဲၩ့ခွး လၧအဝ့ၫအဂးနီၪ, မွဲအမိၥံၫဝ့ၫ လၧမုလချႃၭဖၩ့ထၪ့ ဒံၭဘၪနီၪလီၫ. အဝ့ၫအ့ၪကဲၪယွၩလဂၩတၭ, မွဲအချဲၩ့ ခွးလၧအဂးဒၪဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩၦမၩလၩ့ဎီးခွံၬ",
			"32": "<sup>32</sup> ဘၪယူၭအဆၧလုလးနီၪလီၫ.- တၭဆၧလၧမုလနံၩ နီၪၦကိၭအဝ့ၫဒၪအမံၩ့ လၧစယရၧၭဘ့ၫအ့လၭ,ဘဲၫပ စံၭဆၧအၥိၭ, မွဲဘၫအလၭ ချဲၩ့ခွးထၫ့ဒၩ အဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫမၩလၩ့ဎီးခွံၬယူၭ ဆၧလုအလး ယူၭ.",
			"33": "<sup>33</sup> တၭကယဲၦမံဒအၫ့ဖိၪ, ဒဲၦအၫမလ့ၭဖိၪ,ဒဲၦမုထၪ့ ဖိၪအီၪကိၩ့ အီၪကီၪ့တၭ, လ့ၩခၫ့ဂၬဆၧတၭ, ၥုၪ့အ",
			"34": "<sup>34</sup> တဲၩလၧဆၧပျၩ့ယံၭစအ့လၭအဖၧၩ့လီၫ.- ယဟိဝၩ အၥၭလၩ့ဘၪစဂံဒအၧၫ့တၭ, အဝ့ၫအူၪထၪ့ခွ့ၩတၭ, ၦအၫဘအံဇၧၫဖိၪ အီၪကိၩ့အီၪကီၪ့ ဖိၬအခဲၫ့လီၫ.",
			"35": "<sup>35</sup> တၭအဝ့ၫအၪ့မၧၫ့လၩ့ အၥီၫ့လဖၪ လ့ၩလၧၦမနၭစ့ၫ ဖိၪထီးအလူၬအကျၩတၭ, အဝ့ၫၥံၪအီၪကိၩ့အီၪကီၪ့ ဖိၬအခဲၫ့ဆ့တၭ, အဝ့ၫဒၪအၪ့မၧၫ့လၩ့အၥီၫ့လဖၪလၧ ၦအၭၡၧၫဖိၪအကျၩ, ဒဲၦဇ့ၭဘလၧၫ့ဖိၪအကျၩ, ဒဲလၧ ၦနၭၥလဲၫဖိၪအကျၩတၭ, အဝ့ၫၥံၪဂဲၫဆီးဝ့ၫလီၫ.",
			"36": "<sup>36</sup> တၭစဂံဒအၧၫ့စံၭယွၩ, နအ့ၪမိမၩဖီၩ့မၩဖျ့ၭအံၫ စရ့လၭလၧယစူၪဖၧၩ့, ဘဲၫနစံၭယူၭအၥိၭနီၪတၭ,",
			"37": "<sup>37</sup> ယိခွါ,ယမိအီၪက့ၪလၩ့ ၥိၪအဆီၪ့လပိၩ့ လၧတရၫ့ ဖၧၩ့လီၫ. ဆၩ့ထံၫအ့ၪအီၪန့ၫလၧၥိၪအဆီၪ့လပိၩ့အ လီၩ့တၭ, ဂၪ့ခိၪထီးအလူၬအဖၫ့ခိၪဎဲၫ့ဝ့ၫတၭ, ယမိၥ့ၪ ယၫလၧနမိမၩဖီၩ့မၩဖျ့ၭ အံၫစရ့လၭလၧယစူၪဖၧၩ့,",
			"38": "<sup>38</sup> ဘဲၫနစံၭယူၭအၥိၭနီၪလီၫ.- တၭဆၧမၩအၥၭဘဲၫနီၪ လီၫ. တၭဆၧဖၩ့ထၪ့နီၪ အဝ့ၫဂဲထုၪ့ဂီၩဂီၩတၭ, ဘံၭ ၥိၪအဆီၪ့လပိၩ့တၭ, ဘံၭလၩ့ခွံၬဆၩ့ထံၫ လၧၥိၪအ",
			"39": "<sup>39</sup> ဆီၪ့လပိၩ့အဖၧၩ့နီၪ ဎွ့ၩလိၫ့လဖျိၪ့လီၫ.- တၭစဂံဒ အၧၫ့စံၭယွၩ, မွဲနၥၭထၪ့ထီးခဲၩထၪ့ဘၪယၧၩလဂ့ၩ, ယမိချဲၩ့ဆၧန့ၫလထံၪယီၩ, ဒုၭမၩယိခွါလါယၧၩ န့ၫ လဖၧၫ့ယီၩ လၧၥိၪအဆီၪ့လပိၩ့နီၪဆံၭ. မွဲဆၧဎဲၫ့န့ၫ လၧၥိၪအဆီၪ့အပိၩ့နီၪ, တၭဆၩ့ထံၫ အီၪလၧဂၪ့ခိၪ",
			"40": "<sup>40</sup> ထၧၫ့ဘံၪ့ယၫနီၪဆံၭ.- တၭလၧမုလနၩနီၪယွၩမၩဝ့ၫ ဘဲၫနီၪဆၧဎဲၫ့န့ၫလၧၥိၪအဆီၪ့လပိၩ့နီၪတၭ, ဆၩ့ထံၫ အီၪဝ့ၫလၧဂၪ့ခိၪထီးအလူၬနီၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> တၭစယရၧၭဘ့ၫအ့လၭ, အနီၪမွဲစဂံဒအၧၫ့,ဒဲၦ ခမျၧးထီးအလူၬ လၧအအီၪဝ့ၫလၧအစူၪဖၧၩ့နီၪဂဲထုၪ့ လၧဆၧဖၩ့ထၪ့ဂီၩဂီၩတၭ, ၥုၪ့အတဲၩလၧထံၫဖၧၩ့ဟၫ ရီၭအနဲၩ့လီၫ. တၭၦမံဒအၫ့အၥုၭမုခမျၧးအီၪဝ့ၫလၧ မုဖၩလခီၫ လၧဆၧစီၩ့ခိၪ မိရံၫအခၪ့ထံၭလၧဆၧပျၩ့",
			"2": "<sup>2</sup> ဖၧၩ့လီၫ.- ယဟိဝၩစံၭစဂံဒအၧၫ့, ၦခမျၧးလၧအအီၪ လၧနစူၪဖၧၩ့နီၪအီၪအၪလၨၪတၭ, ယဖ့ၪလၫ့ၦမံဒအၫ့ ဖိၪၥံၪလၧအဝ့ၫၥံၪ အစူၪဖၧၩ့ၥ့ၪအ့ၬ. အံၫစရ့လၭမိ အီၪက့ၪဖိၫလိၫဘၪခိၬအၥၭလၧယဖၫ့ခိၪတၭ, စံၭ,ယ",
			"3": "<sup>3</sup> စူၪဒၪယဝ့ၫယီၩ မၩဖီၩ့မၩဖျ့ၭယၧၩလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, လ့ၩဘီၪး ကိၭထၪ့လါလၧ ၦခမျၧးအနါဖၧၩ့တၭ, စံၭ,ၦလၧအၥၭမဲၪဆၧဒဲအၪ့ ယိၪဆၧနီၪ, မွဲအထဲၩ့ထဲၩ့တၭ, စဲၪ့ထၪ့ခွံၬလၧခိၪလီၩ့ ဂံလအၭချဲၫ့ချဲၫ့ဘီၪ, တၭၦထဲၩ့ထဲၩ့ လၧၦခမျၧးအ ကျၩနီၪၦနံၫလၬနံၫထီၫ့တၭ, အီၪလၩ့ထးၦလလၬလီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩစံၭစဂံဒအၧၫ့, ၦခမျၧးနီၪအၪလၨၪဒံၭလီၫ. ဒုၭဂဲၫလၩ့အဝ့ၫၥံၪလၧထံၫနဲၩ့တၭ, ယမိမၩခွါဝ့ၫထီး နီၪလၧနဂးတၭ, ထီးဒၪၦလၧယစံၭနၧၩ, အဝ့ၫဒၪလဂၩ ယီၩမိလ့ၩဖိၬနခဲၫ့, ဆၧမိမၩအၥၭလၧအဝ့ၫနီၪမိဘၪ လ့ၩလီၫ. တၭထီးဒၪၦလၧယစံၭနၧၩ, အဝ့ၫလဂၩ ယီၩလ့ၩဖိၬနခဲၫ့အ့ၬ, လဂၩလါလါနီၪ, အဝ့ၫဒၪနီၪလ့ၩ",
			"5": "<sup>5</sup> ဘၪဆ့အ့ၬ.- အဝ့ၫဒုၭလ့ၩလၩ့ၦခမျၧးၥံၪလၧထံၫနဲၩ့ တၭ,ယဟိဝၩ စံၭစဂံဒအၧၫ့, ကယဲၦလၧအအၪ့လဲၪ့ ထံၫလၧအဖျ့ၩဘဲၫထွံၪအၪ့လဲၪ့ဆၧအၥိၭနီၪ, အဝ့ၫဒၪ နီၪနမိဘၪအီၪက့ၪလၩ့ အလးလစီၪ့ဒၪကိၭအဂၩဒ့ၭး ဒဲလခီၫကယဲၦလၧအချံၭလၩ့ လၧအခၪ့လုးခိၪဘဲၫၥိၭ အမိအီၩဆၧကိၭဂၩဒ့ၭနီၪဆ့လီၫ.",
			"6": "<sup>6</sup> တၭၦလၧအအၪ့လဲၪ့ ဆၧလၧအအီၪက့ၪအစူၪလၧ အနိၭနီၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫၥၧၫ့ယၩလီၫ. အ့ၪမွဲၦဂူၫ ဂၩလဖၪထီးအလူၬ ချံၭလၩ့လၧအခၪ့လုးခိၪ ဘဲၫၥိၭအ",
			"7": "<sup>7</sup> မိအီၩထံၫလီၫ.- ယဟိဝၩစံၭစဂံဒအၧၫ့, ယမိမၩဖီၩ့ မၩဖျ့ၭနၥံၪလၧၦၥၧၫ့ယၩလၧအအၪ့လဲၪ့ဆၧနီၪ, ဒဲဖ့ၪ လၫ့ၦမံဒအၫ့ဖိၪၥံၪ လၧနစူၪဖၧၩ့တၭ, မွဲၦခမျၧးထီး အလူၬထဲၩ့ထဲၩ့ဒၪဝ့ၫ လဂၩလၧအလးဒၪဝ့ၫ ဆုၬဆုၬ",
			"8": "<sup>8</sup> ဘီၪ.- တၭၦခမျၧးမၩန့ဆၧအၪ့ဆၧအီၩ လၧအစူၪဖၧၩ့ ဒဲအခွ့ၩလဖၪတၭ, အဝ့ၫဒၪဖျါခွံၬၦအံၫစရ့လၭထီးအ လူၬ,လဂၩလၧအတဲၩဒၪဝ့ၫဆုၬဆုၬတၭ, မၩန့ထၬၦ ၥၧၫ့ယၩနီၪလီၫ. တၭၦမံဒအၫ့ ၥုၭမုၥုၪ့တဲၩအလးနီၪ အီၪဝ့ၫလၧအဖၫ့လၬ လၧဆၧပျၩ့ဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> လၧမုလနၩဎးနီၪ, ဆၧမၩအၥၭလၧယဟိဝၩစံၭအ ဝ့ၫလဂၩနီၪဂဲထုၪ့တၭ, လ့ၩလၩ့လၧၦၥုၪ့တဲၩအလး နီၪဆံၭ, အဂဲးဘဲၫယီၩယဖ့ၪလၫ့ယူၭအဝ့ၫၥံၪလၧနစူၪ",
			"10": "<sup>10</sup> ဖၧၩ့ယူၭ.- မွဲလါနၫ့နလ့ၩအ့ၪလဘုၪ့ဘၪတၭ, လ့ၩဎုၬ",
			"11": "<sup>11</sup> လၧနခ့ၫနၡၩစဖုရၫလၧၦၥုၭမုအအီၪနီၪဆံၭ.- နမိနါ ဂၧၫ့ဆၧလၧအဝ့ၫၥံၪချဲၩ့ဝ့ၫတၭ, လၧခဲၫ့နစူၪမိဆီၪ့ထၪ့ ဘဲၫၥိၭနမိလ့ၩလၩ့ လၧၦၥုၭမုအအီၪလီၫ. တၭအဝ့ၫ ဒၪလ့ၩလၩ့လၧအခ့ၫအၡၩစဖုရၫအၥိၭ ထီၩ့လၧၦၥုၭ မုလဖၪၥုၪ့တဲၩအလး လၧအအီၪဝ့ၫလၧခီၫ့လခီၫလီၫ.",
			"12": "<sup>12</sup> တၭၦမံဒအၫ့ဖိၪ, ဒဲၦအၫမလ့ၭဖိၪ, ဒဲၦမုထၪ့ဖိၪထီး အလူၬ, မံၫနၩ့လၧဆၧပျၩ့ဖၧၩ့အၪဘဲၫထွ့ၥံၪခၩ့ၥံၪအၥိၭ နီၪ,ဒဲအကလအူၭလဖၪနီၪ ၦဝံထၪ့နၬထၪ့ၥ့ၪအ့ၬး အၪ",
			"13": "<sup>13</sup> ဝ့ၫဘဲၫမ့ၭလၧမၫဆမံၭနဲၩ့အၥိၭနီၪလီၫ.- ထီးစဂံဒအၧၫ့ ဂဲၫထီၩ့ဝ့ၫတၭ, ယိခွါ, ၦလဂၩလီၩလၩ့အဆၧမံၫမး လၧအၥိၭလဂၩတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,ယမံၫမးဆၧမံၫ မးတၭ,ယိခွါ, ဘုၪမုယီၩအကိၪပၪပဲၪလဘံၪ့လၩ့ထ့ၬ ချံးအၥၭလၧမံဒအၫ့အၥုၭမုခမျၧးအကျၩတၭ, ထီၩ့ဝ့ၫ လၧအတဲၩအအီၪ, ဘၪဝ့ၫတၭ, တဲၩနီၪလၩ့ဎီးဝ့ၫတၭ, ဆၧမၩဘျံၭဒၪဝ့ၫတၭ, တဲၩအီၪဒၩလၩ့အၥၭ လၧဂၪ့",
			"14": "<sup>14</sup> ခိၪချိၫ့လီၫ.- အၥိၭလဂၩစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, အနီၪမွဲဆၧနးမံၩ့အ့ၬ, န့ၫၦအံၫစရ့လၭဖိၪစယိအၭ အဖိၪခွၫစဂံဒအၧၫ့အနၭလဘံၪ့နီၪလီၫ. တၭယွၩဖ့ၪ လၫ့ယူၭၦမံဒအၫ့ဖိၪ, ဒဲၦၥုၭမုထီးအလူၬ လၧအဝ့ၫဒၪ",
			"15": "<sup>15</sup> အစူၪဖၧၩ့ယူၭ.- တၭထီးစဂံဒအၧၫ့နါဂၧၫ့ ၦလီၩလၩ့ ဆၧမံၫမး, ဒဲအဆၧဖၭဝ့ၫနီၪ, ဆၧမၩအၥၭလၧအဘိၪ့ ထၪ့ဘၩထၪ့ဆၧ, ဒဲထဲၩ့ထဲၩ့ဝ့ၫလၧအံၫစရ့လၭအၡၩ ၥုၭမုခမျၧးအကျၩတၭ, စံၭဝ့ၫဒၪ, ဂဲထုၪ့ဘီၪ, အဂဲး ဘဲၫယီၩယဟိဝၩဖ့ၪလၫ့ယူၭ မံဒအၫ့အၥုၭမုခမျၧးလၧ",
			"16": "<sup>16</sup> နၥံၪအစူၪဖၧၩ့ယူၭ.- အဝ့ၫဒၪအၪ့နၩ့ဖၭၦၥၧၫ့ယၩလၧ ၦၥၧၫ့ဒီၪ့တၭ, ဖ့ၪလၫ့ခွ့ၩလဖျိၪ့, ဒဲဖၧၩ့အီၪခီၫလဖျိၪ့, ဒဲမ့ၪၡီၫလၧဖၧၩ့ဖၧၩ့ လၧၦအစူၪဖၧၩ့ လဂၩဘၪလဂၩ",
			"17": "<sup>17</sup> ဆုၬဆုၬလီၫ.- စံၭဝ့ၫ,ယိလိၪယၧၩတၭ, မၩဘဲၫနီၪအ ၥိၭဆံၭ.တၭယိခွါ, ထီးယအ့ၪထီၩ့လၧၥုၪ့တဲၩအလး လၧခီၫ့လခီၫဆၧမိမၩအၥၭ, ဘဲၫယမၩအၥိၭနီၪနၥံၪ",
			"18": "<sup>18</sup> မိဘၪမၩဘဲၫနီၪၥိၭလီၫ.- ထီးယအ့ၪအူၪထၪ့ခွ့ၩ, ယ ဝ့ၫဒၪဒဲကယဲၦလၧအအီၪ လၧယၥိၭယီၩ, ထီးနီၪလ ဖၧၫ့,နၥံၪဝ့ၫ အူၪထၪ့ခွ့ၩဆ့ လၧၥုၪ့တဲၩအလးအနဲၩ့ ကိၭစီၪ့ဒ့ၭတၭ, စံၭ,ယဟိဝၩ, ဒဲစဂံဒအၧၫ့အနၭနီၪဘီၪၬ",
			"19": "<sup>19</sup> တၭလၧၦအီၪခိၭဆၧအထီ လၧအၥၭကျၩလဆၫ့ အခၪ့ထံၭနီၪ, စဂံဒအၧၫ့ဒဲၦလယၩအီၪလၧအၥိၭလ့ၩ ထီၩ့လၧၦၥုၪ့တဲၩအလး လၧခီၫ့လခီၫတၭ, (ဆၧအီၪ က့ၪလၩ့ၥၫ့ၦခိၭဆၧတၭ,) အဝ့ၫၥံၪနီၪအူၪထၪ့ခွ့ၩတၭ,",
			"20": "<sup>20</sup> မၩထ့ဖၭဖၧၩ့လၧအစူၪဖၧၩ့လီၫ.- ၦၥၧၫ့ဒီၪ့နီၪအူၪထၪ့ ခွ့ၩဆ့တၭ, မၩထ့ဖၭဖၧၩ့တၭ, မၩန့မ့ၪလၧအစူၪစ့ၪ တၭ,ခွ့ၩနီၪလၧအစူၪထွ့ၪလၧအမိအူၪထၪ့ဆၧ, ဒဲကိၭ",
			"21": "<sup>21</sup> ထၪ့ဆၧ, ယဟိဝၩ, ဒဲစဂံဒအၧၫ့အနၭနီၪဘီၪၬ- တၭၦ ဆၧၫ့ထုၪ့လဂၩ လၧအလးဒၪဝ့ၫ, လဂၩလၧအလးဒၪ ဝ့ၫ,အီၪဝၬဖီၩ့ၦၥုၪ့တဲၩအလးနီၪတၭ, ၦၥုၭမုခမျၧးစဲၪ့",
			"22": "<sup>22</sup> ဝ့ၫ,ဒဲကိၭၡၭထၪ့,ဒဲစဲၪ့ဖျိၭဝ့ၫလီၫ.- ၦၥၧၫ့ယၩအူၪထၪ့ ခွ့ၩတၭ, ယဟိဝၩအီၪက့ၪၦအနၭထၫ့ဒၩအၥိၭလဂၩ ဘၪလဂၩကိၭဂၩဒ့ၭဆုၬဆုၬ, လၧၦၥုၭမုခမျၧးထၧၫ့ ဒီၪ့ယၫတၭ, ၦၥုၭမုခမျၧးစဲၪ့ဝ့ၫဖိးလၧဘ့ၭၥၡ့ဘၫလၧ ဇံၫရံၫရၭအဖၧၩ့ လၧအၫဘလၭမဟိလၫအနဲၩ့ လၧ တၫဘၭနီၪလီၫ.",
			"23": "<sup>23</sup> တၭအံၫစရ့လၭအၡၩ အီၪကိၩ့အီၪကီၪ့ လၧအဂဲၫ ထၪ့ခွံၬလၧနၭၥလဲၫအဖၧၩ့, ဒဲလၧအၭၡၧၫ, ဒဲလၧမနၭ စ့ၫထီးအလူၬအကျၩတၭ, လီၩ့ဆီးၦမံဒအၫ့ဖိၪလဖၪ",
			"24": "<sup>24</sup> နီၪလီၫ.- တၭစဂံဒအၧၫ့အၪ့မၧၫ့လၩ့အၥီၫ့လဖၪလ့ၩ လၧခိၪလီၩ့အံဖြံၫ့ထၧၫ့ဖျိၪ့ယၫတၭ, စံၭဝ့ၫဒၪ, ဂဲၫထဲၩ့ လၩ့ဒုၭဆၧထၫ့ဒၩၦမံဒအၫ့ဖိၪတၭ, မၩန့ထံၫချိၬ (ခၫ့ ဂၬအလး) လဖၪဖိးလၧဘ့ၭၥဘၫရၫ ဒဲယီၫဒၫ့ဘိၩ့အ ဝ့ၫၥံၪလချႃၭထီၩ့ဒံၭဘၪဆံၭ. တၭအံဖြံၫ့ အၡၩထီး အလူၬအီၪကိၩ့အီၪကီၪ့ မၩန့ထံၫလဖၪ ဖိးလၧဘ့ၭၥ",
			"25": "<sup>25</sup> ဘၫရၫဒဲယီၫဒၫ့နီၪလီၫ.- တၭအဝ့ၫၥံၪမၩန့ ၦမံဒအၫ့ ဖိၪအၦဒိၪဖၭဒိၪနံၫဂၩ, စအိရ့ၭဒဲစဇံအ့ၭတၭ, အဝ့ၫ ၥံၪမၩၥံၫစအိရ့ၭ လၧလိးအိရ့ၭအလီၩ့တၭ, မၩၥံၫ စဇံအ့ၭလၧဆၧယဲး စဘံၭၥၪဇံအ့ၭအလးတၭ, လီၩ့ ဆီးမံဒအၫ့တၭ, ဂဲၫဆိၬစအိရ့ၭ, ဒဲစဇံအ့ၭအခိၪဎွံၪလ ဖၪလၧစဂံဒအၧၫ့အအီၪ လၧယီၫဒၫ့ဝါလခီၫနီၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> တၭအံဖြံၫ့အၡၩစံၭအဝ့ၫဒၪ, ထီးနလ့ၩဒုၭဆၧလၧ ၦမံဒအၫ့ဖိၪနီၪ နလကိၭန့ဘၪပၧၩ, နမၩပၧၩဘဲၫယီၩ မွဲဘၪလဲၪး တၭအဝ့ၫၥံၪဂဲးလိၬတ့ၭလိၬ လၧအဝ့ၫဒၪ",
			"2": "<sup>2</sup> ဆီၪ့ဆီၪ့လ့ၬလီၫ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ယမၩ ဆၧနီၪ,ဆၧအ့ၪယိဎီၩ့လၧဆၧလၧနၥံၪမၩနီၪ, မွဲဆၧ နီၪလမံၩ့လဲၪ. စဘံၭၥၪအီၪလၩ့ထးလၧအံဖြံၫ့နီၪဆၧ အၪ့ထုၫ့ကီၪ့ဝ့ၫမွဲအဂ့ၩနဲၪ့ဒံၭ အၭဘအံဇၧၫစဘံၭအ",
			"3": "<sup>3</sup> လးထီးအလူၬဒံၭနီၪ, မွဲအ့ၬဧၪ.- ယွၩဖ့ၪလၫ့မံဒအၫ့ အၦဒိၪဖၭဒိၪနံၫဂၩ, စအိရ့ၭဒဲစဇံအ့ၭ, လၧနၥံၪအ စူၪဖၧၩ့လီၫ. ဆၧလၧယမၩၥ့ၪတၭဆၧယိဎီၩ့လၧနၥံၪ မၩနီၪမိၥ့ၪဘဲၫၥ့ၪလဲၪ. ထီးနီၪလဖၧၫ့လၧအချဲၩ့ဆၧ ဘဲၫနီၪအကၠီၩ့တၭ, အဝ့ၫၥံၪအဆၧၥၭထၪ့ဝ့ၫနီၪ လၩ့ ဆါထဲၩ့ဝ့ၫလီၫ.",
			"4": "<sup>4</sup> တၭစဂံဒအၧၫ့ လ့ၩခၫ့ဂၬယီၫဒၫ့, အဝ့ၫဒၪဒဲၦၥၧၫ့ ယၩအီၪလၧအၥိၭလီၫ. ဆၧပွံၭအၥၭ လါနၫ့တၭ,",
			"5": "<sup>5</sup> လီၩ့ဆီးဝ့ၫဒၪလီၫ.- တၭအဝ့ၫစံၭ စၧကီၭအၡၩ, ဖ့ၪ လၫ့လါကိၪအလီၪ့လဖၪ လၧၦခမျၧးလၧအဖိၬ ယခဲၫ့ အဂးဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအၥၭလၩ့ဘဲၩတၭ, ယလီၩ့ဆီးစဇံဘၫဒဲစဇၫလမၧၫနၫ, မံဒအၫ့အစဎွၩလ",
			"6": "<sup>6</sup> ဖၪနီၪလီၫ.- တၭစၧကီၭအၦဒိၪဖၭဒိၪလဖၪစံၭဝ့ၫဒၪ, မွဲစဇံဘၫ, ဒဲစဇၫလမၧၫနၫ အစူၪလဖၪ အီၪလၧနစူၪ ဖၧၩ့ဘိၩ့နဲၪ့ယီၩလၧပမိဖ့ၪလၫ့ကိၪ လၧနၥုၭမုခမျၧးအ",
			"7": "<sup>7</sup> ကၠီၩ့နီၪဆ့ဧၪ.- တၭစဂံဒအၧၫ့စံၭဝ့ၫဒၪ, မၩအၥၭ ဘဲၫနီၪတၭထီးယဟိဝၩ အ့ၪဖ့ၪလၫ့စဇံဘၫ ဒဲစဇၫလ မၧၫနၫလၧယစူၪဖၧၩ့ဂီၩ့တၭ, ယမိခွၬခွံၬနၥံၪအယၪ လၧမံၩ့လၬကျၩအဆၧဆူၪဆၧမဲၪလဖၪနီၪလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫလ့ၩထၪ့ခွံၬထီးနီၪ ထီၩ့လၧပနုၫအ့လၭတၭ, ချဲၩ့ဆၧလၧၦၡၩၥံၪဘဲၫနီၪအၥိၭတၭး ပနုၫအ့လၭအ ၦၡၩၥံၪစံၭဆၧၫ့ဝ့ၫ ဘဲၫစၧကီၭအၡၩ စံၭဆၧၫ့ဆၧအ",
			"9": "<sup>9</sup> ၥိၭနီၪလီၫ.- တၭအဝ့ၫဒၪစံၭပနုၫအ့လၭ အၡၩၥံၪဆ့, ထီးယအ့ၪဂဲၫထဲၩ့မုၬမုၬတၭ, ယမိမၩလၩ့ဎီးခွံၬတၨၭ ထီၫလဖျိၪ့ယီၩလီၫ.",
			"10": "<sup>10</sup> စဇံဘၫ ဒဲစဇၫလမၧၫနၫ အီၪလၧကၫကီၫ အဖၧၩ့ တၭ,အၥုၭမုခမျၧးအီၪလၧအၥိၭဆ့, ၦလလၬယဲထီၫ့ ၥံၪမွဲကယဲၦမုထၪ့ဖိၪအၥုၭမု လၧအအီၪလၩ့ထးဒံၭ ထီးအလူၬလီၫ. အဂဲးဘဲၫယီၩၦလကုၬနံၫလၬလၧအ ဆိၬနၭနီၪလၩ့ထံၩဖါယူၭလီၫ.",
			"11": "<sup>11</sup> တၭစဂံဒအၧၫ့ဖိၬၦလၧအအီၪဝ့ၫ လၧတဲၩဖၧၩ့လဖၪ အဖၧၩ့ၥၭလၧနိၫဘၫ, ဒဲယီၭဘံအၫ့ လၧမုထၪ့လခီၫ တၭ,ကျီၪ့ခွံၬၦၥုၭမုခမျၧးလီၫ. အဂဲးဘဲၫယီၩၦၥုၭမု",
			"12": "<sup>12</sup> ခမျၧးနီၪအီၪက့ၪဂုးအၥၭလီၫ.- ထီးစဇံဘၫ, ဒဲစဇၫ လမၧၫနၫစဲၪ့ဖျိၭတၭ, အဝ့ၫလီၩ့ဆီးတၭ, ဖီၪ့ထၬမံဒအၫ့ အစဎွၩနံၫဂၩ, စဇံဘၫ, ဒဲစဇၫလမၧၫနၫတၭ, မၩနၧၩ့မၩ စၪၦၥုၭမုထီးအလူၬလီၫ.",
			"13": "<sup>13</sup> တၭစယိအၭအဖိၪခွၫစဂံဒအၧၫ့ ဂဲၫထဲၩ့ထဲၩ့လၧအ",
			"14": "<sup>14</sup> ဒုၭၥုၭ, လၧဆၧထၪ့ထီၫဎ့ရ့ၭအလီၩ့လီၫ.- မွဲအဖီၪ့န့ ဖိၪၥၪခွၫလဂၩလၧစၧကီၭအၦၡၩ လဖၪအကျၩတၭ, အၪ့စၪ့ဝ့ၫတၭ, အဝ့ၫဒၪလီၩဘၪဝ့ၫလၧစၧကီၭအၦဒိၪ လဖၪ,ဒဲအၡၩၥုၪ့က့ၭၥၭၡါအမံၩ့, ၦနွ့ၫဆံၫနွ့ၫဂၩ",
			"15": "<sup>15</sup> လီၫ.- အဝ့ၫဂဲၫထဲၩ့လၧစၧကီၭအၡၩအအီၪတၭ, စံၭ ဝ့ၫဒၪ, ယိခွါစဇံဘၫ, ဒဲစဇၫလမၧၫနၫ လၧနၥံၪဒုၪဒွ့ၪ ယၧၩလၧအကၠီၩ့နီၪတၭ, နၥံၪစံၭ, စဇံဘၫ, ဒဲစဇၫလ မၧၫနၫၥံၪအစူၪလဖၪ အီၪလၧနစူၪဖၧၩ့ ဘိၩ့နဲၪ့ယီၩ, ဘဲၫၥိၭပမိဖ့ၪလၫ့ကိၪ လၧနခ့ၫနၡၩလၧအပွံၭအၥၭအ",
			"16": "<sup>16</sup> ကၠီၩ့ဆ့ဧၪ.- တၭအဝ့ၫမၩန့ဒိၩ့အၡၩၥုၪ့က့ၭၥၭၡါၥံၪ, ဒဲမံၩ့လၬကျၩအဆၧဆူၪဆၧမဲၪလဖၪတၭ, အၪ့ၥီၪ့စၧ",
			"17": "<sup>17</sup> ကီၭအၡၩလၧဆၧနီၪလဖၪလီၫ.- အဝ့ၫမၩလၩ့ဎီးခွံၬ ပနုၫအ့လၭ အတၨၭထီၫလဖျိၪ့နီၪတၭ, မၩၥံၫဒိၩ့အ ၦၡၩလီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့အဝ့ၫစံၭစဇံဘၫ, ဒဲစဇၫလမၧၫနၫနီၪ, ၦလၧနၥံၪမၩၥံၫလၧဒိၩ့တၫဘီၫနီၪ, မွဲၦမၩအၥၭဘဲၫ ၥ့ၪလဲၪး တၭအဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫ, ဘဲၫနၧၩအၥိၭအဝ့ၫ ၥံၪနီၪမွဲဘဲၫနီၪၥိၭ, လဂၩဒဲလဂၩလၩ့ဂၬဘဲၫစဎွၩအဖိၪ အၥိၭဆုၬဆုၬလီၫ. တၭအဝ့ၫဒၪစံၭ အဝ့ၫၥံၪနီၪ မွဲယ",
			"19": "<sup>19</sup> ထၧၫ့ဖုဝဲယမိအဖိၪခွၫၥံၪလီၫ.- ယဟိဝၩမၧၫ့ဝ့ၫတၭ, နၥံၪအ့ၪမၩဖီၩ့မၩဖျ့ၭယူၭအဝ့ၫၥံၪ, ဒဲအီၪက့ၪမၧၫ့ဒံၭ",
			"20": "<sup>20</sup> တၭ,ယမၩၥံၫနၥံၪအ့ၬ.- တၭစံၭအဖိၪဝဲၡါစယံၥၧၫ ဂဲထုၪ့မၩၥံၫအဝ့ၫၥံၪဘီၪ, မွဲလါနၫ့ဖိၪၥၪခွၫလဂၩနီၪ ထုၭထၪ့အနၭအ့ၬ. အဂဲးဘဲၫယီၩ ၥၭမဲၪဝ့ၫလၧအမွဲ ဖိၪၥၪခွၫဒံၭအကၠီၩ့လီၫ. ထီးနီၪလဖၧၫ့စဇံဘၫ, ဒဲစဇၫ",
			"21": "<sup>21</sup> လမၧၫနၫစံၭဝ့ၫဒၪ, နဝ့ၫဒၪယီၩ ဂဲထုၪ့ဒၪနဝ့ၫ ဖ့ၬခွံၬ ပၧၩဆံၭ,အဂဲးဘဲၫယီၩ ဘဲၫၦၡၩအၥိၭနီၪအဂဲးအဘၭ အီၪဘဲၫနီၪၥိၭလီၫ. စဂံဒအၧၫ့ဂဲထုၪ့တၭ, မၩၥံၫစဇံ ဘၫ,ဒဲစဇၫလမၧၫနၫတၭ, မၩန့ဆၧကယၧၩ့လဖၪလၧ",
			"22": "<sup>22</sup> အအီၪလၧကလအူၭအခိၬလီၩ့လီၫ.- တၭအံၫစရ့လၭ အၦၡၩစံၭစဂံဒအၧၫ့, ပၧၩ့ပၧၩနဝ့ၫဒၪ, ဒဲနဖိၪခွၫ, ဒဲန ဖိၪခွၫအဖိၪခွၫနီၪဆ့ဆံၭ. အဂဲးဘဲၫယီၩ နမၩဖီၩ့မၩ ဖျ့ၭပၧၩလၧမံဒအၫ့အစူၪဖၧၩ့လီၫ. တၭစဂံဒအၧၫ့စံၭ",
			"23": "<sup>23</sup> အဝ့ၫၥံၪ,ယမိပၧၩ့နၥံၪအ့ၬ.- ဒဲယဖိၪခွၫမိပၧၩ့ဘၪနၥံၪ",
			"24": "<sup>24</sup> ဆ့အ့ၬ,ယဟိဝၩမိပၧၩ့နၥံၪလီၫ.- တၭစဂံဒအၧၫ့စံၭအ ဝ့ၫၥံၪ, ယမိအၪ့ကံၩ့ဆၧလမံၩ့လၧနၥံၪ, ဘဲၫၥိၭနၥံၪ မိဖ့ၪလၫ့ယၧၩ လၧနၥံၪအဆၧအၪ့ဂူၬန့ အနါဒံၭ ကိၭ ဂၩဒ့ၭလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအီၪဝ့ၫ လၧအနါ ဒံၭထီၫ့လီၫ. မွဲဝ့ၫလၧၦအံၫစမၫအ့လၭဖိၪအဂဲးလီၫ.",
			"25": "<sup>25</sup> တၭအဝ့ၫၥံၪစံၭဆၧၫ့အဝ့ၫ, ပမိဖ့ၪလၫ့ဒၪနၧၩမုၬမုၬဆ့ လီၫ.အဝ့ၫၥံၪဒၩလၩ့ဖၬဘဲၩ့လဘံၪ့တၭ, ခွံၬလၩ့အ",
			"26": "<sup>26</sup> ဆၧအၪ့ဂူၬန့အနါဒံၭလၧအဖၧၩ့ကိၭဂၩဒ့ၭလီၫ.- တၭ နါဒံၭထီၫ့ လၧအအၪ့ကံၩ့ဝ့ၫနီၪ လၩ့လယၧးၡက့လၭ လထီၫ့နွ့ၫယၩလီၫ. လၧနီၪအမ့ၬယၫဆၧကၠၧၩ့လဖၪ, နါဒံၭနါကၫစ့ၩလဖၪ, ဒဲဆၧအကီၩ့အၥိၭဝီၩလုၭလၧမံ ဒအၫ့အစဎွၩကီၩ့ဝ့ၫၥိၭဝ့ၫနီၪ, ဒဲလၧနီၪအမ့ၬယၫအ ကလအူၭအၥွ့ၫလဖၪလၧအအီၪ လၧအခိၬလီၩ့နီၪအီၪ",
			"27": "<sup>27</sup> ဝ့ၫလီၫ.- တၭလၧဆၧနီၪလဖၪ စဂံဒအၧၫ့မၩကဲၪထၪ့ အ့ဖိၭလဘံၪ့အီၪက့ၪဝ့ၫလၧအဒိၩ့ဖၧၩ့, လၧအီၭဖၫ အဖၧၩ့တၭ, အံၫစရ့လၭထီးအလူၬလ့ၩလၧနီၪမၩလဲး မၩဘျၪထွ့ၫဝ့ၫအခဲၫ့လီၫ. တၭဆၧနီၪလမံၩ့ကဲၪထၪ့ ဆၧဖျံၩခွၩ့လၧစဂံဒအၧၫ့ဒဲအဂံၪ့ဖိၪအဂးလီၫ.",
			"28": "<sup>28</sup> ဘဲၫနီၪၥိၭမံဒအၫ့စၪဝ့ၫ လၧၦအံၫစရ့လၭဖိၪအမ့ၬ ယၫတၭ,မိၬထၪ့လၧၩ့အခိၪအ့ၬ. တၭထံၫၥံၪခးၥံၪနီၪ အီၪပွံၭဝ့ၫအနံၪ့လံဆံၫ လၧဂံဒအၧၫ့ အမုနံၩလဖၪအ ဖၧၩ့နီၪလီၫ.",
			"29": "<sup>29</sup> စယိအၭအဖိၪခွၫ စယရၧၭဘ့ၫအ့လၭ ထဲၩ့ထဲၩ့",
			"30": "<sup>30</sup> တၭ,အီၪလၧအဂံၪ့ဒၪဝ့ၫအဖၧၩ့နီၪလီၫ.- တၭစဂံဒအၧၫ့ အီၪလၧအဖိၪခွၫ လၧအထၪ့ဖိၪဝ့ၫလဖၪနီၪ နွ့ၫဆံၫဂၩ လီၫ.အဂဲးဘဲၫယီၩ မွဲအအီၪလၧအမၫအၪဂၩလီၫ.",
			"31": "<sup>31</sup> တၭအၥံၫမၫလၧအအီၪဝ့ၫ လၧၡံခံၫ့လဂၩနီၪ အီၪဖျဲၪန့ အဝ့ၫလၧအဖိၪခွၫလဂၩဆ့တၭ, ကိၭဝ့ၫအမံၩ့လၧစအ",
			"32": "<sup>32</sup> ဘံမလ့ၭလီၫ.- တၭစယိအၭအဖိၪခွၫစဂံဒအၧၫ့ၥံၫဝ့ၫ, လၧအခိၪဘွၩဂ့ၩနီၪလီၫ. တၭၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧ အဖါစယိအၭအၥွၪခိၪဖၧၩ့ လၧအီၭဖၫအဖၧၩ့, လၧၦ အဘံအ့ၭဖိၪအကျၩလီၫ.",
			"33": "<sup>33</sup> ထီးစဂံဒအၧၫ့ၥံၫဝ့ၫတၭ, ဆၧမၩအၥၭလၧၦအံၫစ ရ့လၭဖိၪကၠၪဒီၭအၥၭတၭ, လ့ၩမၩလဲးမၩဘျၪထွ့ၫဘၫ အလၭလဖၪအခဲၫ့တၭ, အီၪက့ၪဘၫအလၭဘံရ့ၭလၧ",
			"34": "<sup>34</sup> အယွၩလီၫ.- တၭၦအံၫစရ့လၭဖိၪ နၪ့ထၪ့ထဲၩ့ယဟိ ဝၩအဝ့ၫၥံၪအယွၩ, လၧအမၩဖီၩ့ဖျ့ၭယူၭဝ့ၫလၧအဒုၪ အဒၩထီးအလူၬ အစူၪဖၧၩ့ လၧအအီၪဝၬဖီၩ့ဝ့ၫနီၪ",
			"35": "<sup>35</sup> လၧၩ့အ့ၬ.- တၭအဝ့ၫၥံၪမၩခိးမၩတၩလၧၩ့စယရၧၭ ဘ့ၫအ့လၭ, စဂံဒအၧၫ့အၡၩဂံၪ့ဖိၪ, ဘဲၫကယဲဆၧလၧ အဝ့ၫဒၪမၩဂ့ၩၦအံၫစရ့လၭဖိၪ အၥိၭနီၪဆ့အ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> တၭစယရၧၭဘ့ၫအ့လၭအဖိၪခွၫ စအဘံမလ့ၭလ့ၩ ဝ့ၫဖိးလၧၡံခံၫ့လၧအမိအထၧၫ့ဖုဝဲအအီၪတၭ, ချဲၩ့လိၬ အၥၭလၧအဝ့ၫၥံၪ, ဒဲအမိအဖါအၡၩဂံၪ့ဒီၪ့ထီးအလူၬ",
			"2": "<sup>2</sup> တၭ,စံၭဝ့ၫဒၪ,- ချဲၩ့လါဆၧလၧၦၡံခံၫ့ဖိၪထီးအလူၬအ နါဖၧၩ့ဆံၭ, မွဲစယရၧၭဘ့ၫအ့လၭအဖိၪခွၫၦနွ့ၫဆံၫ ထီးအလူၬပၧၩ့နၥံၪမိဂ့ၩလဆံၭဧၪ, ၦလဂၩဎးပၧၩ့န ၥံၪဂ့ၩလဆံၭဧၪ. တၭနၪ့ထၪ့ထဲၩ့ဆ့လၧယမွဲနၥံၪအ",
			"3": "<sup>3</sup> ဎွံၪ,ဒဲနၥံၪအယၪလီၫ.- အမိအထၧၫ့ဖုဝဲလဖၪချဲၩ့ဆၧ ချဲၩ့ထီးအလူၬနီၪ လၧအဂဲးအကၠီၪ့လၧၡံခံၫ့အၡၩလ ဖၪအနါဖၧၩ့တၭး အဝ့ၫၥံၪအၥၭအီၪ လၧအမိဖိၬစအ ဘံမလ့ၭအခဲၫ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪစံၭဝ့ၫ,အ",
			"4": "<sup>4</sup> ဝ့ၫဒၪမွဲပထၧၫ့ဖုဝဲလီၫ.- တၭအဝ့ၫၥံၪဖ့ၪလၫ့အဝ့ၫဒၪ စ့ၩအဘံၪ့နွ့ၫဆံၫလၧအမၩန့ဝ့ၫ လၧဘၫအလၭဘံရ့ၭ အဂံၪ့ဖၧၩ့လီၫ. တၭလၧစ့ၩနီၪစအဘံမလ့ၭအၪ့လံၩ့ န့ၦပျီၩပျီၩ, ဒဲၦမၩကြၩ့ထမးဆၧလဖၪလၧအမိဖိၬအ",
			"5": "<sup>5</sup> ခဲၫ့လီၫ.- လ့ၩဝ့ၫလၧအဖါအဂံၪ့ လၧအီၭဖၫအဖၧၩ့ တၭ,မၩၥံၫအထၧၫ့ဖုဝဲစယရၧၭဘ့ၫအ့လၭအဖိၪခွၫလ ဖၪ,ၦနွ့ၫဆံၫလၧလိးလဖျိၪ့ဎးအဖၫ့ခိၪလီၫ. မွဲလါနၫ့ စယရၧၭဘ့ၫအ့လၭအဖိၪဒၪဘၨၩ စယိၥၫ့အီၪလၩ့ထး ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အီၪက့ၪၥူၪခွံၬအၥၭလီၫ.",
			"6": "<sup>6</sup> ၦၡံခံၫ့အၡၩၥံၪထီးအလူၬအီၪကိၩ့အီၪကီၪ့, ဒဲကယဲ မံလိၫအဂံၪ့ဖိၪထီးအလူၬ လ့ၩဝ့ၫတၭ, ဒုၭကဲၪထၪ့စအ ဘံမလ့ၭလၧစဎွၩလၧၥံၪ့ထိၭဖၫ အခၪ့ထံၭလၧအအီၪ",
			"7": "<sup>7</sup> ဝ့ၫလၧၡံခံၫ့အဖၧၩ့လီၫ.- ထီးၦၡၩၥံၪလီၩဘၪစယိၥၫ့ တၭ,အဝ့ၫဒၪလ့ၩထၪ့ဆၧၫ့ထုၪ့လၧခိၪလီၩ့ဂ့ၫရဇံၫ့အ ဒၩ့ခိၪတၭ, ထုၭထၪ့အလူတၭ, ကိၭထၪ့ဆၧတၭ,စံၭအ ဝ့ၫၥံၪ,ခိၭနၪယလူဘီၪ, ၡံခံၫ့အၡၩၥံၪဧ့, ဘဲၫၥိၭယွၩမိ",
			"8": "<sup>8</sup> ခိၭနၪနၥံၪအလူအဂဲးလီၫ.- ၥံၪ့ၥံၪဝၪၥံၪလ့ၩထၪ့တၭ လ့ၩဆၧဘဲၫၥိၭ အမိဂုၪစဎွၩလဂၩ လၧအဖၫ့ခိၪတၭ,",
			"9": "<sup>9</sup> စံၭၥံၪ့အလဲအိၫ့, ဂဲၫနဝ့ၫ,ပၧၩ့ပၧၩဘီၪ.- တၭၥံၪ့အလဲ အိၫ့နီၪစံၭအဝ့ၫၥံၪ, ယၥိၪလၧၦၡၩမၩန့ ဒုၭလၩဖၩ့ ယွၩဒဲၦၡၩနီၪ, မွဲယကြၨၭစဲၪ့ဒၪခွံၬတၭ, လ့ၩဂဲၩဝၭ",
			"10": "<sup>10</sup> လၧၥံၪ့ၥံၪဝၪၥံၪအဖၫ့ခိၪဆ့ဧၪ.- တၭၥံၪ့ၥံၪဝၪၥံၪနီၪ စံၭချိၪ့ဒိၩ့,ဂဲၫနဝ့ၫပၧၩ့ပၧၩဘီၪ. တၭချိၪ့ဒိၩ့နီၪစံၭအ",
			"11": "<sup>11</sup> ဝ့ၫၥံၪ,ယဆၧအဆၧၫ့, ဒဲယၥၪအဂ့ၩယီၩ, မွဲယကြၨၭ စဲၪ့ဒၪခွံၬတၭ, လ့ၩဂဲၩဝၭလၧၥံၪ့ၥံၪဝၪၥံၪအဖၫ့ခိၪဆ့",
			"12": "<sup>12</sup> ဧၪ.- တၭၥံၪ့ၥံၪဝၪၥံၪနီၪစံၭစဘံၭမု, ဂဲၫနဝ့ၫပၧၩ့ပၧၩ",
			"13": "<sup>13</sup> ဘီၪ.- တၭစဘံၭမုနီၪစံၭအဝ့ၫၥံၪ, ယစဘံၭထံၫလၧ အဒုၭၥၭထိၬယွၩ ဒဲၦၡၩနီၪ, မွဲယကြၨၭ စဲၪ့ဒၪခွံၬ",
			"14": "<sup>14</sup> တၭ,လ့ၩဂဲၩဝၭလၧၥံၪ့ၥံၪဝၪၥံၪအဖၫ့ခိၪဆ့ဧၪ.- တၭ ၥံၪ့ၥံၪဝၪၥံၪထီးအလူၬနီၪ စံၭဆၧဆူၪၡိၬနီၪ, ဂဲၫနဝ့ၫပၧၩ့",
			"15": "<sup>15</sup> ပၧၩဘီၪ.- တၭဆၧဆူၪၡိၬနီၪစံၭၥံၪ့ၥံၪဝၪၥံၪ, နၥံၪအ့ၪ ဂုၪယၧၩလၧစဎွၩ လၧနၥံၪအဖၫ့ခိၪတၡါတၭ, ဂဲၫဒိၭ နဲၩ့နၥံၪအၥၭလၧယလၩရှုၪအဖၧၩ့ဆံၭ, အ့ၪလမွဲဘၪ တၭ,မွဲမ့ၪဂဲၫထၪ့လၧဆၧဆူၪၡိၬအဖၧၩ့, အၪ့ခွံၬလ့ၭ",
			"16": "<sup>16</sup> ဘနၧၫ့အၥံၪ့ၡိၫအ့ရ့ၭနီၪဘီၪ.- မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩလၧနၥံၪအီၪက့ၪ စအဘံမလ့ၭ လၧစဎွၩ နီၪ,နၥံၪအ့ၪမၩလၧဆၧမွဲဆၧတီၩ, ဒဲဆၧအလၧၫ့အဎွ့ၩ တၭ,နၥံၪအ့ၪမၩဂ့ၩစယရၧၭဘ့ၫအ့လၭ ဒဲအၡၩဂံၪ့",
			"17": "<sup>17</sup> ဖိၪၥံၪး ဒဲမၩဘဲၫအဝ့ၫဒၪအစူၪ ကြၨၭဝ့ၫအၥိၭနီၪ,- (အ အဂဲးဘဲၫယီၩ ယဖါဒုၭဆၧလၧနၥံၪအဂး, ဒဲအၥၭနီၪ မွဲအခွံၬလၩ့ဝ့ၫလၧနၥံၪအဂးတၭ, မၩဖီၩ့မၩဖျ့ၭနၥံၪ",
			"18": "<sup>18</sup> လၧမံဒအၫ့အစူၪဖၧၩ့လီၫ.- တၭနၥံၪဂဲထုၪ့ထၫ့ဒၩယ ဖါအၡၩဂံၪ့ဖိၪလၧမုဆၫလနံၩယီၩ, ဒဲမၩၥံၫယူၭအ ဖိၪခွၫလဖၪ, ၦနွ့ၫဆံၫလၧလိးလဖျိၪ့ဎးအလီၩ့, ဒဲအီၪ က့ၪယူၭ အဎီးမုၪအဖိၪခွၫ စအဘံမလ့ၭ လၧၡံခံၫ့အ ၡၩလဖၪအစဎွၩနီၪ, လၧအမွဲနၥံၪအထၧၫ့ဖုဝဲလဂၩအ",
			"19": "<sup>19</sup> ဂဲးလီၫ.)- တၭနၥံၪအ့ၪမၩ စယရၧၭဘ့ၫအ့လၭ ဒဲအ ၡၩဂံၪ့ဖိၪလၧအမွဲအတီၩ, ဒဲဆၧအလၧၫ့အဎွ့ၩလၧမု ဆၫလနံၩယီၩတၭ, ၥၭထိၬနၥံၪဝ့ၫ, လၧစအဘံမလ့ၭ အဖၧၩ့, ဒဲမွဲအဝ့ၫဒၪၥၭထိၬဆ့ လၧနၥံၪအဖၧၩ့ဆံၭ.",
			"20": "<sup>20</sup> အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, မွဲမ့ၪဂဲၫထၪ့လၧၦအဘံမလ့ၭ အဖၧၩ့တၭအၪ့ခွံၬၡံခံၫ့အၡၩလဖၪ, ဒဲမံလိၫအၡၩဂံၪ့ ဖိၪတၭ,မွဲမ့ၪဂဲၫထၪ့ လၧၡံခံၫ့အၡၩလဖၪ အကျၩဒဲ လၧမံလိၫအၡၩဂံၪ့ဖိၪအဖၧၩ့တၭ, အၪ့ခွံၬစအဘံမလ့ၭ နီၪဆံၭ.",
			"21": "<sup>21</sup> စယိၥၫ့နီၪစဲၪ့ထၪ့ခွံၬတၭ, စဲၪ့ဖျိၭလ့ၩဝ့ၫဖိးလၧဘံ အၧၫတၭ, အီၪဝ့ၫထီးနီၪလၧဆၧၥၭမဲၪ အထၧၫ့ဖုဝဲစ",
			"22": "<sup>22</sup> အဘံမလ့ၭအကၠီၩ့နီၪလီၫ.- တၭစအဘံမလ့ၭပၧၩ့",
			"23": "<sup>23</sup> အံၫစရ့လၭၥၧၫ့နံၪ့နီၪး- ထီးနီၪလဖၧၫ့ ယွၩအၪ့မၧၫ့ လၩ့ၥၭအၧၩ့လဂၩ လၧစအဘံမလ့ၭ ဒဲၡံခံၫ့အၡၩလ ဖၪအဘိၩ့ဆၧၩ့တၭ, ၡံခံၫ့အၡၩလဖၪ မၩစအဘံမ",
			"24": "<sup>24</sup> လ့ၭလၧဆၧအၪ့လီၫဝ့ၫ,- ဘဲၫၥိၭ ဆၧမၩအၧၩ့ စယ ရၧၭဘ့ၫအ့လၭအဖိၪခွၫလဖၪ ၦနွ့ၫဆံၫနီၪ, မိဂဲၫ,ဒဲအ ၥွံၪဘၪအထၧၫ့ဖုဝဲ စအဘံမလ့ၭ လၧအမၩၥံၫအဝ့ၫ ၥံၪ,ဒဲဘၪၡံခံၫ့ အၡၩလဖၪ လၧအမၩဆၧၩ့ဝ့ၫလၧအ",
			"25": "<sup>25</sup> မၩၥံၫအထၧၫ့ဖုဝဲၥံၪအဘိၩ့ဘၭနီၪလီၫ.- တၭၡံခံၫ့အ ၡၩလဖၪအီၪက့ၪၦခိၭၥူၪဆၧ လၧခိၪလီၩ့ခိၪတၭ, အ ဝ့ၫၥံၪမၩန့ဆီၪ့ ကယဲၦလၧအလ့ၩဆၧလၧဖၧၩ့ၥၭနီၪ အနဲၩ့အဎီၩ့ထီးအလူၬအဆၧလီၫ. တၭၦလီၩဘၪစ",
			"26": "<sup>26</sup> အဘံမလ့ၭလီၫ.- တၭစအံဘ့ၭအဖိၪခွၫစဂၫအလၭဒဲ အထၧၫ့ဖုဝဲၥံၪဂဲၫဝ့ၫတၭ, လ့ၩဖိးလၧၡံခံၫ့တၭ, ၡံခံၫ့ အၡၩလဖၪနီၪ ဒိၭနဲၩ့အၥၭ လၧအဝ့ၫဒၪ အစူၪဖၧၩ့",
			"27": "<sup>27</sup> လီၫ.- အဝ့ၫၥံၪလ့ၩထၪ့ လၧဆံၬၥံၪနၩၥံၪအဖၧၩ့တၭ, အၪ့ထုၫ့ကီၪ့ ဆၧလၧစဘံၭလးအဖၧၩ့နီၪ, ယဲးဝ့ၫဒၪ တၭ,မၩဎွံၫအၥၭတၭ, လ့ၩနုၬလၧအဝ့ၫၥံၪအယွၩအ ဂံၪ့ဖၧၩ့တၭ, အၪ့ဆၧဒဲအီၩဆၧတၭ, ဆိၪအၧၩ့စအဘံမ",
			"28": "<sup>28</sup> လ့ၭလီၫ.- တၭစအံဘ့ၭအဖိၪခွၫစဂၫအလၭနီၪ စံၭဝ့ၫ ဒၪ,စအဘံမလ့ၭနီၪ, မွဲၦလဂၩလဲၪ,ၡံခံၫ့အၡၩယီၩ,မွဲ ၦလဖၪလဲၪ. တၭပမိဘၪမၩအဝ့ၫဒၪ အဆၧနီၪမွဲဘၪ လဲၪ.စယရၧၭဘ့ၫအ့လၭအဖိၪခွၫမွဲအ့ၬဧၪး တၭစဇံ ဘလၭအၡၩယိဆၧလဂၩနီၪ, မွဲၦလဂၩလဲၪ, မၩစၡံ ခံၫ့အဖါစဟၫမီၫအၡၩအဆၧနီၪဘီၪ. ပမိမၩအဝ့ၫဒၪ",
			"29": "<sup>29</sup> အဆၧမွဲဘၪလဲၪ.- မွဲၦခမျၧးယီၩအီၪလါလၧယစူၪ ဖၧၩ့ဘီၪၬ တၭယမိၥုၭခွံၬ စအဘံမလ့ၭလီၫ. တၭစံၭ စအဘံမလ့ၭနီၪ, မၩအၪထၪ့နၡၩၥုၭမုတၭဂဲၫထၪ့ဘီၪ.",
			"30": "<sup>30</sup> တၭဒိၩ့အၦဒိၪဖၭဒိၪ စဇံဘလၭလဂၩနီၪ နါဂၧၫ့ စအံဘ့ၭအဖိၪခွၫ စဂၫအလၭ အဆၧချဲၩ့တၭ, အၥၭ",
			"31": "<sup>31</sup> ထၪ့လီၫ.- အၪ့မၧၫ့အၥီၫ့လဖၪ လ့ၩၥူၪလၧစအဘံမ လ့ၭအအီၪတၭ, စံၭဝ့ၫဒၪ, ယိခွါ, စအံဘ့ၭအဖိၪခွၫ စဂၫအလၭ, ဒဲအထၧၫ့ဖုဝဲလဖၪဂဲၫထီၩ့လၧၡံခံၫ့တၭ,",
			"32": "<sup>32</sup> ယိခွါ,အဝ့ၫၥံၪမၩထၬဒိၩ့ထၫ့ဒၩနၧၩလီၫ.- တၭဘိၩ့ နဲၪ့ယီၩ, ဂဲထုၪ့လၧမုနၩလခီၫ, နဝ့ၫဒၪဒဲနၡၩၥံၪတၭ,",
			"33": "<sup>33</sup> အီၪခိၭၥူၪလၧဆံၬပျၩ့ဖၧၩ့ဆံၭ.- လၧဆၧဖၩ့ထၪ့နီၪ ထီးမုဂဲၫထၪ့တၭ, ဆၧမိမၩအၥၭလၧနမိဘၪဂဲထုၪ့လၧ ဂီၩဂီၩတၭ, ပၠၪလၩ့ဆၧလၧဒိၩ့အမ့ၬယၫတၭ, ယိခွါ, အဝ့ၫဒၪ, ဒဲၦအီၪလၧအၥိၭ မိဂဲၫထၪ့ထၫ့ဒၩနၧၩတၭ, နမိမၩဘၪအဝ့ၫၥံၪ ဘဲၫနစူၪမိဒၪန့ဆၧအလးအၥိၭနီၪ လီၫ.",
			"34": "<sup>34</sup> တၭစအဘံမလ့ၭ ဂဲထုၪ့ဒဲကယဲအၡၩၥံၪထီးအ လူၬလၧမုနၩလခီၫတၭ, အီၪခိၭၥူၪလၧၡံခံၫ့အမ့ၬယၫလၧ",
			"35": "<sup>35</sup> ၦလံဒီၪ့လီၫ.- စအံဘ့ၭအဖိၪခွၫစဂၫအလၭလဂၩနီၪ စဲၪ့ထၪ့တၭ, ဆၧၫ့ထုၪ့လၧဆၧလ့ၩနုၬလၧဒိၩ့အတရၫ့ အဖၧၩ့တၭ, စအဘံမလ့ၭဒဲအၡၩၥံၪလၧအအီၪလၧအ",
			"36": "<sup>36</sup> ၥိၭလၧအခိၭၥူၪဆၧလဖၪဂဲထုၪ့ဝ့ၫလီၫ.- တၭစဂၫအ လၭလဂၩဒၪဘၪၦခမျၧးတၭ, စံၭစဇံဘလၭလဂၩနီၪ, ယိခွါ,ၦခမျၧးၥံၪဂဲၫလၩ့လၧခိၪလီၩ့ဒၩ့ခိၪလီၫ. တၭစဇံ ဘလၭစံၭဝ့ၫ, နဒၪဘၪခိၪလီၩ့ထိၩ့ချိၬအလၩရှူၪဘဲၫ",
			"37": "<sup>37</sup> ၦၡၩအၥိၭနီၪလီၫ.- စဂၫအလၭနီၪချဲၩ့ဒီၭဆၧတၭ, စံၭ ဝ့ၫဒၪ,ယိခွါၦခမျၧးဂဲၫလၩ့လၧခိၪလီၩ့ခိၪတၭ, ၦလစီၪ့ ဒၪဂဲၫဝ့ၫလၧမနိၫ့အံနံၫ့ အၥံၪ့ ထိၭဖၫအခၪ့ထံၭလီၫ.",
			"38": "<sup>38</sup> တၭစဇံဘလၭနီၪစံၭဝ့ၫ, နနိၭလၧနစံၭ, စအဘံမလ့ၭ မွဲပလၫလၧပမိမၩအဆၧလဂၩလဲၪနီၪ, မွဲအအီၪခီၫခီၫ လဲၪ.ၦခမျၧးယီၩ မွဲၦလၧနမၩကြၩ့ထမးဘၪဝ့ၫနီၪ, မွဲ အ့ၬဧၪး စဲၪ့ထၪ့ဘိၩ့နဲၪ့ယီၩတၭ, ဒုၭဆၧလၧအဝ့ၫၥံၪ",
			"39": "<sup>39</sup> ဘီၪ.- တၭစဂၫအလၭစဲၪ့ထၪ့လၧၡံခံၫ့အၡၩလဖၪအ",
			"40": "<sup>40</sup> မ့ၬယၫတၭ, ဒုၭဆၧလၧစအဘံမလ့ၭနီၪလီၫ.- စအဘံ မလ့ၭလီၩ့ဆီးဝ့ၫတၭ, အဝ့ၫဒၪစဲၪ့ဝ့ၫ လၧအမ့ၬယၫ တၭ,အၪဂၩလၩ့ထ့ၬဝ့ၫတၭ, ဘၪဆၧဆ့ၭဖိး,ထီၩ့လၧ",
			"41": "<sup>41</sup> ဆၧလ့ၩနုၬလၧတရၫ့ဖၧၩ့နီၪလီၫ.- စအဘံမလ့ၭအီၪ ဝ့ၫလၧအရုမၫအဖၧၩ့တၭ, စဇံဘလၭနၫ့ထၪ့ခွံၬစဂၫ အလၭဒဲအထၧၫ့ဖုဝဲ ဘဲၫၥိၭအထီးအီၪလၧၡံခံၫ့အဖၧၩ့ လဂ့ၩလီၫ.",
			"42": "<sup>42</sup> ဆၧဖၩ့ထၪ့လနံၩနီၪ ဆၧမၩအၥၭလၧၦခမျၧးလ့ၩ ထၪ့ဝ့ၫလၧဆံၬပျၩ့ဖၧၩ့တၭ, ၦၡၩလီၩဘၪစအဘံမ",
			"43": "<sup>43</sup> လ့ၭ.- တၭအဝ့ၫဒၪမၩန့ၦခမျၧး, အၪ့နၩ့ဖၭဝ့ၫၥၧၫ့စီၪ့ တၭ,အီၪခိၭၥူၪလၧဆံၬပျၩ့ဖၧၩ့တၭ, ယိဆၧတၭ, ယိ ခွါ,ၦခမျၧးဂဲၫစဲၪ့ထၪ့ခွံၬ လၧဒိၩ့ဖၧၩ့တၭး အဝ့ၫဒၪ",
			"44": "<sup>44</sup> ဂဲထုၪ့ထၫ့ဒၩအဝ့ၫၥံၪနီၪ ဖ့ၬခွံၬဝ့ၫဒၪလီၫ.- စအဘံမ လ့ၭ,ဒဲၦလဒီၪ့အီၪလၧအၥိၭနီၪစဲၪ့ၡိၫတၭ, ဆၧၫ့ထုၪ့ လၧဆၧလ့ၩနုၬလၧဒိၩ့အတရၫ့နီၪတၭ, ၦနံၫဒီၪ့ဒၪဆၧ စဲၪ့ၡိၫလၧကယဲၦအီၪဝ့ၫလၧဆံၬပျၩ့ဖၧၩ့တၭ, ဖ့ၬၥံၫ",
			"45": "<sup>45</sup> ခွံၬအဝ့ၫၥံၪလီၫ.- စအဘံမလ့ၭဒုၭဆၧလၧဒိၩ့နီၪၥံၫ့ နံၩချီၩ့တၭ,မၩန့ဒိၩ့တၭမၩၥံၫၦခမျၧးလၧအအီၪလၧ အဖၧၩ့တၭ, မၩလၩ့ဎီးဒိၩ့တၭ, ဎွံၪထံၫလၪလၧအလး နီၪလီၫ.",
			"46": "<sup>46</sup> ၡံခံၫ့အတၨၭထီၫအၡၩၥံၪထီးအလူၬ နါဂၧၫ့ဆၧ တၭ,လ့ၩနုၬလၧထိၬလစီၪ့အဖၧၩ့ ဘၪဆဲၫ့လၧအယွၩ",
			"47": "<sup>47</sup> ဘံရ့ၭအဂံၪ့နီၪလီၫ.- တၭၦလီၩဘၪစအဘံမလ့ၭလၧ ၡံခံၫ့အတၨၭထီၫအၡၩၥံၪထီးအလူၬ အီၪကိၩ့အီၪ",
			"48": "<sup>48</sup> ကီၪ့လီၫ.- စအဘံမလ့ၭလ့ၩထၪ့လၧခိၪလီၩ့ဇၫလမၧၫ့, အဝ့ၫဒၪဒဲကယဲၦအီၪလၧအၥိၭတၭ, စအဘံမလ့ၭမၩ န့ကွၩလၧအစူၪဖၧၩ့တၭ, ခူၬလၩ့ခွံၬၥံၪ့ထဲၩ့ လထဲၩ့ တၭ,မၩန့အီၪက့ၪဝ့ၫလၧအခိၬထံၭခိၪတၭ, စံၭၦခမျၧး လၧအဖိၬအခဲၫ့လဖၪနီၪ, ဆၧလၧနၥံၪဒၪဘၪယမၩ",
			"49": "<sup>49</sup> ယီၩ,မၩနၥံၪဝ့ၫချဲၫ့ချဲၫ့ဘဲၫနီၪအၥိၭဆံၭ.- တၭၦခမျၧး ထီးအလူၬ ခူၬလၩ့ခွံၬဆ့လဂၩ အၥံၪ့ထဲၩ့လထဲၩ့,လ ဂၩအၥံၪ့ထဲၩ့လထဲၩ့ဆုၬဆုၬတၭ ဖိၬစအဘံမလ့ၭအ ခဲၫ့တၭ,အီၪက့ၪဝ့ၫလၧတၨၭနီၪတၭ, ဆူၭထၪ့ခွံၬတၨၭ လၧမ့ၪတၭ, ၦၡၩလၧၡံခံၫ့အတၨၭထီၫအဖၧၩ့ၥံၫဝ့ၫ ဆ့ထီးအလူၬ, ဒဲၦမုၪဒဲၦခွၫၦဖိၭဘိၭလထီၫ့လီၫ.",
			"50": "<sup>50</sup> ထီးနီၪလဖၧၫ့စအဘံမလ့ၭ လ့ၩလၧၥံဘ့ၭတၭ,ၥုၪ့",
			"51": "<sup>51</sup> အတဲၩထၫ့ဒုၪဒၩၥံဘ့ၭတၭ, မၩန့ဝ့ၫလီၫ.- အ့ၪမွဲတၨၭ ထီၫဂုးခၧၫ့လဖျိၪ့အီၪဝ့ၫလၧဒိၩ့ဖၧၩ့, ဒဲၦမုၪဒဲၦခွၫ,ဒဲ ကယဲၦလၧဒိၩ့ဖၧၩ့နီၪ စဲၪ့နုၬဝ့ၫလၧအဖၧၩ့တၭ, ကၭ ဘံၭထၬအခဲၫ့တၭ, လ့ၩထၪ့လၧတၨၭထီၫ အဒၩ့ခိၪ",
			"52": "<sup>52</sup> လီၫ.- စအဘံမလ့ၭလ့ၩလၧတၨၭထီၫနီၪအအီၪတၭ, ဒုၭဆၧထၫ့ဒၩအဝ့ၫတၭ, လ့ၩဘူၭလၧတၨၭထီၫအတ",
			"53": "<sup>53</sup> ရၫ့,ဘဲၫၥိၭအမိဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ.- တၭၦမုၪ လဂၩခွံၬလၩ့ဒိၭဆုၪ့ဂူၬလိးလကဲၩ့ လၧစအဘံမလ့ၭ",
			"54": "<sup>54</sup> အခိၪအလီၩ့တၭ, မၩထ့ဖၭအခိၪဎွံၪနီၪလီၫ.- ထီးနီၪ လဖၧၫ့အဝ့ၫဒၪကိၭန့ၦဖိၪၥၪခွၫ လၧအဆိၬအစူၪဝဲၩ လဂၩနီၪချဲၫ့ချဲၫ့တၭစံၭအဝ့ၫ, ထုၭထၪ့နနၭတၭ, မၩ ၥံၫယၧၩဘီၪ, ဘဲၫၥိၭၦထီးစံၭ လၧယဂဲးလၧၦမုၪလ ဂၩမၩၥံၫနီၪလဂ့ၩး အၡၩဖိၪၥၪခွၫနီၪဆ့ၭဖျီၫ့ဝ့ၫတၭ,",
			"55": "<sup>55</sup> အဝ့ၫဒၪၥံၫဝ့ၫလီၫ.- ထီးအံၫစရ့လၭအၡၩ ဒၪဘၪဝ့ၫ လၧစအဘံမလ့ၭၥံၫယူၭတၭ, အဝ့ၫၥံၪထဲၩ့ထဲၩ့ဝ့ၫလ ဂၩလၧအလးဒၪဝ့ၫ လဂၩလၧအလးဒၪဝ့ၫ ဆုၬဆုၬ",
			"56": "<sup>56</sup> လီၫ.- ယွၩဖ့ၪလၫ့ထဲၩ့စအဘံမလ့ၭ လၧအဆၧအၧၩ့ လၧအမၩအဖါ, လၧအမၩၥံၫအထၧၫ့ဖုဝဲ နွ့ၫဆံၫအ",
			"57": "<sup>57</sup> ကၠီၩ့နီၪဘဲၫနီၪၥိၭလီၫ.- တၭၡံခံၫ့အၡၩအဆၧအၧၩ့ ထီးအလူၬနီၪယွၩဖ့ၪလၫ့ထဲၩ့ဝ့ၫ လၧအဝ့ၫၥံၪအခိၪအ လီၩ့ဒဲစယရၧၭဘ့ၫအ့လၭအဖိၪခွၫ စယိၥၫ့အဆၧဆိၪ အၧၩ့နီၪဘၪအဝ့ၫၥံၪလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> တၭလၧစအဘံမလ့ၭအလးခဲၫ့ အံစခၫအၦၡၩလ ဂၩစဒိဒိၫအဖိၪခွၫ, စဖုအၫအဖိၪခွၫစတိလၫထၪ့,ဘဲၫ ၥိၭအမိမၩဖီၩ့မၩဖျ့ၭအံၫစရ့လၭတၭ, အီၪဝ့ၫလၧၡၫ",
			"2": "<sup>2</sup> မၧၫလၧခိၪလီၩ့အံဖြံၫ့အလီၩ့လီၫ.- အဝ့ၫဒၪစ့ၩရၫ့အံၫ စရ့လၭနံၫဆံၫၥၧၫ့နံၪ့တၭ, ၥံၫဝ့ၫတၭ, ၦခုၪ့လၩ့ဘၧၩ့ ခွံၬဝ့ၫလၧၡၫမၧၫအဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪအလးခဲၫ့နီၪ ၦဂံလအၭဖိၪစယၫအၧၫဖိး",
			"4": "<sup>4</sup> ထၪ့တၭ,စ့ၩရၫ့အံၫစရ့လၭနံၫဆံၫနံၫနံၪ့လီၫ.- တၭအဝ့ၫ ဒၪအဖိၪခွၫအီၪၥၧၫ့ဆံၫလၧအထူၬကၥ့ၪယီၩ့ဖိၪၥၧၫ့ ဆံၫတၭ,အဝ့ၫၥံၪအီၪလၧဒိၩ့ၥၧၫ့ဆံၫ လၧၦကိၭဝ့ၫလၧ ဟၫဝီၭယၫအၧၫထီးမုဆၫလနံၩယီၩ, လၧအအီၪလၧ",
			"5": "<sup>5</sup> ခးဂံလအၭအဖၧၩ့လီၫ.- စယၫအၧၫၥံၫဝ့ၫတၭ, ၦခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ ကၫမိၫ့အဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> ၦအံၫစရ့လၭဖိၪမၩဒီၭဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬ ယၫဒီၭတၭ, မၩဘၫအလၭလဖၪ, ဒဲအၭၡတြီၭ,ဒဲၦစံ ရအၫဖိၪအယွၩၥံၪ, ဒဲဇဲဒၧၫ့အယွၩၥံၪ,ဒဲမိအၭအယွၩ ၥံၪ,ဒဲၦအၫမၧၫ့ဖိၪအယွၩၥံၪ, ဒဲၦဖလံၡၫဖိၪအယွၩၥံၪ",
			"7": "<sup>7</sup> အဆၧတၭ,စဲၪ့ဒၪယဟိဝၩတၭ,မၩအဆၧအ့ၬ.- ယဟိ ဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪအံၫစရ့လၭတၭ, အၪ့ဆၫခွံၬ အဝ့ၫၥံၪလၧၦဖလံၡၫဖိၪၥံၪအစူၪဖၧၩ့ ဒဲလၧၦအၫမၧၫ့",
			"8": "<sup>8</sup> ဖိၪၥံၪအစူၪဖၧၩ့လီၫ.- ဆၧလၧအဆၧၫ့အထီထီးနီၪ အဝ့ၫၥံၪမၩခိမၩဝီၩယူၭ ၦအံၫစရ့လၭဖိၪလဆံၫဎိၭနံၪ့ နီၪ,ကယဲၦအံၫစရ့လၭဖိၪအီၪဝ့ၫ လၧယီၫဒၫ့ဝါလခီၫ လၧၦအၫမိၫဖိၪအခးဖၧၩ့ လၧအအီၪ လၧဂံလအၭအ",
			"9": "<sup>9</sup> ဖၧၩ့နီၪလီၫ.- တၭၦအၫမၧၫ့ဖိၪခၫ့ဂၬယီၫဒၫ့ဘဲၫၥိၭအ မိဒုၭဆၧထၫ့ဒၩယုဒၫဆ့, ဒဲထၫ့ဒၩဘံၪ့ယမံၫ့, ဒဲအံဖြံၫ့ အၡၩဂံၪ့ဖိၪလီၫ. တၭအံၫစရ့လၭ ဘၪဆၧခိဆၧဝီၩ ဒိၪမၬလီၫ.",
			"10": "<sup>10</sup> ၦအံၫစရ့လၭဖိၪကိၭထၪ့ယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, ပမၩမၪဘၪယူၭနၧၩယူၭ, အဂဲးဘဲၫယီၩပစဲၪ့ဒၪပယွၩ,",
			"11": "<sup>11</sup> ဒဲလခီၫမၩယူၭဘၫအလၭလဖၪအဆၧလီၫ.- တၭယ ဟိဝၩစံၭၦအံၫစရ့လၭဖိၪ, ယမၩဖီၩ့မၩဖျ့ၭနၥံၪလၧ အံဇံၭဖိၪ,ဒဲလၧၦအၫမိၫဖိၪ, ဒဲလၧၦအၫမၧၫ့ဖိၪ,ဒဲလၧ",
			"12": "<sup>12</sup> ၦဖလံၡၫဖိၪမွဲအ့ၬဧၪ.- လၧနီၪအမ့ၬယၫ ၦဇဲဒၧၫ့ဖိၪ, ဒဲၦအၫမလ့ၭဖိၪ,ဒဲၦမၫအၫ့ဖိၪလဖၪနီၪ မၩအၧၩ့မၩၥၫ့ နၥံၪတၭ, နၥံၪကိၭထၪ့ယၧၩနီၪ, ယမိမၩဖီၩ့မၩဖျ့ၭန",
			"13": "<sup>13</sup> ၥံၪလၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.- မွဲလါနၫ့နၥံၪစဲၪ့ဒၪယူၭ ယၧၩယူၭတၭ, နၥံၪမၩယွၩအဂူၫဂၩလဖၪအဆၧလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယမၩဖီၩ့မၩဖျ့ၭလၧၩ့နၥံၪအ့ၬ.",
			"14": "<sup>14</sup> ထီးနၥံၪဘၪဆၧခိဆၧဝီၩနီၪတၭ, လ့ၩကိၭထၪ့ယွၩလ ဖၪလၧနၥံၪရွံန့ဝ့ၫနီၪဆံၭ, မွဲအမၩဖီၩ့မၩဖျ့ၭဒၪနၥံၪ",
			"15": "<sup>15</sup> ဆံၭ.- ၦအံၫစရ့လၭဖိၪစံၭယဟိဝၩ, ပမၩမၪဘၪယူၭ ဆၧယူၭ, မၩပၧၩဘဲၫကယဲဆၧထီးအလူၬ လၧအဂ့ၩ လၧနမ့ၬအၥိၭနီၪဆံၭ. အ့ၪမွဲမၩဖီၩ့မၩဖျ့ၭလါပၧၩလၧ",
			"16": "<sup>16</sup> မုဆၫလနံၩယီၩဆံၭ.- တၭအဝ့ၫၥံၪအီၪက့ၪခွံၬၦလခီၫ ဘၩ့မုးဖိၪအယွၩလဖၪလၧအကျၩတၭ, မၩယဟိဝၩ အဆၧတၭ, ယဟိဝၩအၥၭအုၭထၪ့ လၧအံၫစရ့လၭ အဆၧၡၪ့ဆၧနၭအကၠီၩ့လီၫ.",
			"17": "<sup>17</sup> ၦအၫမၧၫ့ဖိၪၥံၪအီၪကိၩ့အီၪကီၪ့တၭ, ၥုၪ့တဲၩလၧဂံ လအၭအဖၧၩ့လီၫ. တၭၦအံၫစရ့လၭဖိၪအီၪကိၩ့အီၪ",
			"18": "<sup>18</sup> ကီၪ့တၭ, ၥုၪ့တဲၩလၧမံဇပၫအဖၧၩ့လီၫ.- တၭၦခမျၧး ဒဲဂံလအၭအၦဒိၪဖၭဒိၪလဖၪ စံၭလိၬအၥၭလဂၩဒဲလ ဂၩ,ၦလၧအမိဒုၭဆိၫၦအၫမၧၫ့ဖိၪနီၪ, မွဲပလၫလဂၩ လဲၪ,အဝ့ၫဒၪမိကဲၪထၪ့ၦဂံလအၭဖိၪ ထီးအလူၬအခိၪ လီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ၦဂံလအၭဖိၪစယ့ၭဖၥၫနီၪ မွဲၦအဆီၪ့လၧအၥၭဒူၩ လဂၩတၭ,မွဲၦမဲၩဎွဲၩမုၪလဂၩအဖိၪခွၫတၭ, စဂံလအၭ",
			"2": "<sup>2</sup> ထၪ့ဖိၪစယ့ၭဖၥၫလီၫ.- စဂံလအၭအမၫအီၪဖျဲၪန့ဝ့ၫ လၧအဖိၪခွၫလဖၪတၭ, အမၫအဖိၪခွၫလဖၪနီၪဒိၪထၪ့ တၭ,အဝ့ၫၥံၪနၫ့ထၪ့ခွံၬစယ့ၭဖၥၫနီၪ, စံၭအဝ့ၫ,နန့ၥၫ ဆၧလၧပဖါအဂံၪ့ဖၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩနမွဲၦမုၪအ",
			"3": "<sup>3</sup> ဂူၫဂၩလဂၩအဖိၪခွၫလီၫ.- စယ့ၭဖၥၫစဲၪ့ထၪ့ခွံၬလၧ အထၧၫ့ဖုဝဲလဖၪအအီၪတၭ, အီၪဝ့ၫလၧခးထိဘၫအ ဖၧၩ့တၭ, ၦၡၩလၧအအီၪက့ၪဖိၫအၥၭ အီၪကိၩ့အီၪ ကီၪ့လၧစယ့ၭဖၥၫအအီၪတၭ, လ့ၩဖိၬအဝ့ၫဒၪအခဲၫ့ လီၫ.",
			"4": "<sup>4</sup> တၭဆၧမၩအၥၭ လၧမုနံၩလဖၪအကျၩနီၪ ၦအၫ",
			"5": "<sup>5</sup> မၧၫ့ဖိၪဒုၭဆၧထၫ့ဒၩအံၫစရ့လၭလီၫ.- ထီးၦအၫမၧၫ့ ဖိၪဒုၭဆၧထၫ့ဒၩ အံၫစရ့လၭတၭ, ဆၧမၩအၥၭလၧ ဂံလအၭ,အၦၥုၪ့က့ၭၥၭၡါလဖၪ လ့ၩဝ့ၫလၧထိဘၫနီၪ ဘဲၫၥိၭအမိမၩန့ဂဲၫထဲၩ့ၥိၫ့ စယ့ၭဖၥၫလဂၩနီၪလီၫ.",
			"6": "<sup>6</sup> အဝ့ၫၥံၪစံၭစယ့ၭဖၥၫ, ဂဲၫထဲၩ့တၭ, ကဲၪထၪ့ပခိၪဘဲၫ",
			"7": "<sup>7</sup> ၥိၭပမိဒုၭဆၧ လၧၦအၫမၧၫ့ဖိၪဆံၭ.- တၭစယ့ၭဖၥၫ စံၭဂံလအၭအၦၥုၪ့က့ၭၥၭၡါ, နၥံၪၥၭဂဲၫ့ယၧၩ, ဒဲနၫ့ ထၪ့ခွံၬယၧၩလၧယဖါအဂံၪ့ဖၧၩ့နီၪမွဲအ့ၬဧၪ. ထီးနၥံၪ ဘၪဆၧခိဆၧဝီၩဘိၩ့နဲၪ့ယီၩတၭ, နၥံၪဂဲၫလၧယအီၪ,",
			"8": "<sup>8</sup> မွဲဘၪလဲၪ.- တၭဂံလအၭအၡၩၥုၪ့က့ၭၥၭၡါစံၭစယ့ၭ ဖၥၫ,ပကၠၪထဲၩ့ပၥၭလၧနအီၪဘိၩ့နဲၪ့ယီၩ, အဂဲးဘဲၫ ယီၩဘဲၫၥိၭနမိလ့ၩလၧပမ့ၬယၫ, ဒဲဒုၭဆၧထၫ့ဒၩၦအၫ မၧၫ့ဖိၪတၭ, ကဲၪထၪ့ပခိၪလၧၦဂံလအၭဖိၪထီးအလူၬ",
			"9": "<sup>9</sup> အဖၫ့ခိၪနီၪလီၫ.- စယ့ၭဖၥၫစံၭ ၦဂံလအၭ အၡၩၥုၪ့ က့ၭၥၭၡါလဖၪ, နၥံၪအ့ၪထဲၩ့ၥိၫ့ယၧၩဘဲၫၥိၭယမိဒုၭ ဆၧလၧၦအၫမၧၫ့ဖိၪတၭ, ယဟိဝၩ အ့ၪဖ့ၪလၫ့ခွံၬအ ဝ့ၫၥံၪလၧယမ့ၬယၫတၭ မွဲယမိကဲၪထၪ့ နၥံၪအခိၪဆ့",
			"10": "<sup>10</sup> ဧၪ.- တၭဂံလအၭအၡၩၥုၪ့က့ၭၥၭၡါစံၭ စယ့ၭဖၥၫ, ပအ့ၪလမၩဘၪဘဲၫနလူအီၪဝ့ၫအၥိၭတၭ, မွဲယဟိဝၩ",
			"11": "<sup>11</sup> ကဲၪထၪ့ဆၧထိးအၥၭ လၧပဘိၩ့ဆၧၩ့ဆံၭ.- ထီးနီၪ လဖၧၫ့စယ့ၭဖၥၫထဲၩ့ဝ့ၫ လၧဂံလအၭ အၡၩၥုၪ့က့ၭ ၥၭၡါတၭ, ၦခမျၧးအီၪက့ၪဝ့ၫလၧအခိၪ, ဒဲၦဒိၪဖၭဒိၪ လၧအဖၫ့ခိၪလီၫ. တၭစယ့ၭဖၥၫ ချဲၩ့အဆၧချဲၩ့ထီး အလူၬလၧယဟိဝၩအမ့ၬယၫ လၧမံဇပၫအဖၧၩ့နီၪ လီၫ.",
			"12": "<sup>12</sup> စယ့ၭဖၥၫအၪ့မၧၫ့ အၥီၫ့လဖၪလ့ၩဝ့ၫလၧအၫမၧၫ့ ဖိၪအစဎွၩအအီၪတၭ, စံၭဝ့ၫ, လၧနဂဲၫထၫ့ဒၩယၧၩ ဘဲၫၥိၭနမိဒုၭဆၧလၧ ယခးဖၧၩ့အကၠီၩ့နီၪ, နၧၩဒဲ",
			"13": "<sup>13</sup> ယၧၩဘၪဆဲၫ့လိၬပၥၭဘဲၫၥ့ၪလဲၪ.- တၭၦအၫမၧၫ့ဖိၪ အစဎွၩစံၭဆၧၫ့စယ့ၭဖၥၫအၥီၫ့လဖၪ, အဂဲးဘဲၫယီၩ လၧအံၫစရ့လၭဂဲၫစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭအဖၧၩ့နီၪ,အ ဝ့ၫၥံၪမၩန့ခွံၬယထံၫယခး လၧအၫနၫ့ဖိးလၧယၫဘီၭ, ဒဲဖိးလၧယီၫဒၫ့တၭ, ဘိၩ့နဲၪ့ယီၩဖ့ၪထဲၩ့ဆၧနီၪလဖၪ မုၬမုၬဆံၭ.",
			"14": "<sup>14</sup> စယ့ၭဖၥၫအၪ့မၧၫ့ဒီၭအၥီၫ့လဖၪ လ့ၩလၧၦအၫမၧၫ့",
			"15": "<sup>15</sup> ဖိၪအစဎွၩအအီၪတၭ,- စံၭအဝ့ၫ, စယ့ၭဖၥၫစံၭဘဲၫ ယီၩ,မိအၭအခး, ဒဲၦအၫမၧၫ့ဖိၪအခးနီၪအံၫစရ့လၭ",
			"16": "<sup>16</sup> မၩန့ခွံၬအ့ၬ.- အ့ၪမွဲလၧအံၫစရ့လၭဂဲၫစဲၪ့ထၪ့ခွံၬလၧ အံဇံၭတၭ, လ့ၩခၫ့ဂၬ ၡါမုနၧၫ့ဖၫ လၧမၫဆမံၭဝီၩ",
			"17": "<sup>17</sup> တၭ,လ့ၩထီၩ့လၧကၫဒ့ၭနီၪ,- အံၫစရ့လၭအၪ့မၧၫ့ အၥီၫ့လဖၪလ့ၩလၧအံဒၧၫ့အစဎွၩအအီၪတၭ, စံၭဝ့ၫ, ဒုၭလ့ၩခၫ့ဂၬလါယၧၩလၧနခးဘီၪ. မွဲလါနၫ့ အံဒၧၫ့ အစဎွၩခိၭနၪဆၧအ့ၬ. အဝ့ၫၥံၪအၪ့မၧၫ့လၩ့ ဆၧလၧ မိအၭအစဎွၩနီၪဘဲၫနီၪၥိၭဆ့လီၫ. မွဲလါနၫ့အၥၭအီၪ အ့ၬ.တၭအံၫစရ့လၭ အီၪဝ့ၫလၧ ကၫဒ့ၭအဖၧၩ့နီၪ",
			"18": "<sup>18</sup> လီၫ.- အဝ့ၫၥံၪလ့ၩဆၧလၧၡါမုနၧၫ့ဖၫတၭ, လ့ၩဎဲၪ့ ခးအံဒၧၫ့, ဒဲခးမိအၭတၭ,လ့ၩလၧခးမိအၭအနဲၩ့လၧ မုထၪ့လခီၫတၭ, ၥုၪ့အတဲၩလၧအၫနၫ့ ဝါလခီၫလီၫ. မွဲလါနၫ့လ့ၩနုၬလၧမိအၭအနဲၩ့ထံၭအဖၧၩ့ လခီၫအ့ၬ.",
			"19": "<sup>19</sup> အဂဲးဘဲၫယီၩ အၫနၫ့ မွဲမိအၭ အနဲၩ့ထံၭလီၫ.- တၭ အံၫစရ့လၭ အၪ့မၧၫ့အၥီၫ့လဖၪ လ့ၩလၧၦအၫမိၫဖိၪ အစဎွၩစဲဟၫ့, ဟ့ၭၡဘၫ့ အစဎွၩတၭ, အံၫစရ့လၭ စံၭဝ့ၫ,ဒုၭခၫ့ဂၬလါပၧၩ လၧနခးဖိး လၧပလးဆံၭ.",
			"20": "<sup>20</sup> တၭစစဲဟၫ့နဲၩအံၫစရ့လၭအလူ ဘဲၫၥိၭအမိခၫ့ဂၬအ ထံၫအခးအ့ၬ. အ့ၪမွဲစစဲဟၫ့ ဒုၭအီၪကိၩ့အီၪကီၪ့အ ၡၩခမျၧးတၭ, ၥုၪ့တဲၩလၧယၫဟၭတၭ, ဒုၭဆၧထၫ့",
			"21": "<sup>21</sup> ဒၩအံၫစရ့လၭလီၫ.- တၭယဟိဝၩအံၫစရ့လၭအယွၩ ဖ့ၪလၫ့ခွံၬစစဲဟၫ့, ဒဲအၡၩခမျၧးလၧအံၫစရ့လၭအစူၪ ဖၧၩ့တၭ, အဝ့ၫၥံၪဖ့ၬခွံၬဝ့ၫလီၫ. တၭအံၫစရ့လၭမၩ",
			"22": "<sup>22</sup> န့ၦအၫမိၫဖိၪ, ၦခးဖိၪအခးထၧၫ့ဘံၪ့ယၫလီၫ.- မၩန့ အၫမိၫဖိၪအခးနဲၩ့ထံၭ ထီးအလူၬ လၧအၫနၫ့ဖိးလၧ ယၫဘီၭတၭ, လၧၡါမုနၧၫ့ဖၫနီၪ ဖိးလၧယီၫဒၫ့လီၫ.",
			"23": "<sup>23</sup> တၭဘိၩ့နဲၪ့ယီၩ ယဟိဝၩအံၫစရ့လၭ အယွၩနၫ့ထၪ့ ခွံၬၦအၫမိၫဖိၪလၧအၡၩခမျၧးအမ့ၬယၫတၭ, နဝ့ၫဒၪ",
			"24": "<sup>24</sup> ယီၩ,မွဲနမိမၩဘၪဆ့ဧၪ.- ဆၧလၧနယွၩခံမီၭဖ့ၪလၫ့ နၧၩနီၪ,မွဲနမိမၩန့အ့ၬဧၪ. တၭကယဲဆၧလၧယဟိဝၩ ပယွၩနၫ့ထၪ့ခွံၬလၧပမ့ၬယၫနီၪ ပမိမၩန့ပဝ့ၫဆ့လီၫ.",
			"25": "<sup>25</sup> တၭဘိၩ့နဲၪ့ယီၩမွဲနဂ့ၩနဲၪ့ မိအၭအစဎွၩစဇံၭဖီၫအ ဖိၪခွၫစဘၫလၭနီၪဒံၭဧၪ. မွဲအဝ့ၫဒၪဂဲးလိၬလၧအံၫစ",
			"26": "<sup>26</sup> ရ့လၭတၭ, ဒုၭဆၧထၫ့ဒၩ လၧအဝ့ၫၥံၪဆ့ဧၪ.- လၧ အံၫစရ့လၭ အီၪဝ့ၫလၧဟ့ၭၡဘၫ့ ဒဲအတဝၫ့လဖၪအ ဖၧၩ့,ဒဲလၧအရိအၧၫဒဲအတဝၫ့လဖၪအဖၧၩ့, ဒဲလၧက ယဲဒိၩ့လဖၪ လၧအအီၪဝ့ၫလၧအၫနၫ့ အနဲၩ့အဎီၩ့အ နံၪ့ၥၧၫ့ယၩအထးဖၧၩ့နီၪ, နၥံၪလမၩန့ထဲၩ့ဘၪဝ့ၫလၧ",
			"27": "<sup>27</sup> အဆၧၫ့အထီထီးနီၪ, မွဲဘၪလဲၪ.- တၭယဝ့ၫဒၪယီၩ ယမၩမၪဘၪနၧၩအ့ၬ, အ့ၪမွဲနဒုၭၥုၭထၫ့ဒၩယၧၩယီၩ နမၩအၧၩ့ယၧၩလီၫ. မွဲယဟိဝၩၦစ့ၩရၫ့ခွးလဂၩစ့ၩ ရၫ့ဆၧလၧမုဆၫလနံၩယီၩ လၧၦအံၫစရ့လၭဖိၪ ဒဲၦ အၫမၧၫ့ဖိၪအဘိၩ့ဆၧၩ့နီၪဆံၭ.",
			"28": "<sup>28</sup> မွဲလါနၫ့တၭ စယ့ၭဖၥၫအဆၧချဲၩ့ လၧအဖ့ၪယုဝ့ၫ နီၪၦအၫမၧၫ့ဖိၪအစဎွၩခိၭနၪဝ့ၫအ့ၬ.",
			"29": "<sup>29</sup> ထီးနီၪလဖၧၫ့ယဟိဝၩအၥၭလၩ့ဘၪဝ့ၫ လၧစယ့ၭ ဖၥၫအလီၩ့တၭ, အဝ့ၫဒၪခၫ့ဂၬဂံလအၭဒဲမနၭစ့ၫဒဲခၫ့ ဂၬမံဇပၫဘၪဆဲၫ့လၧဂံလအၭနီၪ, စဲၪ့ထၪ့ခွံၬလၧမံဇ ပၫဘၪဆဲၫ့လၧဂံလအၭနီၪ, ခၫ့ဂၬဆၧဖိးလၧအၫမၧၫ့ ဖိၪအအီၪနီၪလီၫ.",
			"30": "<sup>30</sup> စယ့ၭဖၥၫ ဆိၪလၩ့အၥၭလၧယဟိဝၩအမ့ၬယၫ တၭ,စံၭဝ့ၫဒၪ, နအ့ၪဖ့ၪလၫ့တၡါၦအၫမၧၫ့ဖိၪလၧယ",
			"31": "<sup>31</sup> စူၪဖၧၩ့တၭ,- ထီးယအ့ၪဂဲၫထဲၩ့ထဲၩ့မုၬမုၬလၧၦအၫ မၧၫ့ဖိၪအအီၪတၭ, ဆၧမိမၩအၥၭထီးဒၪဆၧလၧအ ဂဲၫထၪ့အၪ့ဂၬယၧၩလၧယဂံၪ့အတရၫ့နီၪ, မိကဲၪထၪ့ ယဟိဝၩအဆၧတၡါတၭ, အ့ၪလမွဲဘၪယမိလုထၪ့ လၧဆၧလုမ့ၪလီၫ.",
			"32": "<sup>32</sup> စယ့ၭဖၥၫခၫ့ဂၬဆၧဖိး လၧၦအၫမၧၫ့ဖိၪအအီၪဘဲၫ ၥိၭအမိဒုၭဆၧထၫ့ဒၩအဝ့ၫၥံၪတၭ, ယဟိဝၩဖ့ၪလၫ့ ခွံၬအဝ့ၫၥံၪလၧအစူၪဖၧၩ့လီၫ.",
			"33": "<sup>33</sup> တၭအဝ့ၫဒၪဖ့ၬခွံၬအဝ့ၫၥံၪ လၧအရိအၧၫဖိးလၧန လ့ၩနုၬလၧမံၫ့နံၭ, ဒိၩ့နံၫဆံၫ,ဒဲဖိးလၧစဘံၭအလးလဖၪ အဆၧပျၩ့ဖၧၩ့, ဆၧမၩၥံၫဖၭဒိၪလီၫ. တၭၦအၫမၧၫ့ ဖိၪစၪဝ့ၫလၧၦအံၫစရ့လၭဖိၪ အမ့ၬယၫဘဲၫနီၪၥိၭလီၫ.",
			"34": "<sup>34</sup> စယ့ၭဖၥၫထဲၩ့ထဲၩ့လၧမံဇပၫ ထီၩ့လၧအဂံၪ့တၭ, ယိခွါ,အဖိၪမုၪလဂၩ ဂဲၫထၪ့အၪ့ဂၬဝ့ၫ အီၪလၧဒိၩ့ ၥံၪဒဲဆၧဂဲထုၪ့လံလီၫ. တၭအဝ့ၫဒၪမွဲအဖိၪလဂၩဎး လီၫ.လၧအဝ့ၫဒၪအမ့ၬယၫနီၪ အမုၪမွဲဂ့ၩ, အခွၫမွဲ",
			"35": "<sup>35</sup> ဂ့ၩ,အီၪနးဂၩအ့ၬ.- ထီးအဒၪဘၪဝ့ၫတၭ, ဆၧမၩအ ၥၭလၧအၡၫ့အကီၩ့အၥိၭတၭ, စံၭဝ့ၫဒၪ,အၩလါ,ယ ဖိၪမုၪဧ့ၬ နဆၪ့လၩ့ယၧၩနၭမၬလီၫ. နကဲၪထၪ့ၦမၩ ခိမၩဝီၩယၧၩလဂၩလီၫ. အဂဲးဘဲၫယီၩယအၩ့ထၪ့ ယနိၭလၧယဟိဝၩအမ့ၬယၫတၭ, ယထဲၩ့ထဲၩ့နီၪၥ့ၪ",
			"36": "<sup>36</sup> အ့ၬ.- အဝ့ၫဒၪစံၭဝ့ၫ, ယဖါဧ့, နအ့ၪအၩ့ထၪ့နနိၭလၧ ယဟိဝၩအမ့ၬယၫတၭ, မၩဆၧဘဲၫဆၧထၪ့ဖျ့ၭလၧန နိၭအၥိၭနီၪဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩ မၩဆၧၫ့န",
			"37": "<sup>37</sup> ဒုၪနဒၩ,ၦအၫမၧၫ့ဖိၪလၧနဂးလီၫ.- တၭစံၭအဖါ,မွဲ ဆၧလမံၩ့ယီၩမၩအၥၭလၧ ယဂးဘီၪး လၩနံၫဘံၪ့အ ထးဖၧၩ့နီၪမၩယၧၩဆၧနးမံၩ့လဂ့ၩ, မွဲဘဲၫၥိၭယမိစဲၪ့ ဝံၩ့ဝၩ့လၧခိၪလီၩ့ထိၩ့ချိၬ, ဒဲဂၪ့လၧယမုၪနၩ့အကၠီၩ့,",
			"38": "<sup>38</sup> ယဝ့ၫဒၪဒဲယထံၩယၥိၭလဖၪဆ့လီၫ.- တၭအဝ့ၫဒၪ စံၭဝ့ၫ,လ့ၩဘီၪ. တၭကွဲၪဖျါခွံၬဝ့ၫလၩနံၫဘံၪ့နီၪ,အ ဝ့ၫဒၪလ့ၩဝ့ၫလၧအထံၩအၥိၭတၭ, ဂၪ့ဝ့ၫလၧအမုၪနၩ့",
			"39": "<sup>39</sup> အကၠီၩ့လၧခိၪလီၩ့ထိၩ့ချိၬနီၪလီၫ.- တၭလၧလၩနံၫ ဘံၪ့အထုၬနီၪဆၧမၩအၥၭလၧအဂဲၫထဲၩ့ထဲၩ့လၧအ ဖါအအီၪနီၪ, အဝ့ၫဒၪမၩဝ့ၫဘဲၫအဆိၪလၩ့အၥၭအ ၥိၭနီၪတၭး ၦမုၪနီၪၥ့ၪယၫၦခွၫအ့ၬ. တၭဆၧကဲၪထၪ့ ဝ့ၫလၧဆၧအထူၫအရူၫ လၧအံၫစရ့လၭအဖၧၩ့လီၫ.",
			"40": "<sup>40</sup> လနံၪ့ဘၪလနံၪ့, လနံၪ့ဘၪလနံၪ့ၦအံၫစရ့လၭအဖိၪမုၪ လဖၪလ့ၩထၪ့ဂၪ့ဆၧယၧၩ့ဆၧ လၧၦဂံလအၭဖိၪစယ့ၭ ဖၥၫအဖိၪမုၪအကၠီၩ့, လနံၪ့အထးဖၧၩ့နီၪလံနံၩလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ၦအံဖြံၫ့ဖိၪအီၪကိၩ့အီၪကီၪ့တၭ, ခၫ့ဂၬဆၧလၧမု ဖၩလခီၫတၭ,စံၭစယ့ၭဖၥၫ, နလ့ၩခၫ့ဂၬဒုၭဆၧထၫ့ဒၩ ၦအၫမၧၫ့ဖိၪတၭ, လကိၭဘၪပၧၩ ဘဲၫၥိၭပမိလ့ၩဆၧ လၧနၥိၭနီၪ, မွဲဘၪလဲၪ. ပမိဆူၭထၪ့ခွံၬ နဂံၪ့လၧမ့ၪ",
			"2": "<sup>2</sup> လၧနဖၫ့ခိၪလီၫ.- တၭစယ့ၭဖၥၫစံၭအဝ့ၫၥံၪ, ယဝ့ၫဒၪ ဒဲယၡၩခမျၧး ပအဲၪ့လိၬဆိၭချဲၩ့လိၬပၥၭ လၧၦအၫ မၧၫ့ဖိၪနၭမၬလီၫ. တၭလၧယကိၭန့နၥံၪနီၪ နၥံၪမၩ",
			"3": "<sup>3</sup> ဖီၩ့ဖျ့ၭယၧၩ လၧအဝ့ၫၥံၪအစူၪဖၧၩ့အ့ၬ.- ထီးယဒၪ ဘၪနၥံၪလမၩဖီၩ့ဖျ့ၭဘၪယၧၩလၧ အဝ့ၫၥံၪအစူၪဖၧၩ့ တၭးယအီၪက့ၪလၩ့ယၥၭ လၧယစူၪဒၪယဝ့ၫအဖၧၩ့ တၭ,ယခၫ့ဂၬထၫ့ဒၩၦအၫမၧၫ့ဖိၪနီၪ, ယဟိဝၩဖ့ၪလၫ့ အဝ့ၫၥံၪလၧယစူၪဖၧၩ့လီၫ. တၭနၥံၪဂဲၫဘဲၫၥိၭနၥံၪမိ ဒုၭဆၧထၫ့ဒၩယၧၩလၧမုဆၫလနံၩယီၩမွဲဘၪလဲၪ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ စယ့ၭဖၥၫဒုၭအီၪကိၩ့အီၪကီၪ့ဂံလ အၭအၡၩထီးအလူၬတၭ, ဒုၭဆၧလၧအံဖြံၫ့တၭ,ၦဂံ လအၭအၡၩ ဖ့ၬခွံၬအံဖြံၫ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫ ၥံၭစံၭဝ့ၫ,နၥံၪဝ့ၫ, ၦဂံလအၭဖိၪမွဲၦစဲၪ့ဖျိၭဖီၩ့ဖျ့ၭဆၧ လၧအံဖြံၫ့အစူၪဖၧၩ့လီၫ. ဂံလအၭအီၪဝ့ၫလၧအံဖြံၫ့",
			"5": "<sup>5</sup> ဒဲမနၭစ့ၫအဘိၩ့ဆၧၩ့လီၫ.- တၭၦဂံလအၭဖိၪမၩန့ ဆိၫဖၧၩ့ၥၭခၫ့ဂၬ ယီၫဒၫ့လဖၪ လၧၦအံဖြံၫ့ဖိၪအမ့ၬ ယၫလီၫ.တၭထီးၦအံဖြံၫ့ဖိၪ လၧအဖီၩ့ဖျ့ၭနီၪစံၭဝ့ၫ, ဒုၭခၫ့ဂၬယၧၩဘီၪး တၭဆၧမၩအၥၭလၧဂံလအၭအ ၡၩစံၭအဝ့ၫ,နမွဲၦအံဖြံၫ့ဖိၪဆ့ဧၪ. အဝ့ၫဒၪအ့ၪစံၭဝ့ၫ,",
			"6": "<sup>6</sup> မွဲအ့ၬး- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪစံၭ, စံၭလါၡံၭဘိၫလ့ၭ နီၪဘီၪ,တၭအဝ့ၫဒၪစံၭဝ့ၫ လၧစံဘိၫလ့ၭနီၪလီၫ.တၭ တဲၩ့ဝဲၩအနိၭ ဘဲၫၥိၭအမိကိၭကျၩၥ့ၪအ့ၬ. ထီးနီၪလ ဖၧၫ့အဝ့ၫၥံၪဖီၪ့ထၬဝ့ၫတၭ, မၩၥံၫဝ့ၫ ထီးဖၧၩ့ၥၭခၫ့ ဂၬယီၫဒၫ့အလးလီၫ. တၭအဆၧၫ့အထီထီးနီၪ ၦအံ ဖြံၫ့ဖိၪလၩ့ထ့ၬဝ့ၫလံလၬနံၫထီၫ့လီၫ.",
			"7": "<sup>7</sup> တၭယ့ၭဖၥၫစ့ၩရၫ့အံၫစရ့လၭဎူၫနံၪ့လီၫ. ထီးနီၪ လဖၧၫ့ၦဂံလအၭဖိၪ စယ့ၭဖၥၫၥံၫဝ့ၫတၭ, ၦခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧဂံလအၭအဒိၩ့လဖျိၪ့အဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> တၭအဝ့ၫဒၪအလးခဲၫ့နီၪ စအံဘဇၫ့ လၧဘ့ၭၥလံၫ",
			"9": "<sup>9</sup> ဟံၫ့စ့ၩရၫ့အံၫစရ့လၭလီၫ.- တၭအဝ့ၫအီၪလၧအဖိၪ ခွၫၥၧၫ့ဆံၫ ဒဲအဖိၪမုၪ ၥၧၫ့ဆံၫတၭ, အၪ့မၧၫ့လၩ့ဆၧ လၧခီၫ့,မၩန့ၦအဖိၪမုၪလၧခီၫ့ၥၧၫ့ဆံၫ လၧအဖိၪခွၫအ",
			"10": "<sup>10</sup> ဂးတၭ,စ့ၩရၫ့အံၫစရ့လၭနွ့ၫနံၪ့လီၫ.- စအံဘဇၫ့နီၪ ၥံၫဝ့ၫတၭ,ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧဘ့ၭၥလံၫဟံၫ့အ ဖၧၩ့နီၪလီၫ.",
			"11": "<sup>11</sup> တၭအဝ့ၫဒၪအလးခဲၫ့နီၪ, ၦဇ့ၭဘလၧၫ့ဖိၪစအံလၧၫ့ စ့ၩရၫ့အံၫစရ့လၭတၭ အဝ့ၫဒၪစ့ၩရၫ့အံၫစရ့လၭဆံၫ",
			"12": "<sup>12</sup> နံၪ့လီၫ.- ၦဇ့ၭဘလၧၫ့ဖိၪ စအံလၧၫ့နီၪၥံၫဝ့ၫတၭ, ၦ ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧအၭဇလၧၫ့အဖၧၩ့ လၧဇ့ၭဘ လၧၫ့အခးဖၧၩ့နီၪလီၫ.",
			"13": "<sup>13</sup> တၭအဝ့ၫဒၪအလးခဲၫ့နီၪ ၦပံၫရၥၧၫ့ဖိၪစဟံလလၭ",
			"14": "<sup>14</sup> အဖိၪခွၫစအၭဘဒၫ့ စ့ၩရၫ့အံၫစရ့လၭလီၫ.- တၭအ ဝ့ၫဒၪအီၪလၧအဖိၪခွၫလံဆံၫ, ဒဲအလံၩခွၫၥၧၫ့ဆံၫလၧ အထူၬကၥ့ၪယီၩ့ဖိၪ နွ့ၫဆံၫလီၫ. တၭအဝ့ၫလဂၩစ့ၩ",
			"15": "<sup>15</sup> ရၫ့အံၫစရ့လၭဎိၭနံၪ့လီၫ.- တၭၦပံရၥၧၫ့ဖိၪ စဟံလ လၭအဖိၪခွၫစအၭဘဒၫ့နီၪၥံၫဝ့ၫတၭ, ၦခုၪ့လၩ့ဘၧၩ့ ခွံၬဝ့ၫလၧပံရၥၧၫ့အဖၧၩ့ လၧအံဖြံၫ့အခးဖၧၩ့, လၧၦ အၫမလ့ၭဖိၪအခိၪလီၩ့ အလီၩ့လီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭဖိၪ မၩဒီၭဆၧအၧၩ့ လၧယဟိဝၩအ မ့ၬယၫတၭ,ယဟိဝၩဖ့ၪလၫ့ခွံၬ အဝ့ၫၥံၪလၧၦဖလံၡၫ ဖိၪအစူၪဖၧၩ့အနံၪ့လံဆံၫလီၫ.",
			"2": "<sup>2</sup> ၦဇိရၫဖိၪအီၪဝ့ၫလဂၩလၧၦဒၫ့ဖိၪအဂံၪ့ဒီၪ့အကျၩ နီၪအမံၩ့မွဲစမနိအၫတၭး အမၫနီၪမွဲၦထူၬဖိၪတၭအီၪ",
			"3": "<sup>3</sup> ဖျဲၪဆၧအ့ၬ.- ယဟိဝၩအၥီၫ့နီၪ နဲၪဖျီၪထၪ့အၥၭလၧ ၦမုၪနီၪအမ့ၬယၫတၭ, စံၭဝ့ၫ,ယိခွါ, ဘိၩ့နဲၪ့ယီၩနမွဲၦ ထူၬဖိၪတၭ,အီၪဖျဲၪဆၧအ့ၬး မွဲလါနၫ့နမိဒၧၩ့ထၪ့တၭ,",
			"4": "<sup>4</sup> နမိအီၪဖျဲၪန့နဖိၪခွၫလီၫ.- ဘိၩ့နဲၪ့ယီၩ ထီးလၩ့နၥၭ ဘီၪ,စဘံၭထံၫမွဲဂ့ၩ, ၥံၭထံၫဂၬထံၫမွဲဂ့ၩ, အီၩလဂ့ၩ",
			"5": "<sup>5</sup> တၭ,အၪ့ဆၧလဆံၫ့ဘၪနးမံၩ့လဂ့ၩ.- အဂဲးဘဲၫယီၩ, ယိခွါ,နမိဒၧၩ့ထၪ့တၭ, နမိအီၪဖျဲၪန့နဖိၪခွၫတၭ,နလိၩ့ ဘၪအခိၪလၧဒီၩအ့ၬ. အဂဲးဘဲၫယီၩ ဖိၪၥၪလဂၩနီၪမိ ကဲၪထၪ့ၦနၭစရ့ၭဖိၪ လၧယဟိဝၩအဂး လၧဆၧဒၧၩ့ လးအဖၧၩ့လီၫ. တၭမွဲအမိမၩဖီၩ့မၩဖျ့ၭ ၥၫ့အံၫစရ့",
			"6": "<sup>6</sup> လၭလၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့ၦ မုၪနီၪဂဲၫလီၩဘၪအဝၩတၭ, စံၭဝ့ၫဒၪ, ယွၩအၡၩလ ဂၩဂဲၫလၧယအီၪတၭ, အမ့ၬမၩအၥၭ ဘဲၫယွၩအၥီၫ့ လဂၩအမ့ၬအၥိၭနီၪ ဆၧၥၭမဲၪအလး ဒိၪမၬလီၫ. မွဲ လါနၫ့မွဲအဂဲၫထၪ့ အထံၭခီၫခီၫလဲၪနီၪ ယအၪ့စၪ့အ",
			"7": "<sup>7</sup> ဝ့ၫအ့ၬ.ဒဲလီၩဘၪယၧၩ လၧအမံၩ့ဆ့အ့ၬ.- အ့ၪမွဲအ ဝ့ၫဒၪစံၭယၧၩ, ယိခွါ,နမိဒၧၩ့ထၪ့တၭ, နမိအီၪဖျဲၪန့န ဖိၪခွၫလီၫ. ဘိၩ့နဲၪ့ယီၩစဘံၭထံၫမွဲဂ့ၩ, ၥံၭထံၫဂၬထံၫ မွဲဂ့ၩ,ထီးအီၩလဂ့ၩတၭ, ဆၧလဆံၫ့ဘၪနီၪအၪ့နးမံၩ့ လဂ့ၩ,အဂဲးဘဲၫယီၩ ဖိၪၥၪနီၪမိကဲၪထၪ့ၦနၭစရ့ၭဖိၪ လၧယွၩအဂးလၧဆၧဒၧၩ့လးဖၧၩ့နီၪ ထီးမုလနံၩလၧ အၥံၫဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ထီးနီၪလဖၧၫ့စမနိအၫ အၪ့ကံၩ့အၪ့ယၫ ယဟိဝၩ တၭ,စံၭဝ့ၫဒၪ,အိၩ, ယကဆါဧ့, မွဲယွၩအၡၩလၧနအၪ့ မၧၫ့လၩ့ဝ့ၫလဂၩနီၪဂဲၫထဲၩ့ထဲၩ့လါလၧပအီၪ, ပမိမၩ ဖိၪၥၪလၧအမိအီၪဖျဲၪလဂၩဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ,",
			"9": "<sup>9</sup> ၥီၪ့လိၪပၧၩဆံၭ.- ယွၩခိၭနၪစမနိအၫအလူတၭ, ထီး ၦမုၪနီၪဆၧၫ့နၩ့လၧဆံၬပျၩ့ဖၧၩ့တၭ, ယွၩအၥီၫ့နီၪဂဲၫ ဒီၭလၧအအီၪလီၫ. တၭအဝၩစမနိအၫအီၪ လၧအၥိၭ",
			"10": "<sup>10</sup> အ့ၬ.- ၦမုၪနီၪမၩဝ့ၫချဲၫ့ချဲၫ့တၭ, စဲၪ့တလဲးဒုၭနဲၪဆၧ လၧအဝၩတၭ, စံၭအဝ့ၫ,ယိခွါ, ၦၡၩလၧအဂဲၫလၧယ အီၪလၧမုလနံၩနီၪနဲၪဖျီၪထၪ့ယူၭအၥၭ လၧယမ့ၬယၫ",
			"11": "<sup>11</sup> ယူၭ.- စမနိအၫဂဲထုၪ့တၭ, ဖိၬအမၫအခဲၫ့လ့ၩထီၩ့လၧ ၦၡၩနီၪအအီၪတၭ, စံၭအဝ့ၫ,နမွဲၦၡၩလၧအချဲၩ့ဆၧ",
			"12": "<sup>12</sup> လၧၦမုၪနီၪဆ့ဧၪ. တၭအဝ့ၫဒၪစံၭဝ့ၫ,ယၧၩလီၫ.- စမ နိအၫစံၭဝ့ၫဒၪ, ဘိၩ့နဲၪ့ယီၩနဆၧချဲၩ့မိကဲၪထၪ့ဝ့ၫဒၪ တၭ,မွဲပမိစ့ၩရၫ့ၥီၪ့လိၪဖိၪၥၪဘဲၫၥ့ၪလဲၪ, ဒဲပမိမၩဝ့ၫ",
			"13": "<sup>13</sup> ဘဲၫၥ့ၪလဲၪ.- တၭယဟိဝၩအၥီၫ့နီၪစံၭ စမနိအၫ,က",
			"14": "<sup>14</sup> ယဲဆၧလၧယလီၩဘၪၦမုၪနီၪ, မွဲအထီးန့ဆံၭ.- မွဲအ ထီးအၪ့ဘၪဆၧဘၪဆဲၫ့လၧစဘံၭမုနးမံၩ့လဂ့ၩ, စဘံၭ ထံၫမွဲဂ့ၩ, ၥံၭထံၫဂၬထံၫမွဲဂ့ၩ, မွဲအထီးအီၩလဂ့ၩ, တၭဆၧလဆံၫ့ဘၪနီၪ, မွဲအထီးအၪ့နးမံၩ့လဂ့ၩး က ယဲဆၧလၧယမၪလူၬဝ့ၫနီၪ, မွဲအထီးန့ဆံၭ.",
			"15": "<sup>15</sup> တၭစမနိအၫစံၭယဟိဝၩအၥီၫ့နီၪ, မွဲပမိကိၭထၬ",
			"16": "<sup>16</sup> လါနၧၩ, ထီးပတဲၩ့ဝဲၩဘ့ၪဖိၪလဒုၩလၧနဂးလီၫ.- ယ ဟိဝၩအၥီၫ့နီၪစံၭစမနိအၫ, နအ့ၪကိၭထၬဒံၭယၧၩ လါနၫ့တၭ, ယအၪ့ကိၪအ့ၬး တၭနအ့ၪလုထၪ့ဆၧလု မ့ၪနီၪ, နဘၪလုထၪ့လၧယဟိဝၩလီၫ. အဂဲးဘဲၫယီၩ",
			"17": "<sup>17</sup> စမနိအၫၥ့ၪယၫလၧအမွဲယဟိဝၩအၥီၫ့နီၪအ့ၬ.- စမနိ အၫစံၭယဟိဝၩအၥီၫ့နီၪ, ထီးနချဲၩ့ဆၧနီၪအ့ၪကဲၪထၪ့ ယူၭဝ့ၫဘဲၫၥိၭပမိမၩလၩဖၩ့နၧၩတၭ, နမံၩ့နီၪမွဲဘဲၫၥ့ၪ",
			"18": "<sup>18</sup> လဲၪ.- ယဟိဝၩအၥီၫ့နီၪစံၭအဝ့ၫ, ယမံၩ့မွဲဆၧလၩ့လၭ",
			"19": "<sup>19</sup> အကၠီၩ့နီၪ,မွဲဘၪနီၫလၫလၧနအၪ့စၪ့ဝ့ၫလဲၪ.- စမနိအၫ မၩန့ဘ့ၪဖိၪ, ဒဲဆၧမၩဘိၪ့ကိၪမုၬတၭ, လုထၪ့ဝ့ၫလၧ ယဟိဝၩ လၧလိးလဖျိၪ့အလီၩ့တၭ, အဝ့ၫဒၪမၩဆၧ",
			"20": "<sup>20</sup> လၩ့လၭတၭး စမနိအၫဒဲအမၫယိဝ့ၫလီၫ.- ထီးမ့ၪလၪ ခဲၩထၪ့လၧဆၧလုအလးနီၪ ထၪ့တီၩတီၩ လၧမူၭခိၪ တၭ,ဆၧမၩအၥၭလၧယဟိဝၩအၥီၫ့နီၪ လ့ၩထၪ့လၧ ဆၧလုလးအမ့ၪလၪအကျၩလီၫ. စမနိၫအၫဒဲအမၫယိ",
			"21": "<sup>21</sup> ဝ့ၫတၭ,ၡီၫ့လၩ့အၥၭနီၪထီၩ့လၩ့လၧဂၪ့ခိၪလီၫ.- အ့ၪ မွဲယဟိဝၩအၥီၫ့နီၪနဲၪဖျီၪထၪ့လၧၩ့အၥၭ လၧစမနိအၫ ဒဲအမၫအမ့ၬယၫအ့ၬ. ထီးနီၪလဖၧၫ့ စမနိအၫၥ့ၪယၫ ဝ့ၫလၧအမွဲယဟိဝၩအၥီၫ့နီၪလီၫ.",
			"22": "<sup>22</sup> တၭစမနိအၫစံၭအမၫ, ပဒၪဘၪယူၭ, ယဟိဝၩအ",
			"23": "<sup>23</sup> ကၠီၩ့တၭ,ပမိၥံၫတၡါလီၫ.- အ့ၪမွဲအမၫစံၭအဝ့ၫ,ယ ဟိဝၩအၥၭအ့ၪအီၪလၧအမိမၩၥံၫပၧၩတၭ, မွဲအထိး ဆၧၫ့ဆၧလုမ့ၪ, ဒဲဆၧမၩဘိၪ့ကိၪမုၬလၧပစူၪဖၧၩ့အ့ၬ. တၭဒုၭနဲၪပၧၩလၧကယဲဆၧလဖၪ ထီးအလူၬနီၪ, ဒဲ အထီထီးယီၩမိလီၩဘၪပၧၩ လၧဆၧလဖၪဘဲၫယီၩအ ၥိၭဆ့အ့ၬ.",
			"24": "<sup>24</sup> တၭၦမုၪနီၪအီၪဖျဲၪန့အဖိၪခွၫတၭ, ကိၭဝ့ၫအမံၩ့လၧ စစၫ့စၧၫ့လီၫ. တၭဖိၪၥၪနီၪဒိၪထၪ့တၭ, ယဟိဝၩဆိၪ",
			"25": "<sup>25</sup> ဂ့ၩဝ့ၫလီၫ.- တၭယဟိဝၩအၥၭ ထိၪဂဲၩၥၫ့ဝ့ၫလဖၧၫ့ လဖၧၫ့လၧစဒၫ့အၥုၪ့တဲၩအလးဖၧၩ့ လၧဇိၫရၫဒဲအ့ၭၡ တအီၭလၭအဘိၩ့ဆၧၩ့လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> စစၫ့စၧၫ့လ့ၩလၩ့လၧထံၫမနၭတၭ, ဒၪဘၪၦမုၪလ ဂၩလၧထံၫမနၭအဖၧၩ့, လၧၦဖလံၡၫဖိၪအဖိၪမုၪအ",
			"2": "<sup>2</sup> ကျၩလီၫ.- ဂဲၫထဲၩ့လီၩဘၪအမိအဖါတၭ, စံၭဝ့ၫဒၪ, ယဒၪဘၪယူၭၦမုၪလဂၩ လၧထံၫမနၭအဖၧၩ့,လၧၦဖ လံၡၫဖိၪအဖိၪမုၪအကျၩယူၭတၭ, ဘိၩ့နဲၪ့ယီၩမၩန့ အဝ့ၫလၧယမၫအဂးဘီၪ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့အမိအဖါစံၭအဝ့ၫ, ၦမုၪလၧနထၧၫ့ ဖုဝဲအဖိၪမုၪအကျၩ,လၧယၡၩလဆၨၩအကျၩနီၪမွဲလ အီၪဘၪတၭ, နလ့ၩမၩန့နမၫလၧၦလဒိၭဘၪဆၧကူၭ တရံၭ,ၦဖလံၡၫဖိၪအကျၩနီၪဧၪ. တၭစစၫ့စၧၫ့စံၭအ ဖါ,မၩန့အဝ့ၫလၧယဂးဘီၪ. အဂဲးဘဲၫယီၩမွဲအဘၪ",
			"4": "<sup>4</sup> ယၥၭဂ့ၩမၬလီၫ.- မွဲလါနၫ့ ဆၧလမံၩ့လၧအအၪ့ဎၬ အလးထၫ့ဒၩၦဖလံၡၫဖိၪနီၪ, ဂဲၫလၧယဟိဝၩအ အီၪတၭ,အမိအဖါၥ့ၪယၫဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩအ",
			"5": "<sup>5</sup> ထီထီးနီၪၦဖလံၡၫဖိၪပၧၩ့အံၫစရ့လၭလီၫ.- စစၫ့စၧၫ့ ဒဲအမိအဖါလ့ၩလၧထံၫမနၭတၭ, လ့ၩထီၩ့လၧထံၫမ နၭအစဘံၭမုအလးလဖၪတၭ, ယိခွါ,ဆၬလၥၧၫ့အ",
			"6": "<sup>6</sup> ၥၭဘၪ့လဒုၩယုၩ့ထၪ့ဆၧထၫ့ဒၩအဝ့ၫလီၫ.- ယဟိ ဝၩအၥၭအီၪထၪ့လၧအလီၩ့ဆီၪ့ဆီၪ့လ့ၬတၭ, စစၫ့ စၧၫ့ထုၭၡၫ့ဝ့ၫ, ဘဲၫအမိထုၭၡၫ့ဘၪ ဘ့ၪဖိၪအၥိၭနီၪ လီၫ.ဆၧအီၪလၧအစူၪဖၧၩ့နးမံၩ့အ့ၬ. တၭဆၧလၧ",
			"7": "<sup>7</sup> အမၩဝ့ၫနီၪလီၩဘၪအမိအဖါအ့ၬ.- အဝ့ၫဒၪလ့ၩလၩ့ ချဲၩ့ဒုၪ့ၦမုၪနီၪတၭ, အဝ့ၫဒၪဘၪစစၫ့စၧၫ့အၥၭဂ့ၩဘၪ စဲၪလီၫ.",
			"8": "<sup>8</sup> မုနံၩလဖၪအလးခဲၫ့နီၪ အဝ့ၫထဲၩ့ထဲၩ့ ဘဲၫၥိၭအမိ မၩန့ၦမုၪတၭ, ကၠၪခွံၬအၥၭလၧဖၧၩ့ၥၭ ဘဲၫၥိၭအမိ ယိဆၬလၥၧၫ့အစွၪလီၫ. တၭယိခွါ, န့ၫလဒိၩ့ဒဲန့ၫစၩ့",
			"9": "<sup>9</sup> အီၪဝ့ၫလၧဆၬလၥၧၫ့အစွၪဖၧၩ့လီၫ.- မၩန့ဝ့ၫလၧအ စူၪဖၧၩ့လ့ၩဝ့ၫလခီၫအၪ့ဝ့ၫလခီၫ, ထီၩ့လၧအမိအဖါ အအီၪဖ့ၪလၫ့အဝ့ၫၥံၪတၭ,အဝ့ၫၥံၪအၪ့ဝ့ၫလီၫ. မွဲလါ နၫ့လၧအမၩန့န့ၫစၩ့ လၧဆၬလၥၧၫ့အစွၪဖၧၩ့နီၪ လီၩ ဘၪအဝ့ၫၥံၪအ့ၬ.",
			"10": "<sup>10</sup> အဖါလ့ၩလၧၦမုၪနီၪအအီၪတၭ, စစၫ့စၧၫ့မၩတ လၭမူၭအမူၭလီၫ. အဂဲးဘဲၫယီၩ ၦဖိၪၥၪခွၫလဖၪမၩ",
			"11": "<sup>11</sup> ယုၩယါဘဲၫနီၪလီၫ.- တၭထီးၦဒၪဘၪအဝ့ၫတၭ, ဆၧ မၩအၥၭလၧအၥ့ၫၥံၪဂဲၫကိၭန့ အထံၩအၥိၭၥၧၫ့ဆံၫ",
			"12": "<sup>12</sup> ဘဲၫၥိၭအမိအီၪဝ့ၫ လၧအဝ့ၫဒၪအၥိၭလီၫ.- တၭစစၫ့ စၧၫ့စံၭဝ့ၫ, ယမိၡီၩ့ၡါဆၧလၧနၥံၪလီၫ. ဆၧမၩမူၭနွ့ၫ နံၩအထးဖၧၩ့ယီၩနၥံၪအ့ၪဖၭန့ယၧၩ ဒဲဒၪန့အဝ့ၫတၭ, ယမိဖ့ၪလၫ့နၥံၪ လၧဆၧကီၩ့ဆၧၥိၭ အဘံၪ့ၥၧၫ့ဆံၫ,",
			"13": "<sup>13</sup> လၧဆၧအၪ့လဲၩအဂးအဘျၩ့ၥၧၫ့ဆံၫလီၫ.- အ့ၪမွဲနၥံၪ ဖၭအ့ၪယၧၩအ့ၪလၥ့ၪဘၪတၭ, နၥံၪမိဘၪဖ့ၪလၫ့ယၧၩ လၧဆၧကီၩ့ဆၧၥိၭအဘံၪ့ၥၧၫ့ဆံၫ, လၧဆၧအၪ့လဲၩ အလးအဘျၩ့ၥၧၫ့ဆံၫလီၫ. တၭအဝ့ၫၥံၪစံၭအဝ့ၫဒၪ ဘဲၫၥိၭပမိနါဂၧၫ့ဘၪဝ့ၫတၭ, ၡီၩ့ၡါဆၧလၧနမိၡီၩ့ၡါ နီၪဘီၪ.",
			"14": "<sup>14</sup> တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, လၧဆၧအၪ့ဂၭဂီၩ့ဆၧအဖၧၩ့နီၪ ဆၧအၪ့ဂဲၫထၪ့,ဒဲလၧ ဆၧဆီၪ့အဖၧၩ့နီၪဆၧအဆၧၫ့ဂဲၫထၪ့ဝ့ၫလီၫ. တၭၥၧၫ့",
			"15": "<sup>15</sup> နံၩအထးဖၧၩ့ အဝ့ၫၥံၪဖၭဆၧၡီၩ့ၡါနီၪၥ့ၪအ့ၬ.- တၭ မုနွ့ၫနံၩလနံၩနီၪ ဆၧမၩအၥၭလၧအဝ့ၫၥံၪနီၪ စံၭစစၫ့ စၧၫ့အမၫ, အၪ့လွ့ၫကဒံၩ လွ့ၫကဒၩနဝၩ ဘဲၫၥိၭအမိ ဖၭန့ပၧၩလၧဆၧၡီၩ့ၡါဆံၭ. အ့ၪလမွဲဘၪပမိဆူၭထၪ့ ခွံၬဘၪခိၬနၧၩဒဲနဖါအဂံၪ့လၧမ့ၪလီၫ. နၥံၪကိၭန့ပၧၩ",
			"16": "<sup>16</sup> ဘဲၫၥိၭနၥံၪမိမၩန့ပဆၧဆ့ဧၪ, မွဲဘဲၫနီၪအ့ၬဧၪ.- စစၫ့ စၧၫ့အမၫအမ့ၬထံၫလၩ့ လၧအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, မွဲန့ၫနၥၭဂဲၫ့ယၧၩလီၫ. နအဲၪယၧၩအ့ၬ. နၡီၩ့ၡါဆၧ လၧယၡၩလဆၨၩဒၪယဝ့ၫတၭ, နဖၭန့ယၧၩအ့ၬ. တၭ အဝ့ၫဒၪစံၭအဝ့ၫ,ယိခွါ, ယဖၭအ့ၪယမိယဖါအ့ၬတၭ,",
			"17": "<sup>17</sup> ယမိဖၭန့နၧၩဆ့ဧၪ.- နွ့ၫနံၩလၧအမူၭအီၪအထးဖၧၩ့ နီၪ,အမ့ၬထံၫလၩ့လၧအမ့ၬယၫတၭ, မုနွ့ၫနံၩလနံၩ နီၪဆၧမၩအၥၭလၧအဝ့ၫဒၪဖၭန့အဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫနီၪပဂၨၪထၪ့ဆီၪ့ဝ့ၫတၭ, ၦမုၪနီၪဖၭဆၧၡီၩ့",
			"18": "<sup>18</sup> ၡါလၧအၡၩ လဆၨၩဒၪဝ့ၫလီၫ.- မုနွ့ၫနံၩလနံၩနီၪ လၧမုလချႃၭလၩ့နုၬဒံၭဘၪတၭ, ဒိၩ့အၦၡၩ စံၭအ ဝ့ၫဒၪ, ဆၧလၧအဆၧၫ့နဲၪ့န့ၫစၩ့, မွဲဆၧနီၪလမံၩ့လဲၪ. တၭဆၧလၧအဆီၪ့နဲၪ့ဆၬလၥၧၫ့လဒုၩ, မွဲဆၧနီၪလ မံၩ့လဲၪ. တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, နၥံၪအ့ၪလထဲၫဘၪ ဆၧလၧယချီမိလဒုၩတၭ, နၥံၪဒၪ န့ယဆၧၡီၩ့ၡါအ့ၬ.",
			"19": "<sup>19</sup> ယဟိဝၩအၥၭလၩ့ဘၪလၧအလီၩ့တၭ, အဝ့ၫလ့ၩ လၩ့ဝ့ၫလၧအၭစလၧၫ့တၭ, မၩၥံၫၦၥၧၫ့ဆံၫ လၧအ ကျၩတၭ,မၩန့အဆၧဖိၪဆၧလံၩတၭ, ဖ့ၪလၫ့ဆၧကီၩ့ ဆၧၥိၭလၧအအၪ့လဲၩအၥၭအဂးလဖၪ လၧၦလၧအ ဖၭဆၧၡီၩ့ၡါနီၪလီၫ. မွဲအၥၭထၪ့တၭ လ့ၩထၪ့ဝ့ၫ လၧအဖါအဂံၪ့ဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> အ့ၪမွဲစစၫ့စၧၫ့အမၫနီၪဆၧဖ့ၪလၫ့ဝ့ၫလၧ ၦလၧအ မွဲအဝ့ၫနီၪအၥိၭလဂၩနီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> တၭမုနံၩလဖၪအလးခဲၫ့ ဆၧကူၭဘုၪကၠိၩ့အမုနံၩ လဖၪအဘိၩ့ဘၭနီၪ, ဆၧမၩအၥၭ လၧစစၫ့စၧၫ့လ့ၩ အီၪၡီၩ့အမၫအီၪလၧဘ့ၪဖိၪလဒုၩတၭ, စံၭဝ့ၫဒၪ, ယမိ လ့ၩနုၬလၧယမၫအအီၪလၧဒူၭဖၧၩ့လီၫ. အ့ၪမွဲၦမုၪ",
			"2": "<sup>2</sup> အဖါနီၪဖ့ၪလ့ၩနုၬဝ့ၫအ့ၬ.- တၭအဖါစံၭဝ့ၫဒၪ, ယစံၭ လၧနၥၭဂဲၫ့ဝ့ၫတၡါတၭ, ယဖ့ၪလၫ့ခွံၬလၧနထံၩနၥိၭ လဂၩနီၪလီၫ. အဖုမုၪဂ့ၩနဲၪ့အဝ့ၫနီၪမွဲအ့ၬဧၪ. မၩန့ လါအဝ့ၫလၧအလးဘီၪ.",
			"3": "<sup>3</sup> တၭစစၫ့စၧၫ့စံၭလၧအဂဲးအကၠီၪ့ ယအ့ၪမၩၦဖလံ ၡၫဖိၪလၧဆၧအၧၩ့လါနၫ့တၭ, ယဆၧဒဲၩဘၭအီၪန့ၫ",
			"4": "<sup>4</sup> ဎီၩ့လၧအဝ့ၫၥံၪဆ့အ့ၬ.- စစၫ့စၧၫ့လ့ၩဆၧတၭ, ဖီၪ့န့ ထွံၪဂၪ့ခိၪၥၧၫ့ယၩတၭ မၩန့မ့ၪၡီၫလဖၪတၭ, ကၠၪထဲၩ့ အမ့လခီၫမ့တၭ, အီၪက့ၪမ့ၪၡီၫလဘီၩ့လၧမ့နံၫဘီၩ့အ",
			"5": "<sup>5</sup> ဘိၩ့ဆၧၩ့လီၫ.- ထီးအဆူၭထၪ့မ့ၪၡီၫလဖၪလၧမ့ၪတၭ, ဖျါလၩ့ခွံၬဝ့ၫ ဘဲၫၥိၭအမိလ့ၩလၧၦဖလံၡၫဖိၪအဘုၪ ဆၧၫ့ထုၪ့အကျၩတၭ, မ့ၪအၪ့ခွံၬဘုၪထူလဖၪ, ဒဲဘုၪ လၧအဆၧၫ့ထုၪ့ဝ့ၫ, ဒဲစဘံၭမုအလးလဖၪ, ဒဲအလဲအိၫ့",
			"6": "<sup>6</sup> အလးလဖၪနီၪလီၫ.- ထီးနီၪလဖၧၫ့ၦဖလံၡၫဖိၪစံၭဝ့ၫ ဒၪ,မွဲပလၫမၩဆၧယီၩလဂၩလဲၪ, တၭၦလီၩဆၧၫ့ဝ့ၫ, ၦထံၫမနၭဖိၪအမၬစစၫ့စၧၫ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫ ဒၪမၩန့အမၫတၭ, ဖ့ၪလၫ့ခွံၬဝ့ၫ လၧအထံၩအၥိၭလ ဂၩနီၪလီၫ. တၭၦဖလံၫၡၫဖိၪဂဲၫထၪ့တၭ, ဆူၭထၪ့ခွံၬ ၦမုၪနီၪဒဲအဖါလၧမ့ၪလီၫ.",
			"7": "<sup>7</sup> စစၫ့စၧၫ့စံၭအဝ့ၫၥံၪ, နၥံၪမၩဆၧဘဲၫယီၩအၥိၭလါ နၫ့တၭ, ယမိမၩဆၧၫ့ဆၧအၧၩ့လၧနၥံၪတၭ, လၧခဲၫ့",
			"8": "<sup>8</sup> ထဲၩ့နီၪယမိပထုၬလီၫ.- တၭအဝ့ၫဒိၪၥံၫအဝ့ၫၥံၪလၧ ကံၪဒူၪဒဲလၧကံၪပၪလၧဆၧၥံၫဒိၪဖၭဒိၪလီၫ. တၭလ့ၩ လၩ့အီၪဝ့ၫလၧလဲၫ့အံတၫ့အလီၩ့လီၫ.",
			"9": "<sup>9</sup> ထီးနီၪလဖၧၫ့ၦဖလံၡၫဖိၪလ့ၩထၪ့ဆၧတၭ, ၥုၪ့အ တဲၩလၧယုဒၫအဖၧၩ့တၭ, အီၪပၩလၩ့အၥၭ လၧလံ",
			"10": "<sup>10</sup> ဟဲၫအဖၧၩ့လီၫ.- တၭယုဒၫအၦၡၩစံၭဝ့ၫဒၪ, မွဲနၥံၪ ဂဲၫထၪ့ထၫ့ဒၩပၧၩဘၪလဲၪ. တၭအဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫ, ပဂဲၫထၪ့ဘဲၫၥိၭပမိစၧၩ့ထၬစစၫ့စၧၫ့ ဘဲၫၥိၭပမိမၩအဝ့ၫ ဘဲၫအမၩပၧၩအၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့ ၦယုဒၫအၦၡၩၥၧၫ့ထီၫ့ လ့ၩထၪ့ လၧလဲၫ့အံတၫ့အဒၩ့ခိၪတၭ, စံၭစစၫ့စၧၫ့, ၦဖလံၡၫဖိၪ ၥံၪမွဲၦပၧၩ့ပၧၩနီၪ,မွဲနလၥ့ၪယၫဘၪဧၪ. ဆၧလၧနမၩ ပၧၩယီၩမွဲဆၧနီၪလမံၩ့လဲၪ. တၭအဝ့ၫဒၪစံၭအဝ့ၫ ၥံၪ,ဘဲၫအဝ့ၫၥံၪမၩယၧၩအၥိၭနီၪ, ယမၩယူၭအဝ့ၫၥံၪ",
			"12": "<sup>12</sup> ဘဲၫနီၪအၥိၭဆ့ယူၭ.- အဝ့ၫၥံၪနီၪစံၭအဝ့ၫ, ပဂဲၫဘဲၫ ၥိၭပမိစၧၩ့ထၬနၧၩ, လၧပမိဖ့ၪလၫ့နၧၩ လၧၦဖလံၡၫ ဖိၪအစူၪဖၧၩ့အဂဲးလီၫ. တၭစစၫ့စၧၫ့ စံၭအဝ့ၫၥံၪ, ဆိၪလၩ့နၥံၪအၥၭလၧယၧၩ လၧနၥံၪလဖ့ၬခွံၬဘၪ",
			"13": "<sup>13</sup> ယၧၩ,နၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫနီၪဘီၪ.- အဝ့ၫၥံၪချဲၩ့ ဆၧလၧအဝ့ၫတၭ, စံၭဝ့ၫဒၪ,မွဲအ့ၬ. အ့ၪမွဲပမိစၧၩ့ထၬ နၧၩတၭ, ဖ့ၪလၫ့ခွံၬနၧၩလၧ အဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ. တၭပဝ့ၫဒၪယီၩ ပမၩၥံၫနၧၩလၩလါအ့ၬ. အဝ့ၫၥံၪစၧၩ့ ထၬအဝ့ၫလၧဖျံၩၥၫ့နံၫဘီၩ့တၭ, ဂဲၫထဲၩ့ဆိၬန့ခွံၬဝ့ၫ လၧလဲၫ့ခိၪနီၪလီၫ.",
			"14": "<sup>14</sup> ထီးအထီၩ့လၧလံဟဲၫတၭ, ၦဖလံၡၫဖိၪကိၭၡၭထၪ့ ထၫ့ဒၩအဝ့ၫတၭး ယဟိဝၩအၥၭလၩ့ဘၪလၧအလီၩ့ ဆီၪ့ဆီၪ့လ့ၬတၭ, ဖျံၩလဖၪလၧအအီၪ လၧအစူၪဒူၪ လီၩ့နီၪကဲၪထၪ့ဝ့ၫ ဘဲၫဘွ့ၪဘျံၭ လၧမ့ၪအၪ့ခွံၬဝ့ၫအ",
			"15": "<sup>15</sup> ၥိၭနီၪတၭ,ဆၧစၧၩ့ထၬအစူၪလၩ့ကွဲၪခွံၬဝ့ၫလီၫ.- တၭ ဒၪန့ဝ့ၫလၧကၥ့ၪယီၩ့ အခၫလၬဎွံၪ အၥံၫ့ဆ့ၬလဘီၩ့ တၭ,ယူၬစိၩအစူၪမၩန့ဝ့ၫတၭ, ဒိၪၥံၫၦလထီၫ့လၧအ",
			"16": "<sup>16</sup> ဝ့ၫနီၪလီၫ.- တၭစစၫ့စၧၫ့စံၭဝ့ၫဒၪ, လၧကၥ့ၪယီၩ့အခၫလၬဎွံၪနီၪ, လၧအပိၩ့လဖၪအဖၫ့ ခိၪၥံၪအပိၩ့နီၪ, လၧကၥ့ၪယီၩ့အခၫလၬဎွံၪအကၠီၩ့နီၪ ယဒိၪၥံၫယူၭၦ လထီၫ့ယူၭ.",
			"17": "<sup>17</sup> ထီးအချဲၩ့ဆၧဂီၩ့လူၬတၭ, ဆၧမၩအၥၭလၧအခွံၬ ၡိၭခွံၬဆၧအခၫလၬဎွံၪ လၧအစူၪဖၧၩ့တၭ, ဆၧအလး လစီၪ့နီၪကိၭဝ့ၫရၫမၭလံဟဲၫလီၫ.",
			"18": "<sup>18</sup> ဆၧၥၭဝံအၥၭလၧထံၫဒိၪမၬတၭး ကိၭထၪ့ယဟိဝၩ တၭ,စံၭဝ့ၫဒၪ, နဖ့ၪလၫ့ယူၭ ဆၧဖီၩ့ဖျ့ၭဖၭဒိၪလမံၩ့ ယီၩလၧနခ့ၫနၡၩအစူၪဖၧၩ့ယူၭတၭ, ဘိၩ့နဲၪ့ယီၩမွဲယ မိၥံၫလၧဆၧၥၭဝံယၥၭလၧထံၫအကၠီၩ့တၭ, လၩ့ဘၪ",
			"19": "<sup>19</sup> လၧၦလဒိၭဘၪဆၧကူၭတရံၭအစူၪဖၧၩ့ဆ့ဧၪ.- တၭ ယွၩမၩထ့ဖၭဆၧအိၩဖၧၩ့ လၧလံဟဲၫအဖၧၩ့တၭ,ထံၫ ဂဲၫထၪ့လၧအဖၧၩ့နီၪ, အဝ့ၫဒၪအီၩဝ့ၫတၭ, အၥၭဂဲၫ ထဲၩ့ထဲၩ့တၭ, အၥၭခၧၫ့ထၪ့ဝ့ၫလီၫ. မၩအၥၭဘဲၫနီၪ တၭး ကိၭဝ့ၫအမံၩ့, အံၫ့ဟၭကရံၫလၧအအီၪဝ့ၫလၧ လံဟဲၫအဖၧၩ့ခီးမုဆၫလနံၩယီၩလီၫ.",
			"20": "<sup>20</sup> တၭလၧၦဖလံၡၫဖိၪအမုနံၩ လဖၪနီၪအဝ့ၫဒၪစ့ၩရၫ့ အံၫစရ့လၭအနံၪ့နံၫဆံၫလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> စစၫ့စၧၫ့လ့ၩဝ့ၫထီၩ့လၧဂၫဇၫတၭ, ဒၪဘၪၦမဲၩဎွဲၩ",
			"2": "<sup>2</sup> မုၪလဂၩထီးနီၪတၭ, လ့ၩနုၬဝ့ၫလၧအအီၪလီၫ.- တၭ ဆၧလီၩဘၪၦဂၫဇၫဖိၪ, စံၭဝ့ၫဒၪ,စစၫ့စၧၫ့ဂဲၫထီၩ့ယူၭ ထီးယီၩလီၫ. တၭအဝ့ၫၥံၪနီၪအီၪဝၬဖီၩ့ဝ့ၫတၭ, ခိၭ ၥူၪဆၧလၧအဂးၥၫ့နၩချီၩ့ ထီးဒိၩ့အတရၫ့ထံၭ, အီၪ လၩ့မါပံၭၥၫ့နၩချီၩ့တၭ, စံၭဝ့ၫဒၪ, လၧဂီၩလခီၫထီး",
			"3": "<sup>3</sup> ဆၧဖၩ့ထၪ့နီၪ, ပမိမၩၥံၫအဝ့ၫလီၫ.- စစၫ့စၧၫ့မံၫဝ့ၫထီး ဖိၭဖၫ့မုတၭ, လၧဖိၭဖၫ့မုနီၪဂဲထုၪ့တၭ, မၩန့ဒိၩ့အတ ရၫ့,ဒဲတရၫ့အထုၪ့နံၫထုၪ့တၭ, လ့ၩဆိၬခွံၬဝ့ၫ, ဒဲနိၪ ဘီၩ့,ဒဲဆၧထီးအလူၬတၭအီၪက့ၪဝ့ၫလၧအခိၬထံၭခိၪ တၭ,ဆိၬထၪ့ဝ့ၫ လၧခိၪလီၩ့ခိၪ လၧအအီၪလၧဟံ ဘြၧၫ့အမ့ၬယၫလီၫ.",
			"4": "<sup>4</sup> တၭဆၧနီၪလဖၪအလးခဲၫ့ ဆၧမၩအၥၭလၧအအဲၪ ၦမုၪလဂၩလၧခိၪလီၩ့ဆူၭစိရ့ၭတၭ, အမံၩ့မွဲနးဒ့ၫလဲ",
			"5": "<sup>5</sup> လၫ.- တၭၦဖလံၡၫဖိၪအၦဒိၪဖၭဒိၪလဖၪ ဂဲၫလၧအ အီၪတၭ,စံၭအဝ့ၫ, အၪ့လွ့ၫကဒံၩအၪ့လွ့ၫကဒၩအဝ့ၫ တၭ,အဂဲးဆီၪ့အဘၭဆီၪ့နီၪ, မွဲအအီၪလၧဆၧနီၪလ မံၩ့လဲၪနီၪတၭ, ဘဲၫၥိၭပမိစၧၩ့ထၬဝ့ၫ, ဒဲမၩနၭမၩၡၪ့ ဝ့ၫတၭ,ပမိမၩစၪဝ့ၫလၧဆၧနီၪလမံၩ့လဲၪနီၪ, အၪ့စၪ့ ဘီၪ,ပမိဖ့ၪလၫ့နၧၩ လၧစ့ၩလဂၩ အဘံၪ့လထီၫ့လ ယၩ,လဂၩအဘံၪ့လထီၫ့လယၩ ကိၭအဂၩဒ့ၭလီၫ.",
			"6": "<sup>6</sup> တၭနးဒ့ၫလဲလၫ စံၭစစၫ့စၧၫ့ နဂဲးဆီၪ့အီၪလၧဆၧ နီၪလမံၩ့လဲၪ, တၭၦမိစၧၩ့ထၬနၧၩ ဘဲၫၥိၭအမိမၩနၭ မၩၡၪ့နၧၩလၧဆၧနီၪလမံၩ့လဲၪနီၪ, ဒုၭနဲၪလါယၧၩ",
			"7": "<sup>7</sup> ဘီၪ.- တၭစစၫ့စၧၫ့စံၭဝ့ၫ, ၦအ့ၪစၧၩ့ထၬယၧၩလၧဖျံၩ ၥီၪအၥံၫ့ဆ့ၬ လၧအလဎဲၫ့ဒံၭဘၪနွ့ၫဘီၩ့တၭ, ယဂဲး ယဘၭမိလၩ့ဆါတၭ, ယမိမၩယၥၭ ဘဲၫၦၡၩဂူၫဂၩ",
			"8": "<sup>8</sup> လဂၩအၥိၭနီၪလီၫ.- တၭၦဖလံၡၫဖိၪ အၦဒိၪဖၭဒိၪ ဂဲၫဆိၬန့ဝ့ၫ လၧဖျံၩၥီၪအၥံၫ့ဆ့ၬ လၧအလဎဲၫ့ဒံၭဘၪ နွ့ၫဘီၩ့တၭ, အဝ့ၫဒၪစၧၩ့ထၬ စစၫ့စၧၫ့ လၧအဝ့ၫၥံၪ",
			"9": "<sup>9</sup> လီၫ.- တၭၦခိၭၥူၪဆၧလၧအဂးနီၪ ဆၧၫ့နၩ့ဝ့ၫလၧ ဒူၭဖၧၩ့လီၫ. တၭၦမုၪနီၪစံၭအဝ့ၫ, ၦဖလံၡၫဖိၪဂဲၫဖီၪ့ နၧၩ,စစၫ့စၧၫ့ဧ့, တၭအဝ့ၫဒၪထုၭထ့ၬခွံၬဖျံၩၥီၪနီၪ, ဘဲၫလူၪၥီၪကဘၩ့ လၧအဘၪမ့ၪအၥိၭနီၪလီၫ. အခိး မွဲၦၥ့ၪယၫဝ့ၫအဂဲးအဘၭနီၪၥ့ၪအ့ၬ.",
			"10": "<sup>10</sup> တၭနးဒ့ၫလဲလၫစံၭစစၫ့စၧၫ့, ယိခွါ,နမၩကြၩ့ထ မးယၧၩ,ဒဲချဲၩ့ယူၭဆၧကဘျံၭကဘျၪ လၧယၧၩလီၫ. ဘိၩ့နဲၪ့ယီၩဒုၭနဲၪလါယၧၩ လၧဆၧလၧၦမိစၧၩ့ထၬ",
			"11": "<sup>11</sup> ဘၪနၧၩလမံၩ့နီၪဘီၪ.- အဝ့ၫဒၪစံၭဝ့ၫ, ၦအ့ၪစၧၩ့ထၬ ယၧၩလၧဖျံၩဖီၩ့ၥၫ့အၥၭ လၧၦလမၩဒံၭဘၪဆၧလၧ အဝ့ၫတၭ, ယဂဲးယဘၭမိလၩ့ဆါတၭ, ယမိကဲၪထၪ့",
			"12": "<sup>12</sup> ဘဲၫၦၡၩဂူၫဂၩလဂၩအၥိၭနီၪလီၫ.- တၭနးဒ့ၫလဲလၫ မၩန့ဖျံၩဖီၩ့ၥၫ့အၥၭတၭ, စၧၩ့ထၬဝ့ၫတၭ, စံၭအဝ့ၫ ဒၪ,ၦဖလံၡၫဖိၪဂဲၫဖီၪ့နၧၩ, စစၫ့စၧၫ့ဧ့, တၭၦခိၭၥူၪ ဆၧနီၪအီၪဝ့ၫလၧဒူၭဖၧၩ့လီၫ. တၭအဝ့ၫဒၪထုၭထ့ၬ ခွံၬဖျံၩလၧအစူၪလီၩ့ ဘဲၫလူၪလဘီၩ့အၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> တၭနးဒ့ၫလဲလၫစံၭစစၫ့စၧၫ့, ခီးဘိၩ့နဲၪ့ယီၩ နမၩ ကြၩ့ထမးယၧၩတၭ, ချဲၩ့ဆၧအဘျံၭအဘျၪလီၫ. ဒုၭ နဲၪယၧၩလၧဆၧလၧၦမိစၧၩ့ထၬဘၪနၧၩ လမံၩ့နီၪဘီၪ. တၭအဝ့ၫဒၪစံၭ, နအ့ၪၥံၪထဲး ယခိၪၥူၫ အပိၩ့နွ့ၫပိၩ့",
			"14": "<sup>14</sup> လၧထၪဖၧၩ့တၭမွဲဆၧနီၪလီၫ.- နးဒ့ၫလဲလၫနီၪဖျၩနုၬ ထၬနိၪဖျၭတၭ, စံၭအဝ့ၫ, ၦဖလံၡၫဖိၪဂဲၫဖီၪ့နၧၩ,စစၫ့ စၧၫ့ဧ့,တၭအဝ့ၫဒၪ နၪ့ထၪ့ထဲၩ့အၥၭတၭ စဲၪ့ထၪ့ခွံၬ ဝ့ၫအီၪလၧနိၪဘီၩ့အနိၪဖျၭ, ဒဲထၪနီၪလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪစံၭဝ့ၫ, နၥၭလအီၪဘၪလၧယၧၩတၭ,နစံၭ နအဲၪယၧၩဘဲၫၥ့ၪလဲၪး နမၩကြၩ့ထမးယၧၩၥၧၫ့ဘျၩ့ ယူၭ,နဂဲးဆီၪ့နဘၭဆီၪ့နီၪ, မွဲအအီၪလၧဆၧနီၪလမံၩ့",
			"16": "<sup>16</sup> လဲၪနီၪ,နဒုၭနဲၪယၧၩအ့ၬ.- တၭဆၧမၩအၥၭထီးအ မၩဆီၪ့ဆီၪ့ဝ့ၫလၧအဆၧချဲၩ့လဖၪၥံၫ့ၥံၫ့နံၩနီၪ, ဒဲထိၪ",
			"17": "<sup>17</sup> ဂဲၩဝ့ၫဒဲမၩခိအၥၭဘူၭလၧအမိၥံၫတၭ,- ဆၧမၩအၥၭ လၧအဝ့ၫဒၪ လီၩဘၪဝ့ၫ လၧအၥၭထၧၫ့ဖျိၪ့ယၫတၭ, စံၭအဝ့ၫ, ယလိၩ့ယခိၪလၧဒီၩနးဆိၭအ့ၬ. အဂဲးဘဲၫ ယီၩယမွဲၦနၭစရ့ၭဖိၪ လၧယွၩအဂး လၧယမိအဒၧၩ့ လးလံၩလံၩလီၫ. ၦအ့ၪလိၩ့ယခိၪတၭ ယဂဲးယဘၭ မိစဲၪ့ထၪ့ခွံၬလၧယအီၪတၭ, ယမိလၩ့ဆါဒဲမိမၩယၥၭ ဘဲၫၦၡၩလဂၩလါလါအၥိၭနီၪလီၫ.",
			"18": "<sup>18</sup> ထီးနးဒ့ၫလဲလၫဒၪဘၪ လၧအလီၩဘၪဝ့ၫအၥၭထၧၫ့ ဖျိၪ့ယၫတၭ, အၪ့မၧၫ့လၩ့ဆၧကိၭန့ၦဖလံၡၫဖိၪအၦ ဒိၪဖၭဒိၪတၭ, စံၭဝ့ၫဒၪ, ဂဲၫထၪ့လဘျၩ့ယီၩဘီၪ. အ ဂဲးဘဲၫယီၩအဝ့ၫဒၪဒုၭနဲၪယူၭယၧၩ လၧအၥၭထၧၫ့ဖျိၪ့ ယၫယူၭ. တၭၦဖလံၡၫဖိၪ အၦဒိၪဖၭဒိၪ ဂဲၫထၪ့လၧ",
			"19": "<sup>19</sup> အအီၪတၭ, ဂဲၫဆိၬစ့ၩလၧအစူၪဖၧၩ့လီၫ.- တၭၦမုၪ ဒုၭမံၫဝ့ၫလၧအခၪ့လုးခိၪတၭ, ကိၭန့ၦလဂၩတၭအၪ့ မၧၫ့အလိၩ့ခွံၬအခိၪၥူၫ အပိၩ့နွ့ၫပိၩ့တၭး ၦမုၪနီၪမၩ နၭမၩၡၪ့ၥၫ့ဝ့ၫတၭ, အဂဲးအဘၭ စဲၪ့ထၪ့ခွံၬလၧအ",
			"20": "<sup>20</sup> ဝ့ၫလီၫ.- တၭစံၭဝ့ၫဒၪ, ၦဖလံၡၫဖိၪဂဲၫဖီၪ့နၧၩ, စစၫ့ စၧၫ့ဧ့,တၭအဝ့ၫဒၪနၪ့ထၪ့အၥၭတၭ စံၭဝ့ၫဒၪ,ယမိစဲၪ့ ထၪ့ဘဲၫဆၧလဘျၩ့လဘျၩ့အၥိၭနီၪ တရူၩယၥၭလီၫ. တၭလၥ့ၪယၫဘၪဝ့ၫလၧ ယဟိဝၩစဲၪ့ထၪ့ခွံၬယူၭလၧ",
			"21": "<sup>21</sup> အလီၩ့ယူၭလီၫ.- တၭၦဖလံၡၫဖိၪမၩန့ဝ့ၫတၭ, အီၩ့ ခွ့ၭထၪ့ခွံၬအမ့ၬၥၪတၭ, ဂဲၫဆိၬဝ့ၫလၧဂၫဇၫအဖၧၩ့ တၭ,စၧၩ့ထၬဝ့ၫလၧၥွ့ၫထီးဝီၩတၭ, အဝ့ၫဒၪဂူၬဆုၪ့ ဂူၬလၧထီၫ့ဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> တၭလၧၦလိၩ့ခွံၬအခိၪၥူၫအလးခဲၫ့နီၪ အခိၪၥူၫထၪ့ ဒီၭအၥၫ့လီၫ.",
			"23": "<sup>23</sup> တၭၦဖလံၡၫဖိၪ အၦဒိၪဖၭဒိၪလဖၪ အီၪကိၩ့အီၪ ကီၪ့ဘဲၫၥိၭအမိလုထၪ့ဆၧလုဖၭဒိၪ လၧအယွၩဒၫဂၫ့ တၭ,ၥုၪ့ထိၬၥၭထိၬလီၫ. အဂဲးဘဲၫယီၩ စံၭဝ့ၫဒၪ, ပ ယွၩဖ့ၪလၫ့ယူၭပဒုၪပဒၩ စစၫ့စၧၫ့လၧပစူၪဖၧၩ့ယူၭ.",
			"24": "<sup>24</sup> ၦခမျၧးဒၪဘၪဝ့ၫတၭ စံၭထၪ့အၪ့အူၭအဝ့ၫၥံၪအယွၩ လီၫ.အဂဲးဘဲၫယီၩ စံၭဝ့ၫဒၪ, ပယွၩဖ့ၪလၫ့ခွံၬယူၭပ ဒုၪပဒၩ,ဒဲၦလၧအမၩဂၭဂီၩ့ပထံၫပခး, လၧအမၩၥံၫ",
			"25": "<sup>25</sup> ၦအၪဂၩလၧပကျၩလၧအစူၪဖၧၩ့ယူၭ.- ထီးအဝ့ၫၥံၪ အၥၭမုၬထၪ့တၭ, ဆၧမၩအၥၭလၧအစံၭဝ့ၫ, ကိၭန့ စစၫ့စၧၫ့ဘဲၫၥိၭအမိလိၬကွ့ၩ လၧပဂးနီၪဘီၪ. အဝ့ၫ ၥံၪကိၭန့စစၫ့စၧၫ့ လၧအအီၪဝ့ၫ လၧထီၫ့ဖၧၩ့တၭ,အ ဝ့ၫလိၬကွ့ၩလၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, အဝ့ၫၥံၪအီၪ",
			"26": "<sup>26</sup> က့ၪအဝ့ၫလၧၥရိၬထုၪ့အဆူၭနီၪလီၫ.- တၭစစၫ့စၧၫ့ စံၭဖိၪၥၪခွၫလဂၩ လၧအဖီၪ့အစူၪနီၪ, ဒုၭဖီၪ့ယၧၩလၧ ၥရိၬထုၪ့ဖၭဒိၪလဖၪ, ဘဲၫၥိၭယမိဒိၭနဲၩ့ယၥၭလၧအ",
			"27": "<sup>27</sup> ဝ့ၫၥံၪနီၪဘီၪ.- တၭၥရိၬနီၪဎွ့ၩဝ့ၫလၧၦမုၪၦခွၫၦဖလံ ၡၫဖိၪအၦဒိၪဖၭဒိၪထီးအလူၬ အီၪဝ့ၫထီးနီၪတၭ,လၧ ၥရိၬခိၪနီၪ ၦမုၪဒဲၦခွၫအီၪဝ့ၫဖိၭဘိၭၥၧၫ့ထီၫ့, လၧအ",
			"28": "<sup>28</sup> ယိဖၧၩ့စစၫ့စၧၫ့ကွ့ၩဆၧလီၫ.- စစၫ့စၧၫ့ကိၭထၪ့ယဟိ ဝၩတၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩယွၩဧ့, နၪ့ထၪ့ထဲၩ့လါ ယၧၩတၭ, ဒုၭဆီၪ့ထၪ့ယၧၩန့ၫအယီၩလဖၧၫ့, ယွၩဧ့, ဘဲၫၥိၭယမိမၩဆၧၫ့ ၦဖလံၡၫဖိၪ လၧယမ့ၬၥၪနံၫဖျိၪ့",
			"29": "<sup>29</sup> အကၠီၩ့နီၪဆံၭ.- စစၫ့စၧၫ့ဖီၪ့ထၬထုၪ့နံၫထုၪ့လၧဆၧ ၥၭကျၩၥရိၬအထုၪ့ လၧအဒိၭနဲၩ့အၥၭလၧအဝ့ၫ,လ ထုၪ့လၧစူၪထွ့ၪ, လထုၪ့လၧစူၪစ့ၪလီၫ.",
			"30": "<sup>30</sup> တၭစစၫ့စၧၫ့စံၭဝ့ၫဒၪ, မွဲယၥံၫလၧၦဖလံၡၫဖိၪအၥိၭ ဘီၪ. တၭၡီၫ့ကူၭလၩ့အၥၭလၧအဂဲးအဘၭတၭ, ၥရိၬ နီၪလၩ့ဎီးဝ့ၫ လၧၦဒိၪဖၭဒိၪအဖၫ့ခိၪ, ဒဲလၧကယဲၦ ခမျၧးလၧအအီၪလၧအဖၧၩ့အဖၫ့ခိၪလီၫ. အခိးမွဲလၧ အၥံၫနီၪ မၩၥံၫဘၪၦအၪနဲၪ့ လၧအမၩၥံၫဘၪဝ့ၫလၧ အမၧၫ့ဒံၭအဘိၩ့ဘၭနီၪဒံၭလီၫ.",
			"31": "<sup>31</sup> ထီးနီၪလဖၧၫ့အထၧၫ့ဖုဝဲ, ဒဲအၡၩဂံၪ့ဖိၪထီးအလူၬ နီၪလ့ၩလၩ့တၭ, မၩန့ဝ့ၫဒဲဂဲၫထဲၩ့ဆိၬဝ့ၫတၭ, ခုၪ့လၩ့ ဘၧၩ့ခွံၬအဝ့ၫလၧဇိရၫ, ဒဲအ့ၭၡတအီလၭ အဘိၩ့ ဆၧၩ့,လၧအဖါစမနိအၫအၥွၪခိၪအဖၧၩ့လီၫ. တၭအ ဝ့ၫစ့ၩရၫ့ယူၭအံၫစရ့လၭ အနံၪ့နံၫဆံၫယူၭလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ၦအီၪလၧခိၪလီၩ့အံဖြံၫ့လဂၩတၭ, အမံၩ့မွဲစမဲကၫ",
			"2": "<sup>2</sup> လီၫ.- တၭအဝ့ၫစံၭအမိ,စ့ၩလထီၫ့လယၩလၧဆၧမၩ န့ခွံၬလၧနအီၪ, လၧနဆိၪအၧၩ့ ဆၧလၧအကၠီၩ့တၭ, ချဲၩ့ဆၧလၧယနါဖၧၩ့လၧအဂဲးအကၠီၪ့နီၪ, ယိခွါ,စ့ၩ နီၪအီၪလၧယစူၪဖၧၩ့လီၫ. ယမၩန့ယဝ့ၫလီၫ. တၭအ မိစံၭဝ့ၫဒၪ, မွဲနဘၪဆိၪဂ့ၩလၧယဟိဝၩဆံၭ, ယဖိၪခွၫ",
			"3": "<sup>3</sup> ဧ့,- ထီးအဝ့ၫဒၪဖ့ၪထဲၩ့စ့ၩလထီၫ့လယၩလၧအမိ နီၪ,အမိစံၭဝ့ၫဒၪ, စ့ၩနီၪအီၪလၧယစူၪဖၧၩ့တၭ, ယအီၪ က့ၪဆံၫ့ဎံၪတၡါ လၧယဟိဝၩအမ့ၬယၫလၧယဖိၪခွၫ အဂး,ဘဲၫၥိၭအမိတဲၩ့ဆၧဂၩ့စိၭဖျၩအၥၭ, ဒဲဆၧဂၩ့ ၥိၫ့အၥၭလီၫ. တၭဘိၩ့နဲၪ့ယီၩ ယမိဖ့ၪထဲၩ့ဝ့ၫလၧနၧၩ",
			"4": "<sup>4</sup> လီၫ.- မွဲလါနၫ့အဝ့ၫနီၪဖ့ၪထဲၩ့စ့ၩလၧအမိတၭ, အမိမၩ န့စ့ၩနံၫယၩတၭ, ဖ့ၪလၫ့ၦၥိၫ့ဆၧဖိၪတၭ, အဝ့ၫဒၪတဲၩ့ ဆၧဂၩ့စိၭဖျၩအၥၭ, ဒဲဆၧဂၩ့ၥိၫ့အၥၭလၧအဝ့ၫတၭ,",
			"5": "<sup>5</sup> ဆၧလဖၪနီၪအီၪဝ့ၫ လၧစမဲကၫအဂံၪ့ဖၧၩ့လီၫ.- ၦၡၩ စမဲကၫလဂၩနီၪ အီၪလၧအယွၩလဖၪ အဂံၪ့လဖျိၪ့ တၭ,တဲၩ့န့အ့ဖိၭ, ဒဲဆၧဂၩ့တ့ရဖံၫ့တၭ, အီၪက့ၪဆံၫ့ ဎံၪအဖိၪခွၫလဂၩတၭ, အဝ့ၫဒၪကဲၪထၪ့အၡၩလုဆၧ",
			"6": "<sup>6</sup> လီၫ.- ဆၧလၧမုနံၩလဖၪအဖၧၩ့နီၪ စဎွၩအီၪလၧအံၫ စရ့လၭအဖၧၩ့အ့ၬ. တၭၦကိၭဂၩဒ့ၭမၩဆၧဘဲၫအ ဘၪဒၪအၥၭအၥိၭလီၫ.",
			"7": "<sup>7</sup> လၧၦယုဒၫအဒီၪ့အကျၩ လၧဘ့ၭၥလံၫဟံၫ့ယုဒၫ အဖၧၩ့, ဖိၪၥၪခွၫအီၪဝ့ၫလဂၩတၭ, အဝ့ၫနီၪမွဲၦလံဝဲၫ",
			"8": "<sup>8</sup> ဖိၪလီၫ.- တၭၦလဂၩနီၪစဲၪ့ထၪ့ခွံၬလၧဒိၩ့ဖၧၩ့လၧဘ့ၭ ၥလံၫဟံၫ့ယုဒၫအဖၧၩ့ ဘဲၫၥိၭအမိအီၪ ထီးအဒၪန့အ လးလီၫ. တၭလၧအလ့ၩဆၧနီၪဂဲၫထီၩ့ဝ့ၫလၧခိၪလီၩ့",
			"9": "<sup>9</sup> အံဖြံၫ့လၧစမဲကၫ အဂံၪ့ဖၧၩ့လီၫ.- တၭစမဲကၫစံၭအ ဝ့ၫ,နဂဲၫအထံၭခီၫခီၫလဲၪး တၭအဝ့ၫဒၪစံၭအဝ့ၫ, ယမွဲ ၦလံဝဲၫဖိၪ လၧဘ့ၭၥလံၫဟံၫ့ လၧယုဒၫတၭ, ယမိလ့ၩ",
			"10": "<sup>10</sup> အီၪထီးယမိဒၪန့အလးလီၫ.- စမဲကၫစံၭအဝ့ၫ, အီၪ လၧယၥိၭတၭ, ကဲၪထၪ့ယဖါဒဲယၡၩ လုဆၧဆံၭ. တၭယမိဖ့ၪလၫ့နၧၩလနံၪ့လနံၪ့ လၧစ့ၩဆံၫဘံၪ့,ဒဲဆၧ ကီၩ့ဆၧၥိၭလၧအကြၨၭအဘၪ, ဒဲနဆၧအၪ့ဆၧအီၩ",
			"11": "<sup>11</sup> လီၫ.တၭၦလံဝဲၫဖိၪ လ့ၩနုၬဝ့ၫလီၫ.- တၭၦလံဝဲၫဖိၪ အီၪလၧၦလဂၩနီၪအၥိၭ မုၬအၥၭလီၫ. တၭဖိၪၥၪခွၫ",
			"12": "<sup>12</sup> နီၪအီၪလၧအဝ့ၫဘဲၫအဖိၪခွၫဒၪဝ့ၫအၥိၭနီၪလီၫ.- တၭ စမဲကၫအီၪက့ၪဆံၫ့ဎံၪၦလံဝဲၫဖိၪတၭ, ဖိၪၥၪခွၫနီၪ ကဲၪထၪ့အၡၩလုဆၧတၭ, အီၪဝ့ၫလၧစမဲကၫ အဂံၪ့",
			"13": "<sup>13</sup> ဖၧၩ့လီၫ.- တၭစမဲကၫစံၭဝ့ၫဒၪ, ဘိၩ့နဲၪ့ယီၩယၥ့ၪယၫ လၧယဟိဝၩမိမၩဂ့ၩယၧၩလီၫ. အဂဲးဘဲၫယီၩယအီၪ လၧၦလံဝဲၫဖိၪလဂၩ လၧယၡၩလုဆၧအဂးလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ဆၧလၧမုနံၩလဖၪနီၪ စဎွၩအီၪလၧအံၫစရ့လၭအ ဖၧၩ့အ့ၬ. တၭဆၧလၧမုနံၩလဖၪနီၪ ၦဒၫ့ဖိၪလဒီၪ့အၪ့ ဎၬဝ့ၫအဆၧန့ၥၫ လၧအမိအီၪဝ့ၫလၧအဖၧၩ့လီၫ. အ ဂဲးဘဲၫယီၩ ထီၩ့လၩ့လၧမုလနံၩနီၪဆၧန့ၥၫလၩ့ဘၪ လၧအဂးလၧအံၫစရ့လၭအဆၨၩလဖၪအကျၩအ့ၬ.",
			"2": "<sup>2</sup> တၭၦဒၫ့ဖိၪအၪ့မၧၫ့လၩ့ၦယဲဂၩ လၧအဂံၪ့ဒီၪ့ဖိၪအ ကျၩနီၪလၧအခးနဲၩ့, ၦၥုၭဖိၪလၧဇိရၫ, ဒဲလၧအ့ၭၡတ အီလၭ,ဘဲၫၥိၭအမိယိဆၧလၧ ထံၫၥံၪခးၥံၪအဖၧၩ့,ဒဲ အၪ့ဎၬယိဝ့ၫတၭး အဝ့ၫၥံၪစံၭဝ့ၫ, လ့ၩအၪ့ဎၬယိထံၫ ၥံၪခးၥံၪဆံၭ. တၭၦလဖၪနီၪ လ့ၩထီၩ့လၧခိၪလီၩ့အံ ဖြံၫ့လၧစမဲကၫအဂံၪ့ဖၧၩ့တၭ, အီၪဝ့ၫၥၫ့နၩချီၩ့ထီးနီၪ",
			"3": "<sup>3</sup> လီၫ.- အဝ့ၫၥံၪနီၪအီၪဝ့ၫလၧစမဲကၫအဂံၪ့နဲၩ့တၭ, ၥ့ၪ ယၫၦဖိၪၥၪခွၫ, ၦလံဝဲၫဖိၪအလူတၭ, ကၠၪနုၬထီးနီၪ တၭ,စံၭဝ့ၫ, မွဲပလၫဒုၭဂဲၫနၧၩ ထီးယီၩလဂၩလဲၪ.",
			"4": "<sup>4</sup> တၭနဆၧအီၪထီးယီၩ, မွဲဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫလ ဂၩနီၪစံၭအဝ့ၫၥံၪ, စမဲကၫမၩယၧၩဘဲၫအံၩ ဘဲၫအိၩ တၭ,အၪ့လံၩ့န့ယၧၩတၭ, ယကဲၪထၪ့အၡၩလုဆၧ",
			"5": "<sup>5</sup> လီၫ.- တၭအဝ့ၫၥံၪနီၪစံၭအဝ့ၫ, ဘဲၫၥိၭပမိၥ့ၪယၫပ ဖၧၩ့ၥၭလၧပလ့ၩဆၧမိဘီၪထၪ့ယီၫထၪ့ ဆ့ဧၪနီၪ,ပ",
			"6": "<sup>6</sup> အၪ့ကံၩ့နၧၩ, အၪ့စၪ့လါလၧယွၩဆံၭ.- တၭၦလုဆၧ နီၪစံၭအဝ့ၫၥံၪလ့ၩဆၧမုၬမုၬဆံၭ, ဖၧၩ့ၥၭလၧနၥံၪဖိၬ",
			"7": "<sup>7</sup> ဝ့ၫလဘီၩ့နီၪအီၪဝ့ၫလၧ ယဟိဝၩအမ့ၬယၫလီၫ.ၦယဲ ဂၩနီၪစဲၪ့ထၪ့ဝ့ၫတၭ, လ့ၩနုၬလၧလၫအံၭတၭ,ဒၪဘၪ ၦခမျၧးလၧအဖၧၩ့ လထီးလၩ့ဘၪအၥၭ အီၪဝ့ၫလၩ့ မါပံၭဒဲအီၪက့ၪဂုးအၥၭ ဘဲၫၦဇဲဒၧၫ့ဖိၪအထူၫအရူၫအ ၥိၭနီၪအီၪမုၬဒိၭနဲၩ့အၥၭတၭ, ၦန့ဘၪၥၫဆၧစ့ၩရၫ့ခွး လၧအမိအီၪက့ၪမ့ၬမဲဆၧလမံၩ့မံၩ့နီၪအီၪအ့ၬ. အဝ့ၫ ၥံၪအီၪယဲၩ့ လၧၦစဲဒၧၫ့ဖိၪနီၪတၭ, အဆၧမၩဘၪဆဲၫ့",
			"8": "<sup>8</sup> လၧၦၡၩအီၪနးမံၩ့အ့ၬ.- ၦလဖၪနီၪထဲၩ့ထဲၩ့ လၧအ ထၧၫ့ဖုဝဲအအီၪလၧဇိရၫအဖၧၩ့ ဒဲလၧအ့ၭၡတအီလၭ အဖၧၩ့တၭ, ထၧၫ့ဖုဝဲစံၭဝ့ၫဆၧမၩအၥၭဘဲၫၥ့ၪလဲၪ.",
			"9": "<sup>9</sup> အဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ဂဲထုၪ့ဘီၪ,ပမိလ့ၩထၪ့ဒၪဘၪအဝ့ၫ ၥံၪလီၫ. အဂဲးဘဲၫယီၩပဒၪဘၪယူၭအထံၫအခးယူၭ. တၭယိခွါ,မွဲအဂ့ၩဝ့ၫဒိၪမၬလီၫ. တၭနၥံၪအီၪလၩ့မါ ပံၭဆ့ဧၪ. အီၪက့ၪကၠႃၪ့နၥံၪအၥၭ လၧနၥံၪမိလ့ၩနုၬ",
			"10": "<sup>10</sup> မၩန့ခးနီၪလဂ့ၩ.- ထီးနၥံၪလ့ၩဆၧတၭ, နၥံၪမိလ့ၩနုၬ လၧၦခမျၧးအကျၩလၧ အဒိၭနဲၩ့အၥၭ, လၧခးဖၭလဲ လဘံၪ့အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယွၩဖ့ၪလၫ့ဝ့ၫလၧ နၥံၪအစူၪဖၧၩ့ယူၭ, ဆၧအလးထီးၦန့ဘၪဒံၭဆၧလ မံၩ့မံၩ့လၧဂၪ့ခိၪချိၫ့ယီၩ အလးအီၪအ့ၬ.",
			"11": "<sup>11</sup> တၭၦစဲၪ့ထၪ့ခွံၬထီးနီၪ လၧၦဒၫ့ဖိၪအဂံၪ့ဒီၪ့အကျၩ လၧဇိရၫဒဲအ့ၭၡတအီလၭအဖၧၩ့နီၪ, ၦၡၩလၧအအီၪ",
			"12": "<sup>12</sup> တဲၩ့ဝဲၩအၥၭလၧၥုၭဖိၪအစူၪနီၪ, ၦဎူၫယၩလီၫ.- အ ဝ့ၫၥံၪလ့ၩထၪ့ဝ့ၫတၭၥုၪ့အတဲၩ လၧကၧယၭယ့အရံၫ့",
			"13": "<sup>13</sup> လၧယုဒၫအဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭကိၭဝ့ၫအ မံၩ့လၧမဟၫနံၫဒၫ့ ထီးမုဆၫလနံၩယီၩလီၫ. ယိခွါ, အီၪဝ့ၫလၧကၧယၭယ့အရံၫ့ အချိၫ့လီၫ. အဝ့ၫၥံၪစဲၪ့ ထၪ့ခွံၬထီးနီၪ ဖိးလၧခိၪလီၩ့အံဖြံၫ့တၭ, ဂဲၫထီၩ့လၧ",
			"14": "<sup>14</sup> စမဲကၫအဂံၪ့လီၫ.- ထီးနီၪလဖၧၫ့ၦလၧအလ့ၩယိၥူၪ ခးလၫအံၭယဲဂၩနီၪချဲၩ့ဆၧတၭ, စံၭအထၧၫ့ဖုဝဲလဖၪ, အ့ဖိၭဒဲဆၧဂၩ့တ့ၫရဖံၫ့, ဒဲဆၧဂၩ့စိၭဖျၩအၥၭ, ဒဲဆၧ ဂၩ့ၥိၫ့အၥၭနီၪအီၪဝ့ၫလၧဂံၪ့လဖၪယီၩ အဖၧၩ့နီၪ,မွဲ နၥံၪၥ့ၪယၫဆ့ဧၪ. တၭဘိၩ့နဲၪ့ယီၩ ဆၧလၧနၥံၪမိမၩ",
			"15": "<sup>15</sup> ဘၪနီၪဆီၫ့မီၪ့ကၩ့ကၩနၥံၪဝ့ၫဆံၭ.- အဝ့ၫၥံၪကၠၪအ ၥၭလၧနီၪတၭ, ဂဲၫဝ့ၫလၧၦလံဝဲၫဖိၪၦဖိၪၥၪခွၫအဂံၪ့,",
			"16": "<sup>16</sup> ထီးစမဲကၫအဂံၪ့ဒၪလ့ၬတၭ, ချဲၩ့ဒုၪ့ဝ့ၫလီၫ.- တၭၦအီၪ တဲၩ့ဝဲၩအၥၭလၧၥုၭဖိၪအစူၪဝဲၩ, ၦဎူၫယၩလၧၦဒၫ့ ဖိၪအကျၩနီၪဆၧၫ့ထုၪ့ဝ့ၫထီးဆၧလ့ၩနုၬ လၧတရၫ့နီၪ",
			"17": "<sup>17</sup> လီၫ.- တၭၦလၧအလ့ၩယိၥူၪ ထံၫၥံၪခးၥံၪယဲဂၩနီၪ လ့ၩနုၬထၪ့ထီးနီၪတၭမၩန့ဝ့ၫ လၧဆၧဂၩ့စိၭဖျၩအ ၥၭ,ဒဲအ့ဖိၭ, ဒဲဆၧဂၩ့တ့ၫရဖံၫ့, ဒဲဆၧဂၩ့ၥိၫ့အၥၭလီၫ. တၭၦလုဆၧနီၪဆၧၫ့ထုၪ့လၧဆၧလ့ၩနုၬ လၧတရၫ့ အီၪလၧၦဎူၫယၩအီၪတဲၩ့ဝဲၩအၥၭ လၧၥုၭဖိၪအစူၪဝဲၩ",
			"18": "<sup>18</sup> လီၫ.- တၭၦလဖၪနီၪလ့ၩနုၬ လၧစမဲကၫ အဂံၪ့ဖၧၩ့ တၭ,ဂဲၫထဲၩ့ဆိၬဆၧဂၩ့စိၭဖျၩအၥၭ, အ့ဖိၭ,ဒဲဆၧဂၩ့ တ့ၫရဖံၫ့,ဒဲဆၧဂၩ့ၥိၫ့အၥၭလီၫ. တၭၦလုဆၧလဂၩ",
			"19": "<sup>19</sup> နီၪစံၭဝ့ၫ,နၥံၪမၩဆၧနီၪလဲၪ.- တၭအဝ့ၫၥံၪစံၭအဝ့ၫ, အီၪလၩ့မါပံၭဆံၭ, အီၪက့ၪနစူၪလၧနနိၭလီၩ့တၭ, လ့ၩလၧပၥိၭ, ကဲၪထၪ့ပဖါ, ဒဲၦလုဆၧ လၧပဂးနီၪ ဆံၭ.နကဲၪၦလုဆၧလၧ ၦလဂၩအဂးမွဲအဂ့ၩလဆံၭ ဧၪ,နကဲၪထၪ့ၦလုဆၧလၧ ၦလဒီၪ့ထၧၫ့ဒီၪ့ယၫလၧအံၫ",
			"20": "<sup>20</sup> စရ့လၭအဂးနီၪမိဂ့ၩလဆံၭဧၪ.- ၦလုဆၧလဂၩနီၪအ ၥၭမုၬထၪ့ထဲၩ့တၭ, မၩန့အ့ဖိၭ, ဒဲဆၧဂၩ့တ့ၫရဖံၫ့, ဒဲဆၧဂၩ့စိၭဖျၩအၥၭတၭ, လ့ၩဆၧလၧၦခမျၧးအကျၩ",
			"21": "<sup>21</sup> လီၫ.- အခိးမွဲအဝ့ၫၥံၪနီၪကၠၪစိၩအၥၭတၭ, စဲၪ့ထၪ့ဝ့ၫ တၭအီၪက့ၪဖိၪဒံၩဖိၪၥၪ, ဒဲဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲဆၧ",
			"22": "<sup>22</sup> ဖိၪဆၧလံၩလၧအမ့ၬယၫလီၫ.- တၭအဝ့ၫၥံၪထီၩ့ဝ့ၫ ယဲၩ့လၧစမဲကၫအဂံၪ့နီၪ, ၦၡၩအီၪဝ့ၫလၧဂံၪ့လဖၪဘူၭ လၧစမဲကၫအဂံၪ့နီၪ အီၪကိၩ့အီၪကီၪ့တၭ, လ့ၩချႃၭန့",
			"23": "<sup>23</sup> ၦဒၫ့ဖိၪလီၫ.- အဝ့ၫၥံၪကိၭထၪ့ဝ့ၫလၧၦဒၫ့ဖိၪတၭ, ၦ လဖၪကၠၪထဲၩ့အမ့ၬတၭ, စံၭစမဲကၫ,နဂဲၫလၧၦၡၩၥံၪ",
			"24": "<sup>24</sup> ဎွ့ၩနီၪ,မွဲအဂဲးအီၪလၧဆၧနီၪလမံၩ့လဲၪ.- တၭအဝ့ၫ ဒၪစံၭဝ့ၫ, နၥံၪဆိၬခွံၬယယွၩလဖၪလၧယတဲၩ့ဝ့ၫ, ဒဲၦ လုဆၧတၭ, နၥံၪစဲၪ့ထၪ့ခွံၬနီၪ, ဆၧအီၪဒံၭလၧယၧၩမွဲ ဆၧနီၪလမံၩ့လဲၪး တၭနၥံၪစံၭယၧၩ, မွဲအဘၪဆၧနီၪ",
			"25": "<sup>25</sup> လမံၩ့လဲၪနီၪ,မွဲဘၪလဲၪ.- တၭၦဒၫ့ဖိၪစံၭအဝ့ၫ, ဒုၭနါ ဂၧၫ့နလူလၧပကျၩလဂ့ၩ, ၦအၥၭထၪ့လဖၪမိစဲၪ့ၡိၫ ဘၪခိၬနအီၪတၭ, လၧနၥၭမၧၫ့ဒဲနၡၩဂံၪ့ဖိၪၥံၪအၥၭ",
			"26": "<sup>26</sup> မၧၫ့မိလၩ့မါလီၫ.- ၦဒၫ့ဖိၪလ့ၩဆၧနီၪ, ထီးစမဲကၫဒၪ ဘၪဝ့ၫလၧအဝ့ၫၥံၪဆီၪ့နဲၪ့အနၫ့ဆါဒၪဝ့ၫဒံၭတၭ, ကၠၪ ထဲၩ့အၥၭတၭထဲၩ့ထဲၩ့ဝ့ၫလၧအဂံၪ့လီၫ.",
			"27": "<sup>27</sup> အဝ့ၫၥံၪမၩန့ဆၧလၧစမဲကၫတဲၩ့ယူၭဝ့ၫ, ဒဲအၡၩ လုဆၧတၭ, လ့ၩဝ့ၫထီၩ့လၧလၫအံၭ, လၧၦခမျၧးလၧ အအီၪမုၬ, ဒဲလထီးလၩ့ဘၪအၥၭလဖၪနီၪအအီၪဖ့ၬ",
			"28": "<sup>28</sup> ခွံၬဝ့ၫလၧနၭအနါ ဒဲဆူၭထၪ့ခွံၬဒိၩ့နီၪလၧမ့ၪလီၫ.- တၭ ၦမၩဖီၩ့မၩဖျ့ၭဆၧအီၪနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩအီၪ ယဲၩ့ဝ့ၫလၧဇဲဒၧၫ့တၭ, အဝ့ၫၥံၪအဆၧမၩဘၪဆဲၫ့လၧ ၦၡၩၥံၪအီၪနးမံၩ့အ့ၬ. အီၪဝ့ၫလၧခိၪလီၩ့ဆူၭဘ့ၭ ၥရ့ဟီၭအနဲၩ့ထံၭလီၫ.",
			"29": "<sup>29</sup> ၦလဖၪနီၪမၩကဲၪထၪ့ဒိၩ့လဖျိၪ့တၭ, အီၪဝ့ၫလၧအ ဖၧၩ့လီၫ. တၭကိၭဝ့ၫအမံၩ့လၧဒၫ့ဘဲၫအဖါစဒၫ့အမံၩ့ အၥိၭလၧအံၫစရ့လၭ ထၪ့ဖိၪဝ့ၫလီၫ. မွဲလါနၫ့လၧ",
			"30": "<sup>30</sup> အခၪ့ထံၭနီၪဒိၩ့အမံၩ့မွဲလၫအံၭလီၫ.- ၦဒၫ့ဖိၪအီၪက့ၪ ဆၧၫ့ထုၪ့ဆၧဂၩ့စိၭဖျၩအၥၭတၭ, စမနၭစ့ၫအဖိၪခွၫ, စဂၧၡၧၫ့အဖိၪခွၫစစၪ့နၥၫ့, အဝ့ၫဒၪဒဲအဖိၪခွၫလဖၪ မွဲၦလုဆၧလဖၪလၧဒၫ့လဒီၪ့အဂး ထီၩ့လၩ့လၧထံၫၥံၪ ခးၥံၪဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫလီၫ.",
			"31": "<sup>31</sup> တၭကယဲမုနံၩမုနၩလၧယွၩအဂံၪ့ အီၪဝ့ၫလၧၡဲလိၫ အဖၧၩ့အဘိၩ့ဘၭနီၪ, အဝ့ၫၥံၪအီၪက့ၪထၪ့စမဲကၫအ ဆၧဂၩ့လၧအတဲၩ့ဝ့ၫစိၭဖျၩအၥၭလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ထီးစဎွၩလအီၪဘၪ လၧအံၫစရ့လၭအကျၩတၭ, ဆၧမၩအၥၭလၧမုနံၩလဖၪနီၪ, ၦလံဝဲၫဖိၪအီၪဝ့ၫလၧ ခိၪလီၩ့အံဖြံၫ့အနဲၩ့ထံၭလဂၩ လၧအမၩန့အၥံၪမၫ",
			"2": "<sup>2</sup> လၧဘ့ၫၥလံၫဟံၫ့ယုဒၫအဖၧၩ့လီၫ.- အၥံၪမၫနီၪအဲၪ ဘိၩ့ဝ့ၫ,စဲၪ့ဒၪဝ့ၫလ့ၩထီၩ့လၧအဖါအဂံၪ့ဖၧၩ့လၧဘ့ၭ ၥလံၫဟံၫ့ယုဒၫအဖၧၩ့တၭ, အီၪဝ့ၫထီးနီၪဎွ့ၩထၪ့လၩ လံဘံၪ့နီၪလီၫ.",
			"3": "<sup>3</sup> အဝၩနီၪဂဲထုၪ့လ့ၩဆီးဝ့ၫ ဘဲၫအမိချဲၩ့မုၬအၥၭဒဲ လၧအမိဂဲၫထဲၩ့န့ဝ့ၫအဂးတၭ, အဎီးအၡၩလဂၩ,ဒဲက ၥ့ၪယီၩ့နံၫဒုၩအီၪလၧအၥိၭတၭ, ၦမုၪနီၪဒုၭဂဲၫနုၬအဝ့ၫ လၧအဖါအဂံၪ့ဖၧၩ့နီၪး ထီးၦမုၪအဖါဒၪဘၪဝ့ၫတၭ,",
			"4": "<sup>4</sup> လၧအဒၪဝ့ၫအကၠီၩ့ၥၭထိၬဝ့ၫလီၫ.- အမံၩ့ၡါခွၫၦမုၪ နီၪအဖါထိးဆၧၫ့အဝ့ၫတၭ, အဝ့ၫဒၪအီၪလၧအၥိၭ ၥၧၫ့နံၩတၭ, အၪ့ဆၧဒဲအီၩဆၧတၭ, မံၫဝ့ၫထီးနီၪလီၫ.",
			"5": "<sup>5</sup> ဆၧမၩအၥၭလၧလံနံၩလနံၩနီၪ လၧဆၧဖၩ့ထၪ့ဂီၩဂီၩ တၭ,အဝ့ၫဒၪဂဲထုၪ့ဘဲၫၥိၭ အမိလ့ၩဆၧတၭ,ၦမုၪနီၪ အဖါစံၭအမၬ, မၩခၧၫ့ထၪ့နၥၭလၧကိၪနးလီၪ့ဂီၩ့တၭ,",
			"6": "<sup>6</sup> ထဲၩ့ထဲၩ့ဆံၭ.- အဝ့ၫၥံၪဆၧၫ့နၩ့ဝ့ၫတၭ, အၪ့ဆၧဒဲ အီၩဆၧနံၫဂၩလူၬတၭ, ၦမုၪအဖါစံၭၦၡၩနီၪ, မံၫ့ၥုၪ့ မံၫ့ၥၭတၭ,အီၪၥၫ့နၩချီၩ့တၭ, မၩမုၬလၩနၥၭဘီၪ.",
			"7": "<sup>7</sup> ထီးၦၡၩနီၪဂဲထုၪ့ဘဲၫၥိၭ အမိလ့ၩဆၧတၭ, အမံၩ့ၡါ",
			"8": "<sup>8</sup> ခွၫနီၪယၭဝ့ၫတၭ, အဝ့ၫဒၪမံၫဒီၭဝ့ၫထီးနီၪလီၫ.- ယဲနံၩ လနံၩနီၪဂဲထုၪ့လၧဆၧဖၩ့ထၪ့ဂီၩဂီၩ ဘဲၫၥိၭအမိလ့ၩ ဆၧတၭ, ၦမုၪနီၪအဖါစံၭဝ့ၫဒၪ မၩမုၬလါနၥၭဘီၪ. အဝ့ၫၥံၪအီၪဝ့ၫထီးမုဎဲးလၩ့တၭ, အၪ့ဆၧနံၫဂၩလူၬ",
			"9": "<sup>9</sup> လီၫ.- တၭထီးၦၡၩနီၪဂဲထုၪ့ဘဲၫၥိၭ အမိလ့ၩဆၧ,အ ဝ့ၫဒၪဒဲအၥံၪမၫ, ဒဲအဎီးအၡၩလဂၩတၭ, အမံၩ့ၡါခွၫ, ၦမုၪအဖါစံၭဝ့ၫဒၪ, ယိခွါ,မုမိဂၪလၩ့ဖီၩ, အီၪလါထီး ယီၩၥၫ့နၩချီၩ့ဘီၪ,ယိခွါ, မုဘၪယူၭ,မံၫဒၪခလူၬထီး ယီၩဘဲၫၥိၭနၥၭမိမုၬလၩဝ့ၫတၭ, ကဲဂီၩခိၬနီၪလ့ၩဆၧ",
			"10": "<sup>10</sup> ဂီၩဂီၩ,ဘဲၫၥိၭနမိလ့ၩထီၩ့နတဲၩဖၧၩ့နီၪဘီၪ.- ၦၡၩ နီၪအီၪဝ့ၫဒဲမံၫၥၫ့နၩချီၩ့နီၪ အၥၭအီၪအ့ၬ, ဂဲထုၪ့တၭ, စဲၪ့ထၪ့ခွံၬနီၪလ့ၩထီၩ့ဆဲၫဎၩ့လၧယံဘၧၭ (အဝ့ၫနီၪ မွဲယရုစလံၫ့) တၭအီၪဝ့ၫလၧကၥ့ၪယီၩ့နံၫဒုၩ, အီၪလၧ အပီၩ့တၭ, အၥံၪမၫအီၪလၧအၥိၭဆ့လီၫ.",
			"11": "<sup>11</sup> ထီးအဝ့ၫၥံၪထီၩ့ဆဲၫဎၩ့ လၧယံဘၧၭနီၪမုဘၪယူၭ တၭအဎီးအၡၩစံၭအကဆါ, ဂဲၫဘီၪ,ပမိလ့ၩနုၬလၧ ၦယံဘၧၭဖိၪအဒိၩ့လဒိၩ့အဖၧၩ့တၭ, အီၪထီးနီၪၥၫ့",
			"12": "<sup>12</sup> နၩချီၩ့လီၫ.- တၭအကဆါစံၭအဝ့ၫ, ပကၠၪထဲၩ့ပၥၭ လၧၦလခီၫဘၩ့မုးဖိၪအဒိၩ့ လၧအလဘၪဆဲၫ့ဘၪလၧ အံၫစရ့လၭဖိၪနီၪအ့ၬ, ပမိခၫ့ဂၬစိၩလၧဂံၭဘအၫလီၫ.",
			"13": "<sup>13</sup> တၭစံၭအဎီးအၡၩ, ဂဲၫဘီၪ,ပမိၥုၭဘူၭပၥၭလၧအလး လစီၪ့စီၪ့ယီၩ,လၧဂံၭဘအၫမွဲဂ့ၩ, လၧရၫမၫမွဲဂ့ၩ,ဘဲၫ",
			"14": "<sup>14</sup> ၥိၭပမိအီၪထီးနီၪၥၫ့နၩချီၩ့လီၫ.- အဝ့ၫၥံၪလ့ၩဝ့ၫဒၪ တၭ,လ့ၩဆၧအဘိၩ့ဘၭနီၪ မုလၩ့နုၬန့ဝ့ၫလၧဂံၭဘ",
			"15": "<sup>15</sup> အၫအနဲၩ့, လၧအဘၪဆဲၫ့လၧဘံၪ့ယမံၫ့လီၫ.- တၭ အဝ့ၫၥံၪကၠၪစိၩဝ့ၫလၧနီၪ ဘဲၫၥိၭအမိလ့ၩနုၬအီၪၥၫ့ နၩချီၩ့လၧဂံၭဘအၫအဖၧၩ့လီၫ. လ့ၩနုၬတၭဆၧၫ့နၩ့ ဝ့ၫလၧဒိၩ့အဖၧၩ့ၥၭတၭ, ၦထိးဆၧၫ့ဝ့ၫလၧဂံၪ့ဖၧၩ့ ဘဲၫၥိၭအမိအီၪၥၫ့နၩချီၩ့နီၪ အီၪနးဂၩအ့ၬ.",
			"16": "<sup>16</sup> တၭယိခွါ, လၧမုဂၪလၩ့နီၪ, ၦၥၭၡါလဂၩဂဲၫထဲၩ့ ထဲၩ့လၧအဆၧမၩအလးလၧ ဆံၬၥံၪနၩၥံၪအဖၧၩ့လီၫ. တၭမွဲၦခိၪလီၩ့အံဖြံၫ့ဖိၪတၭ, အီၪဝ့ၫလၧဂံၭဘအၫ လီၫ.အ့ၪမွဲၦၡၩလၧဆၧအလးထီးနီၪ မွဲၦဘံၪ့ယမံၫ့",
			"17": "<sup>17</sup> ဖိၪလီၫ.- ထီးအကျဲၪ့ထၪ့အမ့ၬနီၪ, ဒၪဘၪၦလ့ၩဆၧ လၧဒိၩ့အဖၧၩ့ၥၭလဂၩတၭ, ၦၥၭၡါလဂၩနီၪစံၭဝ့ၫ ဒၪ,နမိလ့ၩခီၫခီၫလဲၪတၭ, နဂဲၫအထံၭခီၫခီၫလဲၪ.",
			"18": "<sup>18</sup> တၭအဝ့ၫဒၪစံၭအဝ့ၫ, ပဂဲၫထၪ့လၧဘ့ၭၥလံၫဟံၫ့ယု ဒၫနီၪ,ပမိလ့ၩဖိးလၧခိၪလီၩ့အံဖြံၫ့ အပၪနဲၩ့ထံၭလီၫ. ယစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ယလ့ၩထီၩ့ယူၭလၧဘ့ၭၥ လံၫဟံၫ့ယုဒၫနီၪ, အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ယလ့ၩစိၩလၧ ယဟိဝၩအဂံၪ့တၭ, ၦထိးဆၧၫ့ယၧၩ လၧအဂံၪ့ဖၧၩ့",
			"19": "<sup>19</sup> အီၪအ့ၬ.- မွဲလါနၫ့လီခၪ့ၥံၪ, ဒဲဆၧအၪ့လၧကၥ့ၪယီၩ့ အဂးအီၪဝ့ၫ, ဒဲကိၪဒဲစဘံၭထံၫအီၪလၧယဂးဆ့,ဒဲလၧ နဎီးမုၪအဂး, ဒဲလၧဖိၪၥၪခွၫလၧအဖိၬနခ့ၫနၡၩအခဲၫ့",
			"20": "<sup>20</sup> အဂးလီၫ. န့ဘၪဆၧလမံၩ့မံၩ့အလးအီၪအ့ၬ.- တၭ ၦၥၭၡါစံၭဝ့ၫဒၪ, မွဲဆၧအမုၬအီၪလၧနၧၩဘီၪ. မွဲနန့ ဘၪဆၧလၧအလး အီၪထီးအလူၬနီၪ အီၪလၧယလီၩ့ ဘီၪ.မွဲနထီးအီၪၥၫ့နၩချီၩ့ လၧဖၧၩ့ၥၭလၩလါလဂ့ၩ.",
			"21": "<sup>21</sup> မွဲအဒုၭဂဲၫနုၬဝ့ၫလၧအဂံၪ့ဖၧၩ့တၭ, ဖ့ၪလၫ့အကၥ့ၪ ယီၩ့အဆၧအၪ့တၭ, အဝ့ၫၥံၪၥူၫဝၭအခၪ့တၭ,အၪ့ဆၧ ဒဲအီၩဆၧလီၫ.",
			"22": "<sup>22</sup> အဝ့ၫၥံၪနီၪမၩမုၬထၪ့ထဲၩ့အၥၭတၭ, ယိခွါ,ၦၡၩ ဒိၩ့ဖိၪ,ၦၡၩလၧဘ့ၫလအ့လၭဖိၪ အကျၩလဖၪနီၪ,အီၪ ဝၬဖီၩ့ဂံၪ့တၭ,ဒိၪထိၬတရၫ့ဆီၪ့ဆီၪ့လ့ၬတၭ, ချဲၩ့ဆၧ လၧဂံၪ့ကဆါ, ၦၥၭၡါလဂၩနီၪတၭ, စံၭဝ့ၫဒၪ,ဂဲၫဆိၬ ထၪ့ၦၡၩလၧအလ့ၩနုၬလၧနဂံၪ့ဖၧၩ့နီၪ ဘဲၫၥိၭပမိၥ့ၪ",
			"23": "<sup>23</sup> ယၫအဝ့ၫဘီၪ.- ၦဂံၪ့ကဆါလဂၩလ့ၩထၪ့လၧအဝ့ၫၥံၪ အအီၪတၭ,စံၭအဝ့ၫၥံၪ, မွဲအ့ၬ.ထၧၫ့ဖုဝဲၥံၪဧ့, မၩလါ ဆၧအၧၩ့ယီၩလဂ့ၩ, ၦလဂၩယီၩဂဲၫနုၬလၧယဂံၪ့ဖၧၩ့",
			"24": "<sup>24</sup> ယီၩတၭ,မၩဆၧအၧၩ့နၭလမံၩ့နီၪလဂ့ၩ.- ယိခွါ,ယ ဖိၪမုၪအမုၪနၩ့ဒဲၦလဂၩနီၪအၥံၪမၫအီၪဝ့ၫလီၫ. ယမိ ဂဲၫဆိၬထၪ့အဝ့ၫၥံၪတၭ, ဆၪ့လၩ့ဝ့ၫတၭ, မၩဝ့ၫဘဲၫ ဆၧဂ့ၩလၧနၥံၪအမ့ၬယၫဘီၪ. အ့ၪမွဲၦလဂၩယီၩမၩ",
			"25": "<sup>25</sup> အဝ့ၫလၧဆၧအၧၩ့နၭလမံၩ့နီၪလဂ့ၩ.- မွဲလါနၫ့ဘိၩ ၦၡၩလဖၪနီၪခိၭနၪအလူအၥၭအီၪအ့ၬ. တၭၦၡၩလ ဂၩနီၪမၩန့အၥံၪမၫတၭ, ဂဲၫဆိၬထၪ့ဝ့ၫလၧအဝ့ၫၥံၪအ အီၪတၭ,အဝ့ၫၥံၪၥ့ၪယၫဝ့ၫတၭ, မၩအၧၩ့ဝ့ၫၥၫ့နၩချီၩ့ ထီးဆၧဖၩ့ထၪ့တၭ, ထီးမုဆဲၪ့ထၪ့နီၪ ဖျါလၩ့ခွံၬဝ့ၫ",
			"26": "<sup>26</sup> လီၫ.- ထီးမုဆဲၪ့ထၪ့နီၪၦမုၪဂဲၫလၩ့ထံၩဖါဝ့ၫလၧၦၡၩ အဂံၪ့လၧအကဆါအီၪ လၧအဖၧၩ့နီၪ အတရၫ့ထံၭ,",
			"27": "<sup>27</sup> ထီးဆၧဖၩ့ထၪ့လီၫ.- လၧဂီၩလခီၫနီၪအကဆါဂဲထုၪ့ တၭ,ဝဲထၪ့ဂံၪ့အတရၫ့တၭ စဲၪ့ထၪ့ဘဲၫၥိၭအမိလ့ၩဆၧ တၭ,ယိခွါ,အၥံၪမၫၦမုၪနီၪ လၩ့ထံၩဖါယူၭလၧတရၫ့ ထံၭတၭ, အစူၪအီၪဝ့ၫလၧတရၫ့ အခၧၪ့ဖၫ့ခိၪလီၫ.",
			"28": "<sup>28</sup> တၭအဝ့ၫဒၪစံၭဝ့ၫ, ဂဲထုၪ့တၭမွဲပလ့ၩၡီၩ့ဘီၪ, တၭအ ဝ့ၫချဲၩ့ဆၧၫ့ဆၧအ့ၬ. တၭၦၡၩနီၪမၩန့အီၪက့ၪထၪ့ဝ့ၫ လၧကၥ့ၪယီၩ့အခိၪတၭ, ၦၡၩနီၪဂဲထုၪ့တၭ, လ့ၩဝ့ၫ",
			"29": "<sup>29</sup> လၧအလးဒၪဝ့ၫနီၪလီၫ.- ထီးအဂဲၫထဲၩ့ထီၩ့လၧအဂံၪ့ နီၪ,မၩန့ဒီၩလဘံၪ့တၭ, မၩန့အၥံၪမၫနီၪဖ့ၬနၩ့ဖၭဝ့ၫ အီၪလၧအဎွံၪလဖၪ လဆံၫနံၫကုၭတၭ, ဖ့ၪယူဝ့ၫလၧ",
			"30": "<sup>30</sup> အံၫစရ့လၭအခးဎံၩ့ဎံၩ့လ့ၬလီၫ.- တၭကယဲၦလၧအ ဒၪဘၪဝ့ၫလဖၪနီၪ ဆၧမၩအၥၭလၧအစံၭဝ့ၫဒၪ, ဆၧ ဘဲၫယီၩၥိၭအခီၫလၧအံၫစရ့လၭဖိၪ ဂဲၫထၪ့လၧခးအံ ဇံၭအဖၧၩ့နီၪထီၩ့မုဆၫလနံၩယီၩ ၦမၩဝ့ၫမွဲဂ့ၩ, ၦဒၪ ဘၪမွဲဂ့ၩနးဆိၭအ့ၬ. ကၩ့ကၩလၧနၥံၪအၥၭဒၪနၥံၪဝ့ၫ ကိၪ့လိၬနၥံၪအၥၭတၭ, ချဲၩ့ထၪ့ဆၧဆံၭ."
		},
		"20": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭဖိၪစဲၪ့ထၪ့ထီးအလူၬတၭ, ဆၧအီၪ ကီၪ့နီၪအီၪကိၩ့အီၪကီၪ့ဘဲၫၦလဂၩဎးအၥိၭ လၧဒၫ့ဖိး လၧဘံအၧၫၡံၫဘၫ, ဒဲဂံလအၭအၡၩခးဖိၪ လၧယဟိ",
			"2": "<sup>2</sup> ဝၩအအီၪလၧမံဇပၫလီၫ.- ၦခမျၧးအခိၪထီးအလူၬ,ၦ အံၫစရ့လၭၥံၪအဒီၪ့ကိၭအဒီၪ့ဒ့ၭနီၪ အီၪက့ၪလၩ့အၥၭ လၧယွၩအၡၩခမျၧးအဆၧအီၪကီၪ့အကျၩ, ၦအခၪ့",
			"3": "<sup>3</sup> ၥုၭလၧအဆိၬနၭလံကုၬလီၫ.- (တၭၦဘံၪ့ယမံၫ့ဖိၪ နါဂၧၫ့ဝ့ၫ, လၧၦအံၫစရ့လၭဖိၪ လ့ၩယူၭလၧမံဇပၫ လီၫ.)",
			"4": "<sup>4</sup> ၦအံၫစရ့လၭဖိၪစံၭဝ့ၫဒၪ, ဆၧမၩအၧၩ့ယီၩမွဲဘဲၫ ၥ့ၪလဲၪနီၪ,လီၩဘၪလါပၧၩဘီၪ. ၦလံဝဲၫဖိၪၦမုၪလၧ အဘၪဆၧမၩၥံၫဝ့ၫအဝၩနီၪ, ချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫ ဒၪ,ယလ့ၩနုၬလၧဂံၭဘအၫဘၪဆဲၫ့ လၧဘံၪ့ယမံၫ့ နီၪ,ယဝ့ၫဒၪဒဲယၥံၪမၫ, ဘဲၫၥိၭ ယမိအီၪၥၫ့နၩချီၩ့",
			"5": "<sup>5</sup> လီၫ.- ဂံၭဘအၫအၡၩဂဲထုၪ့ထၫ့ဒၩယၧၩတၭ, အီၪဝၬ ဖီၩ့ဂံၪ့ထၫ့ဒၩဝ့ၫလၧမုနၩလခီၫတၭ, အီၪက့ၪအၥၭလၧ အမိမၩၥံၫယၧၩတၭ, ဆၪ့လၩ့ယၥံၪမၫတၭ, ၥံၫယူၭ",
			"6": "<sup>6</sup> ဝ့ၫယူၭ.- ယမၩန့ယၥံၪမၫတၭ, ယဖ့ၬထ့ၬလကုၭလ ကုၭတၭ ဖ့ၪယုဝ့ၫလၧခးအံၫစရ့လၭန့ၥၫဝ့ၫထၧၫ့ဘံၪ့ ယၫလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမၩဆၧမၩမၪမုၪ,ဒဲ",
			"7": "<sup>7</sup> ဆၧလဲးဆၧဘျၪလၧအံၫစရ့လၭအဖၧၩ့လီၫ.- ယိခွါ, နၥံၪမွဲအံၫစရ့လၭဖိၪထီးအလူၬ, ဖ့ၪလၫ့နၥံၪအဆၧ ချဲၩ့,ဒဲဆၧကိၪ့ဘီၪ.",
			"8": "<sup>8</sup> ၦခမျၧးထီးအလူၬ ဂဲထုၪ့ဘဲၫၦလဂၩဎးအၥိၭနီၪ,",
			"9": "<sup>9</sup> စံၭဝ့ၫဒၪ,ပထဲၩ့ထဲၩ့လၧပတဲၩဖၧၩ့နးဂၩအ့ၬ.- ဘိၩ့နဲၪ့ ယီၩပမိမၩဂံၭဘအၫလၧဆၧယီၩ, ဘဲၫၥိၭပမိလ့ၩထၫ့",
			"10": "<sup>10</sup> ဒုၪဒၩဝ့ၫတၭ, ပမိဖၭဆၧလီၫ.- တၭလၧၦလယၩအ ကျၩနီၪပမိမၩန့ဆံၫဂၩ,ဒဲလၧၦလထီၫ့အကျၩနီၪၦလ ယၩ,ဒဲလၧၦလလၬအကျၩနီၪ ၦလထီၫ့လၧအံၫစရ့ လၭအဒီၪ့ကိၭအဒီၪ့ဒ့ၭအကျၩနီၪ, ဘဲၫၥိၭအမိဂဲၫဆိၬ ဆၧအၪ့ဆၧအီၩလၧၦခမျၧးအဂး လၧအမိမၩဆၧ,ထီး အထီၩ့လၧဂံၭဘအၫဘၪဆဲၫ့လၧ ဘံၪ့ယမံၫ့,ဘဲၫကယဲ ဆၧလဲးဆၧဘျၪလၧအမၩဝ့ၫ လၧအံၫစရ့လၭအဖၧၩ့ နီၪလီၫ.",
			"11": "<sup>11</sup> တၭအံၫစရ့လၭအၡၩ အီၪကိၩ့အီၪကီၪ့ ထၫ့ဒၩဒိၩ့ လဒိၩ့နီၪဆၭဘုၭလိၬအၥၭ ဘဲၫၦလဂၩဎးအၥိၭနီၪ",
			"12": "<sup>12</sup> လီၫ.- ၦအံၫစရ့လၭဖိၪအဒီၪ့လဖၪ အၪ့မၧၫ့ၦလ့ၩလၧ ဘံၪ့ယမံၫ့ လဒီၪ့အကျၩထၧၫ့ဒီၪ့ယၫတၭ, စံၭဝ့ၫဒၪ, ဆၧအၧၩ့ယီၩ လၧအမၩအၥၭလၧနၥံၪအကျၩနီၪ, မွဲ",
			"13": "<sup>13</sup> ဆၧနီၪလမံၩ့လဲၪ.- တၭဘိၩ့နဲၪ့ယီၩဖ့ၪလၫ့ခွံၬၦၡၩၦ ဘ့ၫလအ့လၭဖိၪလၧအအီၪ လၧဂံၭဘအၫအဖၧၩ့ဘဲၫ ၥိၭပမိမၩၥံၫဝ့ၫတၭ, အီၪက့ၪခွံၬဆၧအၧၩ့လၧအံၫစရ့ လၭနီၪဘီၪ. မွဲလါနၫ့ၦဘံၪ့ယမံၫ့ဖိၪခိၭနၪအထၧၫ့ဖုဝဲ,",
			"14": "<sup>14</sup> ၦအံၫစရ့လၭဖိၪအလူအ့ၬ.- တၭၦဘံၪ့ယမံၫ့ဖိၪအီၪ ကိၩ့အီၪကီၪ့လၧဒိၩ့လဖၪအဖၧၩ့ လၧဂံၭဘအၫဘဲၫ",
			"15": "<sup>15</sup> ၥိၭအမိဒုၭၥုၭလၧၦအံၫစရ့လၭဖိၪလီၫ.- တၭဆၧလၧ မုနံၩနီၪၦဘံၪ့ယမံၫ့ဖိၪလၧဒိၩ့လဖၪ အဖၧၩ့နီၪအီၪနံၫ လၬဎူၫထီၫ့လၧအဆိၬနၭလီၫ. လၧနီၪအမ့ၬယၫၦဂံၭ ဘအၫဖိၪလၧဆၧဝံဆၧနၬဝ့ၫ လၧၦလၧအဘၪဆၧရွံန့",
			"16": "<sup>16</sup> ဝ့ၫ,နွ့ၫယၩလီၫ.- လၧၦခမျၧးထီးအလူၬအကျၩနီၪၦ လၧအဘၪဆၧရွံန့ဝ့ၫလၧ အမၩဆၧလၧအစူၪစ့ၪအီၪ ဝ့ၫနွ့ၫယၩလီၫ. အဝ့ၫၥံၪခွံၬစိၩခိၪၥူၫလဘီၩ့နီၪလၧ",
			"17": "<sup>17</sup> လိးဘၪဝ့ၫကိၭအဂၩဒ့ၭလီၫ.- တၭအံၫစရ့လၭအၡၩ လၧအလမွဲဘၪဘံၪ့ယမံၫ့ဖိၪနီၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫၦ လံကုၬလၧအဆိၬထၪ့နၭလီၫ. အဝ့ၫၥံၪထီးအလူၬနီၪမွဲ ၦၥုၭဖိၪလီၫ.",
			"18": "<sup>18</sup> ၦအံၫစရ့လၭဖိၪဂဲထုၪ့တၭ, လ့ၩထၪ့လၧယွၩအဂံၪ့ တၭ,အၪ့စၪ့ယွၩတၭ,စံၭဝ့ၫဒၪ, ၦလၧပကျၩမိလ့ၩဆိၫ ဘဲၫၥိၭအမိဒုၭဆၧလၧၦဘံၪ့ယမံၫ့ဖိၪနီၪ မွဲဒီၪ့ဒီၪ့လဲၪ, ယဟိဝၩစံၭဝ့ၫဒၪ, ယုဒၫလၧအဝံခိၪလီၫ.",
			"19": "<sup>19</sup> လၧဂီၩလခီၫနီၪၦအံၫစရ့လၭဖိၪဂဲထုၪ့တၭ, ၥုၪ့တဲၩ",
			"20": "<sup>20</sup> ထၫ့ဒုၪဒၩဂံၭဘအၫနီၪလီၫ.- အံၫစရ့လၭအၡၩလဖၪ စဲၪ့ထၪ့ဘဲၫၥိၭအမိဒုၭဆၧထၫ့ဒၩ ဘံၪ့ယမံၫ့တၭး အံၫ စရ့လၭအၡၩအီၪတဲၩ့ဝဲၩအၥၭ ဘဲၫၥိၭအမိဒုၭၥုၭလၧ",
			"21": "<sup>21</sup> ဂံၭဘအၫဖိၪလီၫ.- ၦဘံၪ့ယမံၫ့ဖိၪ ဂဲၫထၪ့ခွံၬလၧဂံၭ ဘအၫအဖၧၩ့တၭ, လၧမုလနံၩနီၪဖ့ၬခွံၬ ၦအံၫစရ့ လၭဖိၪနံၫလၬနံၫထီၫ့ လၧဂၪ့ခိၪလီၩ့လီၫ.",
			"22": "<sup>22</sup> ၦခမျၧးၦအံၫစရ့လၭဖိၪ ဒုၭဆီၪ့ထၪ့လိၬအၥၭတၭ, တဲၩ့ဝဲၩအဆၧဒုၭထီးအလးစီၪ့ဎးလၧအတဲၩ့ဝဲၩဆၧ လၧမုအခၪ့ထံၭလနံၩနီၪလီၫ.",
			"23": "<sup>23</sup> (တၭၦအံၫစရ့လၭဖိၪ လ့ၩထၪ့လၧအမ့ၬထံၫလၩ့ လၧယဟိဝၩအမ့ၬယၫ ထီးမုဂၪလၩ့တၭ, အၪ့စၪ့ယ ဟိဝၩစံၭဝ့ၫဒၪ, ယမိဘၪလ့ၩထၪ့ ဒုၭဒီၭဆၧလၧယ ထၧၫ့ဖုဝဲဘံၪ့ယမံၫ့နီၪဆ့ဧၪး တၭယဟိဝၩစံၭဝ့ၫဒၪ, လ့ၩထၪ့ထၫ့ဒုၪဒၩအဝ့ၫဒၪဆံၭ.)",
			"24": "<sup>24</sup> နံၫနံၩလနံၩနီၪ ၦအံၫစရ့လၭဖိၪၥုၭဘူၭအၥၭထၫ့",
			"25": "<sup>25</sup> ဒုၪဒၩဘံၪ့ယမံၫ့ဖိၪလီၫ.- တၭနံၫနံၩလနံၩနီၪ ၦဘံၪ့ ယမံၫ့ဖိၪစဲၪ့ထၪ့ခွံၬလၧဂံၭဘအၫအဖၧၩ့တၭ ထၫ့ဒုၪ ဒၩအဝ့ၫၥံၪတၭ, ဖ့ၬခွံၬဒီၭၦအံၫစရ့လၭဖိၪလလၬဎိၭ ထီၫ့လၧဂၪ့ခိၪလီၩ့လီၫ. အဝ့ၫၥံၪနီၪဆိၬနၭထီးအလူၬ လီၫ.",
			"26": "<sup>26</sup> ၦအံၫစရ့လၭဖိၪထီးအလူၬနီၪ လ့ၩထၪ့လၧယွၩအ ဂံၪ့တၭ,အမ့ၬထံၫလၩ့တၭ, ဆၧၫ့နၩ့ထီးနီၪလၧယဟိ ဝၩအမ့ၬယၫဒုၪဆၧအၪ့ဆၧအီၩ လၧမုလနံၩနီၪထီးမု ဂၪလၩ့တၭ,လုထၪ့ဆၧလုမ့ၪ, ဒဲဆၧလုမၩဘၪလိၬအိၭ",
			"27": "<sup>27</sup> လိၬလၧယဟိဝၩအမ့ၬယၫလီၫ.- တၭၦအံၫစရ့လၭ ဖိၪအၪ့စၪ့ယဟိဝၩ, (အဂဲးဘဲၫယီၩ ဆၧလၧမုနံၩလ ဖၪနီၪယွၩအဆၧအုၩ့လၩ့အတလၫအီၪထီးနီၪလီၫ.",
			"28": "<sup>28</sup> တၭလၧမုနံၩလဖၪနီၪ စအၫရၧၫ့အဖိၪခွၫ စအံၫလအ့ ဇၧၫအဖိၪခွၫစဖံနအၭ ဆၧၫ့ထုၪ့လၧအမ့ၬယၫ,) တၭ စံၭဝ့ၫဒၪ,မွဲယမိဘၪလ့ၩထၪ့ဒီၭဘဲၫၥိၭယမိဒုၭၥုၭထၫ့ ဒၩယထၧၫ့ဖုဝဲ ဘံၪ့ယမံၫ့အဖိၪအလံၩနီၪဧၪး မွဲယမိ ဘၪအီၪလၩ့မါပံၭလဲၪ, တၭယဟိဝၩစံၭဝ့ၫဒၪ, လ့ၩ ထၪ့ဘီၪ,အဂဲးဘဲၫယီၩ ကဲဂီၩခိၬနီၪယမိဖ့ၪလၫ့အဝ့ၫ ၥံၪလၧနစူၪဖၧၩ့လီၫ.",
			"29": "<sup>29</sup> တၭအံၫစရ့လၭအီၪက့ၪ ၦခိၭဆၧအီၪၥူၪဝၬဖီၩ့ဂံၭ",
			"30": "<sup>30</sup> ဘအၫလီၫ.- ၥၧၫ့နံၩလနံၩနီၪ, ၦအံၫစရ့လၭဖိၪလ့ၩ ထၪ့ထၫ့ဒုၪဒၩ ၦဘံၪ့ယမံၫ့ဖိၪတၭ, တဲၩ့ဝဲၩအၥၭထၫ့",
			"31": "<sup>31</sup> ဒုၪဒၩဂံၭဘအၫ ဘဲၫလၧအခၪ့ထံၭအၥိၭနီၪလီၫ.- ၦ ဘံၪ့ယမံၫ့ဖိၪဂဲၫထၪ့ထၫ့ဒၩၦခမျၧးတၭ, ဘၪဆၧမီၩ့န့ ဝ့ၫယဲၩ့ထၪ့လၧဒိၩ့နီၪ, ဖ့ၬခွံၬဆိၫၦခမျၧးတၭ, မၩၥံၫ ၦလၧအံၫစရ့လၭအကျၩ ၥၧၫ့ဆံၫကၪယူၭဘဲၫလဖၧၫ့ လဖၧၫ့အၥိၭလၧဖၧၩ့မုလဖၪအဖၧၩ့ထီးအလဘီၩ့လ့ၩ ထၪ့လၧယွၩအဂံၪ့, ဒဲအလဘီၩ့ဒၪ လၧဂံၭဘအၫလၧ",
			"32": "<sup>32</sup> ဆၧပျၩ့ဖၧၩ့နီၪလီၫ.- တၭၦဘံၪ့ယမံၫ့ဖိၪစံၭဝ့ၫဒၪ, အ ဝ့ၫၥံၪဘၪဆၧဖ့ၬခွံၬယူၭအၥၭလၧ ပမ့ၬယၫဘဲၫလၧအ ခၪ့ထံၭအၥိၭနီၪယူၭ, အ့ၪမွဲၦအံၫစရ့လၭဖိၪစံၭဝ့ၫဒၪ, မွဲပစဲၪ့ၡီၩ့တၭ, ထုၭထၪ့ခွံၬအဝ့ၫၥံၪလၧဒိၩ့ဖၧၩ့လၧ",
			"33": "<sup>33</sup> ဖၧၩ့မုလဖၪနီၪဘီၪ.- အံၫစရ့လၭအၡၩထီးအလူၬဂဲ ထုၪ့လၧအလးတၭ, တဲၩ့ဝဲၩအၥၭလၧဘၫအလၭတၫ မၫတၭ,အံၫစရ့လၭအၡၩခိၭၥူၪဆၧနီၪဂဲၫထၪ့လၧအ",
			"34": "<sup>34</sup> လး,လၧဂံၭဘအၫအဆၧပျၩ့ဖၧၩ့နီၪလီၫ.- တၭၦဂဲၫ ထၪ့ထၫ့ဒၩဂံၭဘအၫလၧၦဘၪဆၧရွံန့ဝ့ၫ လလၬလၧ ၦအံၫစရ့လၭဖိၪထီးအလူၬအကျၩတၭ, ဒုၭဆၧဆီၪ့ ဆီၪ့လ့ၬလီၫ. တၭၥ့ၪယၫလၧဆၧအၧၩ့အီၪဘူၭလၧအ",
			"35": "<sup>35</sup> ဝ့ၫၥံၪအ့ၬ.- ယဟိဝၩဖ့ၬခွံၬဘံၪ့ယမံၫ့လၧအံၫစရ့လၭ အမ့ၬယၫတၭ, ၦအံၫစရ့လၭဖိၪမၩဂၭဂီၩ့ခွံၬၦနံၫလၬ ယဲထီၫ့လယၩလၧၦဘံၪ့ယမံၫ့ဖိၪ အကျၩလၧမုလနံၩ နီၪလီၫ. အဝ့ၫၥံၪနီၪဆိၬနၭကိၭဂၩဒ့ၭလီၫ.",
			"36": "<sup>36</sup> တၭၦဘံၪ့ယမံၫ့ဖိၪဒၪဘၪဝ့ၫ လၧအဘၪဆၧဖ့ၬခွံၬဝ့ၫ လီၫ.အဂဲးဘဲၫယီၩ ၦအံၫစရ့လၭဖိၪဖ့ၪလၫ့ၦဘံၪ့ယ မံၫ့ဖိၪအလးလီၫ. အဂဲးဘဲၫယီၩမွဲအဒိၭနဲၩ့အၥၭလၧ ၦခိၭၥူၪဆၧလၧအအီၪက့ၪယူၭဝ့ၫလၧဂံၭဘအၫအနဲၩ့",
			"37": "<sup>37</sup> ထံၭလီၫ.- ၦခိၭၥူၪဆၧမၩချဲၫ့ချဲၫ့တၭ, စဲၪ့ၡိၫလၧဂံၭ ဘအၫတၭ,ၦခိၭၥူၪဆၧလဖၪ အၪ့နၩ့ဖၭအၥၭတၭ,",
			"38": "<sup>38</sup> ဖ့ၬခွံၬဒိၩ့ထၧၫ့ဒိၩ့ယၫ လၧနၭအနါလီၫ.- တၭအံၫစ ရ့လၭအၦၡၩ ဒဲၦခိၭၥူၪဆၧလဖၪအီၪ လၧအဆၧဖၭ ဝဲၩအဆၧမၩနဲၪ့လမံၩ့, လၧအမိဒုၭထၪ့မ့ၪခဲၩဖၭဒိၪ,",
			"39": "<sup>39</sup> ဒဲမ့ၪခူၪလၧဒိၩ့ဖၧၩ့လီၫ.- ထီးၦအံၫစရ့လၭဖိၪစဲၪ့လၧ ဆၧဒုၭၥုၭအဖၧၩ့နီၪတၭ, ဘံၪ့ယမံၫ့ဖ့ၬခွံၬဆိၫတၭ, မၩၥံၫၦဖိၭဘိၭၥၧၫ့ဆံၫ, လၧၦအံၫစရ့လၭဖိၪအကျၩ နီၪလီၫ.အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, မွဲမၬအဝ့ၫၥံၪဘၪဆၧ ဖ့ၬခွံၬဝ့ၫလၧပမ့ၬယၫဘဲၫဆၧဒုၭ လၧအခၪ့ထံၭလဖၧၫ့",
			"40": "<sup>40</sup> အၥိၭနီၪလီၫ.- အ့ၪမွဲထီးမ့ၪခဲၩထၪ့ၥၫ့တၭ, မ့ၪခူၪလ ထုၪ့အီၪလၧဒိၩ့ဖၧၩ့တၭ, ဘံၪ့ယမံၫ့ဖိၪယိထဲၩ့လၧအ လးခဲၫ့လခီၫနီၪတၭ, ယိခွါ,ဒိၩ့မ့ၪအလၪထၪ့လၧမူၭ",
			"41": "<sup>41</sup> ခိၪလီၫ.- ထီးအံၫစရ့လၭအၦၡၩကၠၪထဲၩ့အၥၭတၭ, ဘံၪ့ယမံၫ့အၡၩအီၪက့ၪအၥၭ ထီၫမံၫထီၫမၪလီၫ.အ ဂဲးဘဲၫယီၩဒၪဘၪဝ့ၫလၧ ဆၧအၧၩ့ဆၧၥၫ့ဂဲၫဘၪအ",
			"42": "<sup>42</sup> လီၩ့လီၫ.- တၭကၠၪအၥၭလၧအံၫစရ့လၭ အမ့ၬယၫ လၧၡါမုနၧၫ့ဖၫအဖၧၩ့ၥၭလီၫ. မွဲလါနၫ့ဆၧဒုၭၥုၭနီၪ ချႃၭန့ဝ့ၫတၭ,မၩဂၭဂီၩ့ခွံၬ ၦလၧအဂဲၫထၪ့လၧဒိၩ့လ",
			"43": "<sup>43</sup> ဖၪအဖၧၩ့နီၪအကျၩလီၫ.- အဝ့ၫၥံၪဝၩ့ထဲၩ့ၦဘံၪ့ယ မံၫ့ဖိၪဝၬဖီၩ့ဝ့ၫ, လီၩ့ဆီးအဝ့ၫၥံၪ, ယဲးထဲးဝ့ၫယီၫခိၬ",
			"44": "<sup>44</sup> ဎၩ့လၧဂံၭဘအၫလၧမုထၪ့လခီၫလီၫ.- တၭၦလၧဘံၪ့ ယမံၫ့အကျၩနီၪလၩ့ထံၩဖါဝ့ၫလလၬဎိၭထီၫ့လီၫ. အ",
			"45": "<sup>45</sup> ဝ့ၫၥံၪနီၪမွဲၦၥၭဒူၩထီးအလူၬလီၫ.- တၭအဝ့ၫၥံၪကၠၪ အၥၭတၭ,စဲၪ့လၧၡါမုနၧၫ့ဖၫ, လၧလဲၫ့ရံမၧၫ့အအီၪ လီၫ.ဆၧအၪ့ထုၫ့ထၪ့န့လၧအဝ့ၫၥံၪ လၧဖၧၩ့ၥၭမုလ ဖၪအဖၧၩ့နီၪၦယဲထီၫ့တၭ, လီၩ့ဆီးဝ့ၫတၭ, ချႃၭန့အ ဝ့ၫၥံၪလၧဂံဒၧၫ့တၭ, မၩၥံၫၦနံၫထီၫ့ လၧအဝ့ၫၥံၪအ",
			"46": "<sup>46</sup> ကျၩနီၪလီၫ.- တၭကယဲၦလၧဘံၪ့ယမံၫ့အကျၩလၧ အဆိၬနၭလဖၪလၧအလၩ့ထံၩဖါလၧ မုဆၫလနံၩနီၪ မွဲၦနံၫလၬယဲထီၫ့လီၫ. အဝ့ၫၥံၪနီၪမွဲၦၥုၭဖိၪထီးအလူၬ",
			"47": "<sup>47</sup> လီၫ.- ၦၡၩဎူၫယၩကၠၪအၥၭတၭ, စဲၪ့လၧၡါမုနၧၫ့ဖၫ လၧလဲၫ့ရံမၧၫ့အအီၪတၭ, အီၪဝ့ၫလၧလဲၫ့ရံမၧၫ့လၩ လံဘံၪ့လီၫ.",
			"48": "<sup>48</sup> အံၫစရ့လၭအၡၩကၠၪထဲၩ့အၥၭလၧၦဘံၪ့ယမံၫ့ဖိၪ အအီၪတၭ, ဖ့ၬခွံၬအဝ့ၫၥံၪလၧနၭအနါ, လၧဒိၩ့အၦ ၡၩဖိးလၧဆၧဖိၪဆၧဎါအဒိၩ့, ဖိးလၧကယဲဆၧလၧ အန့ဝ့ၫထီးအလူၬလီၫ. ကယဲဒိၩ့လၧအဒၪန့ဝ့ၫထီးအ လူၬနီၪဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪဆ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭအၡၩခွၫၥံၪဆိၪလၩ့ ဝဲၩယူၭအၥၭလၧ မံဇပၫတၭ,စံၭဝ့ၫဒၪ, ၦလၧပကျၩနီၪဖ့ၪလၫ့အဖိၪမုၪ",
			"2": "<sup>2</sup> လၧဘံၪ့ယမံၫ့အဂး နးဂၩအ့ၬ.- ၦခမျၧးဂဲၫထၪ့လၧ ယွၩအဂံၪ့ဖၧၩ့တၭ, အီၪဝ့ၫထီးနီၪလၧယွၩအမ့ၬယၫ ထီးမုဂၪလၩ့တၭ, ထုၭထၪ့အလူတၭအမ့ၬထံၫလၩ့နၭ",
			"3": "<sup>3</sup> မၬလီၫ.- စံၭဝ့ၫဒၪ,ယဟိဝၩအံၫစရ့လၭအယွၩဧ့,လၧ အံၫစရ့လၭအဒီၪ့လဖၪအကျၩ, အံၫစရ့လၭလၩ့ၡၩ ၦလဒီၪ့လၧမုဆၫလနံၩယီၩ ဆၧမၩအၥၭယီၩ, မွဲဘၪ",
			"4": "<sup>4</sup> လဲၪ.- မုဆဲၪ့ထၪ့လနံၩနီၪ ဆၧမၩအၥၭလၧၦခမျၧးဂဲ ထုၪ့ဂီၩဂီၩတၭမၩထၪ့ဆၧလုလးထီးနီၪတၭ, လုထၪ့ ဆၧလုမ့ၪ, ဒဲဆၧလုမၩဘၪလိၬအိၭလိၬလီၫ.",
			"5": "<sup>5</sup> တၭၦအံၫစရ့လၭဖိၪစံၭဝ့ၫဒၪ, ၦလၧအံၫစရ့လၭအ ဒီၪ့ထီးအလူၬအကျၩလၧ အလဂဲၫထၪ့ဘၪလၧဆၧအီၪ ကီၪ့ယဟိဝၩအအီၪနီၪ, မွဲပလၫလဂၩလဲၪ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪဆိၪလၩ့အၥၭ လၧဆၧဆိၪဖၭဒိၪလၧၦ လၧအလဂဲၫဘၪလၧယဟိဝၩအအီၪလၧမံဇပၫအဂဲး အကၠီၪ့တၭ,စံၭဝ့ၫဒၪ, ၥံၫတၭမိဘၪဆၧမၩၥံၫတၡါဝ့ၫ လီၫ.",
			"6": "<sup>6</sup> တၭၦအံၫစရ့လၭဖိၪၥ့ၪယၫ နီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧၦထၧၫ့ဖုဝဲဘံၪ့ယမံၫ့အကၠီၩ့တၭ, စံၭဝ့ၫဒၪ,ၦလဒီၪ့ ဘၪဆၧဖ့ၬထ့ၬခွံၬဝ့ၫလၧအံၫစရ့လၭ အကျၩလၧမုဆၫ",
			"7": "<sup>7</sup> လနံၩယီၩလီၫ.- မွဲပဆိၪလၩ့ပၥၭလၧယဟိဝၩအမ့ၬ ယၫလၧပလဖ့ၪလၫ့ဘၪအဝ့ၫၥံၪ လၧပဖိၪမုၪ လၧအ မၫအဂးတၭ, ပမိမၩလၧၦလၧအအီၪလၩ့ထးလဖၪအ",
			"8": "<sup>8</sup> ဂးဘဲၫၥိၭအမိန့မၫဘဲၫၥ့ၪလဲၪ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫ ဒၪ,လၧအံၫစရ့လၭအဒီၪ့လဖၪအကျၩ ၦလၧအလဂဲၫ ထၪ့ဘၪလၧမံဇပၫလၧယဟိဝၩအအီၪနီၪ, မွဲၦလဒီၪ့ လဲၪ.တၭယိခွါ, ၦလၧယၫဘ့ၭဂံလအၭနီၪ ဂဲၫလၧၦ",
			"9": "<sup>9</sup> ၥုၪ့တဲၩအလး လၧဆၧအီၪကီၪ့နးဂၩအ့ၬ.- အဂဲးဘဲၫ ယီၩၦခမျၧးဘၪဆၧဝံထၪ့နၬထၪ့တၭ, ယိခွါယၫဘ့ၭဂံ",
			"10": "<sup>10</sup> လအၭဖိၪအီၪထီးနီၪနးဂၩအ့ၬ.- ဆၧအီၪကီၪ့အၪ့မၧၫ့ လၩ့ၦၡၩလၧအဆီၪ့ထုၬ လလၬနံၫထီၫ့လၧနီၪတၭ, မၪလူၬအဝ့ၫၥံၪတၭစံၭအဝ့ၫဒၪ, လ့ၩဖ့ၬခွံၬၦယၫဘ့ၭ ဂံလအၭဖိၪလၧနၭအနါ, ဒဲၦမုၪၦမၧၩ့, ဒဲဖိၪဒံၩဖိၪၥၪ",
			"11": "<sup>11</sup> နီၪဘီၪ.- တၭနၥံၪမိဘၪမၩဆၧယီၩ, နၥံၪဘၪမၩဂၭ ဂီၩ့ခွံၬကယဲၦခွၫ, ဒဲကယဲၦမုၪလၧအၥ့ၪယၫမံၫဎုၬလၧ",
			"12": "<sup>12</sup> ၦခွၫကိၭဂၩဒ့ၭလီၫ.- တၭအဝ့ၫၥံၪဒၪဘၪဝ့ၫလၧၦယၫ ဘ့ၭဂံလအၭဖိၪအကျၩ, လၧဖိၪၥၪမုၪ,ၦမုၪနၩ့လံယၩ လၧအၥ့ၪယၫမံၫဎုၬလၧၦခွၫအ့ၬ. တၭအဝ့ၫၥံၪဂဲၫ ထဲၩ့ဆိၬဝ့ၫလၧၦၥုၪ့တဲၩအလး ထီးၡဲလိၫလၧအအီၪ လၧခးကၫနအၫ့အဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> တၭဆၧအီၪကီၪ့ထီးအလူၬ အၪ့မၧၫ့ၦလ့ၩချဲၩ့ဆၧ လၧၦဘံၪ့ယမံၫ့ဖိၪလၧအအီၪ လၧလဲၫ့ရံမၧၫ့တၭ,ကိၭ",
			"14": "<sup>14</sup> န့ဝ့ၫမုၬမုၬလီၫ.- အထီနီၪဘံၪ့ယမံၫ့ဂဲၫထဲၩ့ထဲၩ့တၭ အဝ့ၫၥံၪဖ့ၪလၫ့ဝ့ၫအမၫလဖၪ လၧယၫဘ့ၭဂံလအၭအ မုၪလၧအဒုၭမၧၫ့ဒံၭဝ့ၫလီၫ. မွဲလါနၫ့ဘိၩ့, လၧၫ့လၧအ",
			"15": "<sup>15</sup> ဝ့ၫၥံၪအဂးအ့ၬ.- တၭၦခမျၧးနၪ့ထၪ့နီၫ့ယါလၩ့ထဲၩ့ အၥၭလၧဘံၪ့ယမံၫ့အကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩယဟိ ဝၩမၩဆၧလၩ့ဎီးလၧအံၫစရ့လၭအဒီၪ့အကျၩလဖၪ လီၫ.",
			"16": "<sup>16</sup> တၭဆၧအီၪကီၪ့အၥၭၡါစံၭဝ့ၫဒၪ, ၦလၧအအီၪလၩ့ ထးလဖၪနီၪ,မိမၩဘဲၫၥိၭအမိန့ဘၪဘဲၫၥ့ၪလဲၪ. အဂဲး ဘဲၫယီၩၦမုၪဂၭဂီၩ့ယူၭ လၧဘံၪ့ယမံၫ့အကျၩယူၭ.-",
			"17": "<sup>17</sup> တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ဆၧန့ၥၫဘၪအီၪလၧၦလၧအ ဖီၩ့ဖျ့ၭလၧဘံၪ့ယမံၫ့ အကျၩနီၪဘဲၫၥိၭၦလဒီၪ့ ထီး",
			"18": "<sup>18</sup> လၩ့မါလၧအံၫစရ့လၭ အကျၩနီၪလဂ့ၩလီၫ.- မွဲလါ နၫ့ပဝ့ၫဒၪယီၩပဖ့ၪလၫ့ဘၪအမၫ လၧပဖိၪအကျၩအ့ၬ. အဂဲးဘဲၫယီၩၦအံၫစရ့လၭဖိၪ ဆိၪလၩ့ယူၭအၥၭ တၭ,စံၭဝ့ၫဒၪ, ၦလၧအဖ့ၪလၫ့မၫနီၪ လၧဘံၪ့ယမံၫ့ တၭ,မွဲအဘၪဆိၪအၧၩ့ဆံၭ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ယိခွါဆၧမၩဘိၪ့ ယဟိဝၩအီၪဝ့ၫ လၧၡဲလိၫအဖၧၩ့ကိၭနံၪ့ဒ့ၭ ထီးအ လးလၧဘ့ၥလၭ လၧမုဖၩလခီၫလၧဖၧၩ့ၥၭမုလၧအ လ့ၩထၪ့ခွံၬလၧဘ့ၥလၭဖိးလၧၡံခံၫ့မုထၪ့လခီၫ, ဒဲလၧ",
			"20": "<sup>20</sup> လဘိနၫမုခံၫ့လခီၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫ ၥံၪမၪလူၬၦဘံၪ့ယမံၫ့ဖိၪတၭ, စံၭဝ့ၫဒၪ, လ့ၩအီၪခိၭ",
			"21": "<sup>21</sup> ၥူၪလၧစဘံၭမုအလးဖၧၩ့လဖၪနီၪဘီၪ.- ယိတၭ,ယိ ခွါ,ၦၡဲလိၫအဖိၪမုၪ အ့ၪဂဲၫထၪ့ဂဲထုၪ့လံ လၧဆၧဂဲ ထုၪ့လံအကျၩတၭ, ထီးနီၪလဖၧၫ့ ဂဲၫထၪ့နၥံၪဝ့ၫလၧ စဘံၭမုအလးဖၧၩ့တၭ, ဖီၪ့န့လဂၩအမၫ,လဂၩအမၫ လၧၦၡဲလိၫအဖိၪမုၪအကျၩတၭ, ထဲၩ့ထဲၩ့လၧဘံၪ့",
			"22": "<sup>22</sup> ယမံၫ့အခးဖၧၩ့နီၪဘီၪ.- တၭထီးအဖါလဖၪမွဲဂ့ၩ, အထၧၫ့ဖုဝဲမွဲဂ့ၩ, ဂဲၫချဲၩ့ခွးလၧပအီၪတၭ, ဆၧမိမၩ အၥၭလၧပမိစံၭအဝ့ၫၥံၪ, ယိမ့ၬပၧၩတၭ, ယၫ့ၥၭ အဝ့ၫၥံၪနီၪဘီၪ. အဂဲးဘဲၫယီၩ လၧဆၧဒုၭၥုၭအဖၧၩ့ နီၪပအီၪက့ၪလၩ့ထးဘၪ အမၫလဂၩလဂၩ လၧအဂး ဒၪဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ အထီထီးနီၪနၥံၪလဖ့ၪလၫ့ ဘၪဝ့ၫ,ဘဲၫၥိၭနၥံၪအဆၧဒဲၩဘၭထီးအီၪလဂ့ၩလီၫ.",
			"23": "<sup>23</sup> ၦဘံၪ့ယမံၫ့ဖိၪမၩဝ့ၫဘဲၫနီၪတၭ, မၩန့အမၫဘဲၫအ ဆၧဝံဆၧနၬအၥိၭ, လၧၦဂဲထုၪ့လံအကျၩလၧအဖီၪ့န့ ဝ့ၫလီၫ. လ့ၩဆၧတၭ, ထဲၩ့ထဲၩ့လၧဆၧန့ၥၫအအီၪ တၭ,မၩထၪ့ထဲၩ့အဒိၩ့လဖၪတၭ, အီၪဝ့ၫလၧအဖၧၩ့",
			"24": "<sup>24</sup> လီၫ.-တၭအထီထီးနီၪၦအံၫစရ့လၭဖိၪစဲၪ့ထၪ့ခွံၬ ထီးနီၪလဂၩထီၩ့ လၧအဒီၪ့ဒၪဝ့ၫ, ဒဲလၧအဂံၪ့ဒီၪ့ဒၪ ဝ့ၫဆုၬဆုၬတၭ, အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬထီးနီၪလဂၩထီၩ့ လၧအဆၧန့ၥၫဒၪဝ့ၫ, လဂၩလၧအဆၧန့ၥၫဒၪဝ့ၫဆုၬ",
			"25": "<sup>25</sup> ဆုၬလီၫ.- ဆၧလၧမုနံၩလဖၪနီၪစဎွၩအီၪလၧအံၫစရ့ လၭအဖၧၩ့အ့ၬ. ၦမၩဆၧထီးဒၪ အတီၩအလီၩ့လၧ အမ့ၬၥၪဒၪဝ့ၫဆုၬဆုၬလီၫ."
		}
	}
};
module.exports = book;